INSERT INTO `listings` (`id`, `user_id`, `title`, `slug`, `description`, `approved`, `verified`, `spam`, `logo`, `phone`, `phone_afterhours`, `website`, `email`, `facebook`, `twitter`, `service_area`, `address`, `latitude`, `longitude`, `imported`, `created_at`, `updated_at`) VALUES
(1104, NULL, 'Advanced Care', 'advanced-care', 'Affordable accessible transportation: No matter what vehicle you need, the price will always be the same. That means no over paying for larger vehicles. All our flat fees include ride-along caregivers and aides…at no additional cost.We are passionate and dedicated in assisting people with special needs by providing transport that fits best with your individual circumstances.At Advanced Care transport services, we’re passionate about giving you nothing less than the perfect transportation experience…from the time of the initial booking, to the final drop-off. From our highly-trained expert drivers, to our comfortable and immaculate vehicles, we invite you to experience the difference.We are Victoria’s premier disability transportation company; we’ve been serving special needs passengers with rides to work, physical therapy, doctor’s appointments or just a day in the City for some fun. Rely on us for dependable, on time transportation to your destinations in private cars and wheel chair accessible vans.', 1, 0, 0, '34W6uY2vFvyL5hKD.jpg', '0402 355 267', NULL, NULL, 'info@advancedcare.net', NULL, NULL, NULL, '1/10 Churchill Avenue, Ascot Vale, Victoria 3032', '-37.78062801230941', '144.92135699999994', 0, '2015-11-19 12:43:07', '2015-12-06 12:49:42'),
(1105, 292, 'Melbourne City Mission', 'melbourne-city-mission', 'Every day, Melbourne City Mission works with some of Melbourne and Victoria’s most vulnerable individuals, families and communities. Every week, we help thousands of people escape and avoid disadvantage, economic exclusion and social isolation. We’ve been around for almost as long as Melbourne itself and over the years have adapted and evolved alongside the people we work with, always responding to the changing needs of communities. Our staff are dedicated professionals, with the expertise to deliver holistic, integrated services that really make a powerful and sustainable difference to people’s lives.', 1, 1, 0, 'GzBTPJHxGuyuBIBQ.jpg', '8625 4444', '', 'http://www.melbournecitymission.org.au', 'info@mcm.org.au', 'facebook.com/melbournecitymission', 'twitter.com/melbcitymission', 'HEAD OFFICE\r\nTel: 03 8625 4444 \r\nFax: 03 8625 4410 \r\nPO Box 13210, Law Courts, Melbourne VIC 8010, Australia    \r\n164–180 Kings Way, South Melbourne VIC 3205, Australia\r\n\r\nOTHER OFFICES AND SERVICES\r\n\r\nBraybrook\r\nPhone: (03) 8311 5400\r\n3/6–12 South Road, Braybrook VIC 3019, Australia\r\n\r\nThornbury\r\n(Disability Services)	\r\nMain office: (03) 9487 9200 \r\nDisability Intake: 1800 343 287              	\r\n230 Normanby Avenue, Thornbury VIC 3071, Australia\r\n\r\nNorth Fitzroy\r\n(Adult Homelessness)\r\nPhone: (03) 9687 4997	\r\n229 Barkly Street, Footscray VIC 3011, Australia \r\n\r\nFootscray\r\n(Palliative Care)	\r\nPhone: (03) 9486 2666\r\nFax: (03) 9482 5094	\r\n472 Nicholson Street, North Fitzroy VIC 3068, Australia  \r\n\r\nBrunswick\r\n(Hartnett House Children''s Services)	\r\nPhone: (03) 9385 3200\r\nFax: (03) 9386 8631	\r\n123 Albion Street, Brunswick VIC 3056, Australia  \r\n\r\nFrontyard Youth Services (Homeless)	\r\nPhone: (03) 9611 2411\r\nOut of hours: 1800 825 955	\r\n19 King Street, Melbourne VIC 3000, Australia  \r\n\r\nFamily Crisis Accommodation Services (Homeless)	\r\nPhone: (03) 9312 0851	\r\n6/147 Harvester Road, Sunshine VIC 3020, Australia  ', '164–180 Kings Way, South Melbourne 3205', '-37.82925301233101', '144.96301900000003', 0, '2015-11-19 12:43:07', '2015-12-06 12:49:43'),
(1106, 293, 'IndyTech Independence Through Technology', 'indytech-independence-through-technology', 'We can provide the best way for people with disabilities to use all forms of modern technology to meet their needs and gain independence. Assistive Technology allows for interaction and control of all forms of computer, tablets, smart phones.', 1, 1, 0, 'R9qA4pepQlAVHDbP.jpg', 'David 0412 664 893   Jeff 0408 589 734', '', 'http://www.indytech.com.au', 'davidk@indytech.com.au', '', '', '', 'P.O. Box 704 PASCOE VALE, VIC 3044', '-37.72469695996901', '144.93578879999995', 0, '2015-11-19 12:43:07', '2015-12-06 12:49:43'),
(1107, 293, 'Quad Quip Solutions', 'quad-quip-solutions', 'Specializing in Custom Design &amp; Fabrication of Disabled Equipment for Quadriplegics &amp; Severely Disabled.Be it Automotive, Work Place, Home, Office, Leisure or Pleasure.', 1, 1, 0, 'd24ggyIlFTvKOvkY.jpg', '0412 664 893', '', 'http://www.quadquipsolutions.com.au', 'dkortholt@bigpond.com', '', '', '', 'P O Box 443 Drouin 3818', '-38.136884120669734', '145.85818806344605', 0, '2015-11-19 12:43:07', '2015-12-06 12:49:44'),
(1108, 294, 'Independent Disability Services Inc', 'independent-disability-services-inc', 'A key componant of the IDS Individualised Support philosophy it the importance we place on community inclusion. Our staff work closely with our clients to develop, implement, and monitor strategies that focus on their involvement in community, and activities that reflect their interests. We do this by connecting them to people in the community who share common interests and goals, whether they are organised groups or individuals.We recognise the importance of the relationship between our clients and their support workers. That is why we always encourage them to lead the selection of the person who will support them, from writing the position description, attending interviews and having the final say on who we engage. This ensures we are not only pairing them with someone who meets their needs, but also shares some common interests, which in turn results in a more sustainable and rewarding partnership.The IDS Individualised Support team work with our clients, offering flexible support that is tailored to meet the individual''s needs, recognising their circumstances and changing priorities.', 1, 1, 0, 'bxDHYX1k5e5e6oVo.jpg', '03 9340 5100', '03 9340 5100', 'http://www.idsa.org.au', 'admin@idsa.org.au', '', '', '', 'Suite 3.01, Level 3, 60 Leicester Street, CARLTON, VIC, 3053', '-37.8049386', '144.96025759999998', 0, '2015-11-19 12:43:08', '2015-12-06 12:49:44'),
(1109, 295, 'Autism Spectrum Australia (ASPECT)', 'autism-spectrum-australia-aspect', 'Autism Spectrum Australia (Aspect) is Australia’s leading service provider for autism and other disabilities. Our specialised, evidence informed schools program is the largest in the world, with additional services that include information and advice, diagnostic assessments, behaviour support, parent and family support, and adult programs. We share evidence-informed Aspect practice and applied research nationwide.Autism is a lifelong disability that affects about one in 100 Australians, or 230,000 people. The word ''spectrum'' reflects the different challenges that people with autism face and the degree to which they may be affected.Our services provide people with autism with the opportunity to realise their unique potential, as well as providing much needed support to their families, carers, friends and colleagues. Our vision is to provide the best possible opportunities for people with autism and other disabilities.', 1, 1, 0, 'EjKfV4w8Om72sPdC.jpg', '1800 277 328', '', 'http://www.autismspectrum.org.au', 'customerservice@autismspectrum.org.au', '', '', 'Sydney\r\nNorthern NSW\r\nMelbourne\r\n', 'Building 1, Level 2, 14 Aquatic Drive, FRENCHS FOREST NSW 2086', '-33.75353601061231', '151.23743000000002', 0, '2015-11-19 12:43:08', '2015-12-06 12:49:45'),
(1110, NULL, 'Just Better Care', 'just-better-care', 'At Just Better Care, we believe in the benefits of community and the connections that we make together. Everyone has the right to participate in their community, to the extent that they choose. Just Better Care leads Australia in the provision of in-home support services, enabling people to live independently at home, maintain their personal and social connections and enjoy a better quality of life.', 1, 1, 0, 'LBSdXMVXqF4McMGq.jpg', '03 9975 8100', '', 'http://justbettercare.com/', 'mailme@justbettercare.com', '', '', '', '1945 Malvern Rd, Malvern East, Victoria, 3145, Australia', '-37.8700191', '145.06141530000002', 0, '2015-11-19 12:43:08', '2015-12-16 05:52:14'),
(1111, 296, 'Blamey Saunders hears', 'blamey-saunders-hears', 'Blamey Saunders hears (BSH) provides the award-winning IHearYou® self-fit hearing aid system both online and through its face-to-face audiology clinics.BSH is a telehealth company and Australia’s only commercial teleaudiology service. Using the unique, award-winning IHearYou® system, clients can fully customise their Blamey Saunders hearing aids to their personal preferences without the need to visit an audiologist.  Should they require help, remote assistance is conveniently accessible from one of the company’s hearing or technology experts by phone, live-chat, email or screen-sharing.  Clients have access to premium level hearing aids at an affordable price and the convenience of using the IHearYou system wherever there is an internet connection, anywhere in the world.  The company and its founders, Professor Peter Blamey and Dr Elaine Saunders, have received numerous awards in recent years in recognition of the application of their research, innovative world-leading product design, execution of their business model and most importantly, service to the community.', 1, 1, 0, NULL, '0390086371', ' ', 'www.blameysaunders.com.au', 'info@blameysaunders.com.au', 'https://www.facebook.com/blameysaunders?_rdr=p', NULL, 'National', '364 Albert Street', '-37.80958701232227', '144.97914600000001', 0, '2015-11-19 12:43:08', '2015-12-06 12:49:46'),
(1112, 297, 'CAP Furniture', 'cap-furniture', 'CAP Furniture is the leading manufacturer of early childhood and custom disability furniture in Australia.We strive to give our standard and custom made furniture that special feel so that you, the customer, can tell the difference when you’re using it.We are Based in Brisbane but ship our furniture Australia wide. We can supply our standard products with custom modifications, or one off items to suit you individual needs. ', 1, 1, 0, 'V96Dn8eu49xQsAsg.jpg', '(07) 3392 6649', '', 'http://www.capfurniture.com.au', 'sales@capfurniture.com.au', '', '', '', '105A YCP, 49 Station Rd, Yeerongpilly   QLD   4105  ', '-19.845109769252247', '145.77319220000004', 0, '2015-11-19 12:43:08', '2015-12-06 12:49:46'),
(1113, 298, 'Mobility Matters P/L', 'mobility-matters-pl', 'Mobility Matters Pty Ltd is a company based in Canberra ACT that specialises in the sale of rehabilitation and hospital equipment to Canberra and surrounding region, including Southern NSW.  Mobility Matters, previously SOS, has been operating since 1978.Mobility Matters has a large showroom in Fyshwick ACT and also in Batemans Bay and Bega NSW where a huge range of equipment is on display for people to try-feel-see before buying.  The professional and friendly staff at Mobility Matters is trained to provide customers with a personalised quality service.  Mobility Matters also provide a ‘Home Trial Service’ as required.  Regional areas visited by the ACT Company Representative include:  Goulburn, Yass, Young, Cootamundra, Harden, Boorowa and Cooma.  The South Coast Representatives call on the South Coast area from Ulladulla to the Victorian Border including Bombala and Delegate.Mobility Matters is subcontracted with Paraquad to provide equipment to eligible Veterans with the Dept of Veterans Affairs RAP MFS Contract.Mobility Matters’ wide range of products is specifically designed to make your life easier!  Some of the products available are – Wheelchairs, electric hospital beds, pressure care mattresses &amp; overlays, walkers, bathroom &amp; toileting equipment, crutches, patients lifters/slings, scooters, cushions, every day living aids, orthopaedic footwear and much much more!  A wide range of Hire Equipment is also available.Mobility Matters has a fully equipped workshop at its Fyshwick premises to carry out services and repairs to supplied equipment.  Mobility Matters, in association with their Suppliers, are able to facilitate training sessions with Health Professionals to educate on use of equipment.', 1, 1, 0, 'WwMoRbVqQT5H9Qkq.jpg', '1300 726 906', '', 'http://www.mobilitymatters.com.au', 'sales@mobilitymatters.com.au', '', '', 'Caneberra, Batemans Bay, Bega, Goulburn, Yass, Young, Cootamundra, Harden, Boorowa, Cooma', '35 Townsville Street Fyshwick ACT 2609 AUSTRALIA  PO Box 669, FYSHWICK, ACT, 2609', '-35.32908136125599', '149.18333670000004', 0, '2015-11-19 12:43:09', '2015-12-06 12:49:46'),
(1114, 299, 'Leisure Networks Association Inc', 'leisure-networks-association-inc', 'Our team bring passion, values and great skills to work everyday. In partnership with our skilled Board, we aim to make a difference in all that we do.Our vision is a world which nurtures and celebrates capable, healthy people and inclusive communities. Commencing in Geelong over twenty years ago, we have a strong reputation for being creative, relevant and trusted. Our point of difference is that we work in communities building capacity to enable all people to feel more connected and included.', 1, 1, 0, 'J9RKfDGMCw34QHuL.jpg', '5222 3911', '', 'http://www.leisurenetworks.org', 'supportquery@leisurenetworks.org', '', '', '', 'Sports House, 370 Moorabool Street GEELONG VIC 3220', '-38.1563432', '144.35654780000004', 0, '2015-11-19 12:43:09', '2015-12-06 12:49:47'),
(1115, 300, 'Australian Ramp &amp; Access Solutions Pty Ltd', 'australian-ramp-amp-access-solutions-pty-ltd', 'The core business of Australian Ramp &amp; Access Solutions is the innovative design, engineering, fabrication, delivery and installation of ramp and access solution, fully compliant to Australian Standards (AAS), Australian Building Codes (BCA) and the Australian Disabled Disabilities Act (DDA).', 1, 1, 0, 'IuzH90IgrLsWc498.jpg', '1800 010 246', '', 'http://www.arasolutions.com.au', 'admin@arasolutions.com.au', '', '', '', 'Level 2, 3 Holland Drive, MELTON, VIC, 3337', '-37.687475', '144.59641799999997', 0, '2015-11-19 12:43:09', '2015-12-06 12:49:47'),
(1116, 301, 'Life Without Limits Advanced Support Group (Life Without Limits)', 'life-without-limits-advanced-support-group-life-without-limits', 'Life Without Limits Advanced Support Group (Life Without Limits) is a smaller scale Disability Service Provider which was established in 2012 by a team of people who have worked within the Disability sector for over 15 years providing direct care services and coordinating and managing disability services.The need to establish a smaller scale Disability Service was identified to provide people with access to a safe, creative, flexible and fun filled array of disability programs which sole purpose is to support people to live the best life possible and ensure people are provided with a service that meets their individual needs, goals and preferences.Due to our small scale structure we are able to provide people with a service which is individualised, flexible and innovative as we are able to implement new programs and new ways of supporting people in a timely manner unlike many larger scale organisations.One of the many reasons that makes us different to other disability service providers is that our management spend just as much time providing direct care services to participants as they do in the office. We want to ensure that we are providing a service which exceeds people’s expectations and meets people’s needs – the best way for us to do this is to allow transparency between participants, families and management. As the NDIS rolls out and we embark on a new journey to revolutionising disability services we want to be a leading new generation of disability service providers.Our staff are passionate about supporting people to live the best life possible, hold Disability/Community Services qualifications, A National Police Record Check, A Working with Children’s Check and a current First Aid Certificate.We are registered as a Disability Service Provider with The National Disability Insurance Agency, The Transport Accident Commission and The Victorian Work Cover Authority to provide disability services across the Barwon and Melbourne regions.We provide a range of In Home and Community based disability services to children, young people, adults and people who are ageing 24 hours a day, 7 days a week, all year round.Our services are based on a person centered approach to care which reflects our core values to MOTIVATE, CREATE and SUPPORT people to live the best life possible.Its your life, your choice – We support or assist you when required. For more information about our disability programs please contact our office on 03 9090 7205.', 1, 1, 0, NULL, '03 9090 7205', '0478 752 536 ', 'http://lifewithoutlimits.net.au/', 'info@lifewithoutlimits.net.au', NULL, NULL, NULL, NULL, '0', '0', 0, '2015-11-19 12:43:09', '2015-12-06 12:49:47'),
(1117, 302, 'ASN – Disability Access Consultants', 'asn-disability-access-consultants', 'ASN strives to be the industry leader in providing advice and development of creative and innovative concepts that revolutionise the disability industry, whilst providing accurate and up-to-date information that facilitates an inclusive mindset – increasing the number of accessible opportunities for people with a disability.ASN was founded in July of 2004 by Dale Sheppard (Quick Bio Here). ASN is a flexible company that works collaboratively with organisations, as a consultant or secondary advisor. At ASN we are committed to providing accurate advice and creative solutions to increase the opportunities for people with a disability.ASN was the first access consulting company is Australia to implement a ISO9000 compliant Quality Management system throughout the business.', 1, 1, 0, NULL, '(03) 9705 2149', NULL, 'http://www.asnpl.com.au/', 'info@asnpl.com.au', NULL, NULL, NULL, NULL, '0', '0', 0, '2015-11-19 12:43:09', '2015-12-06 12:49:49'),
(1118, 303, 'G Adventures', 'g-adventures', 'G Adventures is an adventure travel pioneer offering the planet''s most awe-inspiring selection of affordable small-group tours, safaris and expeditions. Our award-winning trips embrace authentic accommodation, exotic cuisine and local transport to put travellers on a first-name basis with the planet’s people, cultures, landscapes and wildlife.&nbsp;Jump on www.gadventures.com.au and check out the hundreds of adventure tours on offer.', 1, 1, 0, 'mBSStPtDVSmFY1es.jpg', '1300 853 325', NULL, 'http://www.gadventures.com.au/', 'melbourne@gadventures.com', NULL, NULL, NULL, 'Level 3, 28 Clarendon St, Southbank VIC 3006, Australia', '-37.82489601232907', '144.95633699999996', 0, '2015-11-19 12:43:09', '2015-12-06 12:49:49'),
(1119, 304, 'The Neuro Practice &#8211; Bendigo', 'the-neuro-practice-8211-bendigo', 'The Neuro Practice physiotherapy offers personalised therapy and guidance to assist you to reach your physical potential. The Neuro Practice was established in 2002. It was created in response to the need for people to be able to access specialised Neurological Physiotherapy services across central Victoria. Therapists at The Neuro Practice are experienced clinicians who work with their clients to identify their therapy goals and provide expert assessment, treatment and education. In addition to neurological physiotherapy we also specialise in paediatric physiotherapy and are skilled in a range of other physio disciplines. We offer physiotherapy sessions in our easily accessible treatment rooms or provide home based therapy when it is more suited to the client''s level of ability and functional needs. The Neuro Practice clinicians are able to assist with tailored home exercise programs, carer training, community hydrotherapy, gymnasium programs and prescription of customized equipment. Group therapy has commenced at The Neuro Practice to ensure greater access to prescribed exercise, strength and balance re-training to assist you with your program. The Neuro Practice has consulting rooms in Bendigo and Ballarat with specialised equipment for neurological conditions. We also cater for clients from other parts of Victoria from Shepparton and Seymour in the east to as far west as Hamilton and Portland. All Therapists are committed to ongoing clinical education and work under the guidelines of evidence based practice. We abide by the Australian Physiotherapy Association ethics and code of conduct.', 1, 1, 0, 'XY8GYbgzVoEkn5mw.jpg', '(03) 5443 4375', NULL, ' http://theneuropractice.com.au/', 'info@theneuropractice.com.au', NULL, NULL, NULL, '225 Carpenter Street QUARRY HILL, 3550, VIC', '-36.78406901187309', '144.284312', 0, '2015-11-19 12:43:10', '2015-12-06 12:49:49'),
(1120, 305, 'Morris Cohen Glen &#038; Co', 'morris-cohen-glen-038-co', 'Supportive Financial Services in Aged and Disability Care', 1, 1, 0, 'ntUiW0akD8haTerK.jpg', '(03) 9804 0888', NULL, 'http://www.morco.com.au/', 'partners@morco.com.au', NULL, NULL, NULL, '1198 Toorak Road, Camberwell VIC 3124 ', '-37.848862012339715', '145.08017199999995', 0, '2015-11-19 12:43:10', '2015-12-06 12:49:50'),
(1121, 306, 'Mobility Aids Australia', 'mobility-aids-australia', 'At Mobility Aids Australia we take pride in offering you a wide range of brands and equipment and in helping you select the best product for your needs.You can buy from us with confidence knowing that we offer a 14 day money back guarantee and free delivery with fully informative product orientation &amp; safety information. We also provide outstanding after-sale support.View the full product range right here online. We offer electric scooters, lift chairs, wheelchairs, walkers, electric beds, bathroom and toilet aids and much more.Then buy online or visit our showroom located in Springvale to discuss your requirements with our highly knowledgeable and helpful staff.', 1, 1, 0, 'NNSkjnp2uSVT25Vy.jpg', '(03) 9546 7700 ', NULL, 'http://www.mobilityaids.com.au/', 'info@mobilityaids.com.au ', NULL, NULL, NULL, '1 / 820 Princes Highway Springvale 3171 Melway: 80 C6, Australia. ', '-37.9382070123795', '145.162783', 0, '2015-11-19 12:43:10', '2015-12-06 12:49:50'),
(1122, NULL, 'Therapy Choices', 'therapy-choices', 'Therapy Choices a joint partnership between the Australian Government and Occupational Therapy Australia. Its sole purpose is to help people with a disability better understand the roles of the many allied health professionals/therapists who are available to provide supports under the NDIS.Therapy Choices is a web site.  The Therapy Choices site also provides examples of national not-for-profit organisations and government programs which support daily living activities.Find the right type of therapist for youThe NDIS gives you many choices and the control over how to live your life the way you want. It supports you in deciding what is most important in your life and working towards it.The Therapy Choices site is a guide to choosing and finding the right type of therapist to enable you to reach your goal more easily or quickly.', 1, 0, 0, 'fEOmNV2udM8FxfCZ.jpg', NULL, NULL, 'http://therapychoices.org.au', NULL, NULL, NULL, NULL, NULL, '0', '0', 0, '2015-11-19 12:43:10', '2015-12-06 12:49:50'),
(1123, 307, 'Administrative Appeals Tribunal', 'administrative-appeals-tribunal', 'Do you disagree with a decision of the National Disability Insurance Agency (NDIA)?If you disagree with a decision made by the NDIA you can apply to have the decision reviewed by the NDIA. This is called an internal review. If you still disagree with a decision after an internal review, you can apply to the Administrative Appeals Tribunal (AAT) for an external merits review. The AAT is separate and independent from the NDIA.What support is available?When you apply to the AAT you will be told that an independent support person will be able to help you with your application. The support person can assist you to understand the process, attend conferences and hearings with you, and assist you in putting your case to the AAT. As the appeal process may seem overwhelming, the support person may asisst you with every aspect of your appeal. There are support persons available in every NDIS trial site.The Administrative Appeals Tribunal (AAT) provides independent review of a wide range of administrative decisions made by the Australian Government and some non-government bodies. The AAT also reviews decisions of the Norfolk Island Government.The AAT aims to provide fair, impartial, high quality and prompt review with as little formality and technicality as possible. Both individuals and government agencies use the AAT''s services.', 1, 1, 0, '2mSoIEB3rftntdbf.jpg', '1300 366 700', NULL, 'http://www.aat.gov.au', 'melbourne.registry@aat.gov.au', NULL, NULL, NULL, 'Level 16, HWT Tower, Southgate 40 City Road Southbank', '-37.82117541232741', '144.96696910000003', 0, '2015-11-19 12:43:10', '2015-12-06 12:49:51'),
(1124, 308, 'Victorian Equal Opportunity and Human Rights Commission', 'victorian-equal-opportunity-and-human-rights-commission', 'The Victorian Equal Opportunity and Human Rights Commission is an independent statutory body with responsibilities under three laws:Equal Opportunity Act 2010Racial and Religious Tolerance Act 2001Charter of Human Rights and Responsibilities Act 2006.The Equal Opportunity Act 2010 makes it against the law to discriminate against people on the basis of a number of different personal characteristics.The Racial and Religious Tolerance Act 2001 makes it against the law to vilify people because of their race or religion.Under the Equal Opportunity Act 2010 and the Racial and Religious Tolerance Act 2001, the Commission helps people resolve complaints of discrimination, sexual harassment, victimisation and racial or religious vilification through a free, fair and timely dispute resolution service with the aim of achieving a mutual agreement.The Charter of Human Rights and Responsibilities Act 2006 (the Charter) means that government and public bodies must consider human rights when making laws and providing services.The Commission''s role is to educate people about the rights and responsibilities contained in the Charter and to report annually to the government about the operation of the Charter. The Commission does not handle complaints related to the Charter. Complaints about breaches of the Charter can be made to the Victorian Ombudsman in relation to most public authorities and to the Independent Broad-based Anti-corruption Commission in relation to police misconduct.', 1, 1, 0, 'me3sZ6i0mYklwDZe.jpg', '1300 292 153', NULL, 'http://www.humanrightscommission.vic.gov.au/', 'complaints@veohrc.vic.gov.au', NULL, NULL, NULL, 'Level 3, 204 Lygon Street Carlton Vic 3053', '-37.802186712319', '144.96675074999996', 0, '2015-11-19 12:43:11', '2015-12-06 12:49:51'),
(1125, 309, 'Ombudsman Victoria', 'ombudsman-victoria', 'The Victorian Ombudsman is an independent officer of the Victorian Parliament who investigates complaints about state government departments, most statutory authorities and local government.The Ombudsman is independent and impartial and provides a free service.', 1, 1, 0, '8YAu5z3eIPoIEnub.jpg', '(03) 9613 6222 (Regional) 1800 806 314 ', NULL, 'https://www.ombudsman.vic.gov.au/', 'ombudvic@ombudsman.vic.gov.au', NULL, NULL, NULL, 'Level 1 North Tower 459 Collins Street Melbourne VIC 3000', '-37.81803941232603', '144.95872020000002', 0, '2015-11-19 12:43:11', '2015-12-06 12:49:51'),
(1126, 310, 'Myers Street Family Medical Practice', 'myers-street-family-medical-practice', 'Myers Street Family Medical PracticeThe largest general practice in the Geelong, Ballarat and Colac region, comprising over thirty general practitioners and allied health professionals.', 1, 1, 0, 'VWFcjk5bllhQE57G.jpg', '(03) 5229 5192', NULL, 'http://www.msfm.com.au', 'reception@msfm.com.au', NULL, NULL, NULL, '148 Myers Street Geelong VIC 3220', '-38.15231741247518', '144.36198565000007', 0, '2015-11-19 12:43:11', '2015-12-06 12:49:52'),
(1127, 311, 'The Cottage Medical Centre', 'the-cottage-medical-centre', 'The Cottage Medical CentreOffering people throughout Grovedale an extensive health service which includes GPs, podiatrists, psychologists and a maternal health GP.', 1, 1, 0, '1NufXoxQBTQFLfpL.jpg', '(03) 5241 6129', NULL, 'http://www.cottagehealth.com.au', 'reception@cottagehealth.com.au', NULL, NULL, NULL, '222 Torquay Road Grovedale VIC 3216', '-38.20075901249692', '144.34174300000006', 0, '2015-11-19 12:43:11', '2015-12-06 12:49:52'),
(1128, 312, 'All Abilities Massage', 'all-abilities-massage', 'Mobile Massage Therapy for the elderly and people with a disabilityOur small team of dedicated, professional therapists provide massage treatments to people of all abilities.Wherever you are, day or night, we will come to you to enable you to access this beneficial service.', 1, 1, 0, 's7ba2cdGZwSN98sz.jpg', '0418 924 565', NULL, 'http://allabilitiesmassage.com/', 'cian@allabilitiesmassage.com', NULL, NULL, NULL, NULL, '0', '0', 0, '2015-11-19 12:43:12', '2015-12-06 12:49:52'),
(1129, 313, 'AVA Tieman', 'ava-tieman', 'AVA Tieman is Australia’s trusted provider of wheelchair lifts and accessories for all vehicles. We have more than 25 years of experience in installing lifts, and modifying vehicles to ensure optimum wheelchair accessibility.In short, we know everything there is to when it comes to converting your vehicle. We understand the needs of both businesses and individuals. We strive for exceptional workmanship and quality service.Linked with TIEMAN’S Service Division – who operates a 24 hours, 7 days a week service network comprising of some 60 Onsite Service Vehicles Nationally. This means that service and/or planned maintenance agreements can be carried out within our premises or on your designated site. AVA-Tieman can also provide service contract agents within regional areas, if and as required.Port Melbourne:     49 Fennell St, Port Melbourne VIC 3207Campbelfield:      1636 Sydney Road Campbelfield 3061Brisbane:          AVA-TIEMAN 20A Lathe Street Virginia 4014Gold Coast Queensland:      Motor Accessories Direct (Scott Sangster) Unit 6/ 54-60 Industry Drive, Tweed Heads South QLD 2486&nbsp;&nbsp;', 1, 1, 0, 'VbrUr7PNAv8lnuzB.jpg', '1300 133 353', NULL, 'http://www.ava-tieman.com/', 'info@ava-tieman.com', NULL, NULL, NULL, '49 Fennell St, Port Melbourne VIC 3207  ', '-37.82750881233022', '144.93890739999995', 0, '2015-11-19 12:43:12', '2015-12-06 12:49:53'),
(1130, 314, 'Volunteering Geelong', 'volunteering-geelong', 'VISION     To support a region where individuals feel motivated to volunteer, have the opportunity to contribute their time, skills and knowledge and are supported and encouraged to enjoy a rewarding volunteering experience.MISSION     As a leading provider of volunteering services, we will coordinate, promote, support &amp; strengthen volunteering in our community to enhance the health &amp; well being for people within the region.PURPOSE     Volunteering Geelong works with people to facilitate opportunities for volunteering, organisations to assist the development and management of volunteering and innovations to further enhance and promote the role and importance of volunteering within our community.', 1, 1, 0, 'vkX1oDRUsqlDk02S.jpg', '03 5221 1377 ', NULL, 'http://www.volunteeringgeelong.org.au', 'info@volunteeringgeelong.org.au', NULL, NULL, NULL, '217 Malop Street Geelong Vic 3220 ', '-38.14880101247359', '144.36705799999993', 0, '2015-11-19 12:43:12', '2015-12-06 12:49:53'),
(1131, 315, 'Aspect Victoria', 'aspect-victoria', 'Aspect VictoriaAutism Spectrum Australia (Aspect) is the country’s largest not-for-profit autism specific service provider. Aspect builds confidence and capacity in people with autism, their families and communities by providing information, education and other services. Aspect''s high quality professional services are available in Victoria.', 1, 1, 0, 'J0HaLMiEANPEpd4M.jpg', '(03) 9377 6600      1800 277 328', NULL, 'http://www.autismspectrum.org.au/', 'aspectvic@autismspectrum.org.au', NULL, NULL, NULL, 'Moonee Ponds Shopping Centre,  2/12 Hall St, Moonee Ponds VIC 3039', '-37.76612551230299', '144.9227942', 0, '2015-11-19 12:43:13', '2015-12-06 12:49:54'),
(1132, 316, 'Autism Spectrum Australia', 'autism-spectrum-australia', 'Autism Spectrum Australia (Aspect) is Australia’s leading service provider for autism and other disabilities. Our specialised, evidence informed schools program is the largest in the world, with additional services that include information and advice, diagnostic assessments, behaviour support, parent and family support, and adult programs. We share evidence-informed Aspect practice and applied research nationwide.Autism is a lifelong disability that affects about one in 100 Australians, or 230,000 people. The word ''spectrum'' reflects the different challenges that people with autism face and the degree to which they may be affected.Our services provide people with autism with the opportunity to realise their unique potential, as well as providing much needed support to their families, carers, friends and colleagues. Our vision is to provide the best possible opportunities for people with autism and other disabilities.', 1, 1, 0, 'hOMBqdOyS4evFeiF.jpg', '(03) 9377 6600      1800 277 328', NULL, 'http://www.autismspectrum.org.au/', 'info@autismspectrum.org.au', NULL, NULL, NULL, 'Moonee Ponds Shopping Centre,  2/12 Hall St, Moonee Ponds VIC 3039', '-37.76612551230299', '144.9227942', 0, '2015-11-19 12:43:13', '2015-12-06 12:49:54'),
