(1135, 319, 'In Home Care', 'in-home-care', 'Child Care :  We pride ourselves in matching qualified and experienced carers to meet your family needs. Whether you are experiencing challenging times, returning to paid work or simply need an extra pair of hands, please read on for more information.Aged Care:  For many ageing people, maintaining their independence and remaining in their own home is vitally important. We offer a variety of services in the person’s home to assist them in the areas they most need help. Personal care, cleaning and companion care are available to approved persons. Please read on for more information…TAC: Families experiencing hardship as a result of a transport accident may apply for In Home child care, cleaning or post acute care. If you have a TAC approved claim number, please read further and contact us to discuss your requirements.National Disability Insurance Scheme (NDIS):  We provide a variety of services to people with a disability that assist them in caring for their children, maintaining their home, participating in the community and linking into other services. Click here to find out more.Work Safe:  Have you been assessed and approved for assistance under a Work Safe claim? If so, we can assist with a variety of home and children’s services. Please read on and contact us for more information.Cleaning:  Running out of time in your busy week to stay on top of the house work? Do you find that you feel calmer and more in control when the house is clean and tidy? Well, worry no more…our cleaners are experienced and thorough and will take the load off. Click here for more information.', 1, 1, 0, 'GWPukQbWmd2sMqg0.jpg', '(03) 9455 8989 ', NULL, 'http://www.ihcare.com.au/', 'admin@ihcare.com.au', NULL, NULL, NULL, '109 Cape Street Heidelberg 3084. ', '-37.75538801229822', '145.06696799999997', 0, '2015-11-19 12:43:13', '2015-12-06 12:49:55'),
(1136, 320, 'Disability Sport &#038; Recreation', 'disability-sport-038-recreation', 'Disability Sport &amp; Recreation provides and promotes sport and recreation opportunities for people with disabilities throughout Victoria. People with disabilities can engage in many different types of sport and recreation pursuits. For most sports, if the activity doesn’t work for all abilities, it can usually be adapted to enable everyone to participate. There are sport and recreation activities available to suits all types of disabilities, level of ability and activity interests.', 1, 1, 0, '7vvzdipGHPCJT2Ck.jpg', '(03) 9473 0133', NULL, 'http://www.dsr.org.au', 'catherine@dsr.org.au', NULL, NULL, NULL, '341 George St, Fitzroy VIC 3065', '-37.79916486231766', '144.98180925000008', 0, '2015-11-19 12:43:13', '2015-12-06 12:49:55'),
(1137, 321, 'STABILISE', 'stabilise', 'Empowering people with disabilities and those requiring support, the opportunity to access adult sex toys and products to meet their individual circumstances.', 1, 1, 0, '3yP0tHBT5vCeIV60.jpg', '0438 531 311', NULL, 'http://www.infostabilise.com/', 'info.stabilise@gmail.com', NULL, NULL, NULL, 'P.O. Box 662, Richmond, Victoria 3121', '-37.82210909563739', '145.0021236', 0, '2015-11-19 12:43:14', '2015-12-06 12:49:56'),
(1138, 322, 'Disability Resource Centre &#8211; Deakin University', 'disability-resource-centre-8211-deakin-university', 'Deakin''s Disability Resource Centre (DRC) promotes inclusion and access, and provides information and services for students with a disability, health or mental health condition that affects their study or participation in university life.Who can use our services?  -  Our services are for Deakin students who have a disability or health condition that is affecting their study.', 1, 1, 0, 'iG09O89xYadTE0As.jpg', '(03) 9244 6255    0419 154 362', NULL, 'http://www.deakin.edu.au/life-at-deakin/health-wellbeing-safety/disability-support', 'drcentre@deakin.edu.au', NULL, NULL, NULL, NULL, '0', '0', 0, '2015-11-19 12:43:14', '2015-12-06 12:49:56'),
(1139, 323, 'Independent Disability Services', 'independent-disability-services', 'IDS is a leading Victorian disability service provider.  Our services support the needs of people with a broad range of physical and intellectual disabilities by working with them and their families.Service is at the heart of what we do at IDS.  We provide services to ensure that people with disability have access to what they need, enabling them to pursue their interests with access to the community.Services provided include:Individualised SupportCase ManagementHousingFinancial AdministrationIDS Bookkeeping', 1, 1, 0, 'U4VFMMPPubiVklY6.jpg', '(03) 9340 5100', NULL, 'http://idsa.org.au', 'admin@idsa.org.au ', NULL, NULL, NULL, 'Suite 3.01, Level 3   60 Leicester St Carlton, VIC 3053', '-37.804938612320214', '144.96025759999998', 0, '2015-11-19 12:43:15', '2015-12-06 12:49:56'),
(1140, 324, 'Independent Living Centres Australia', 'independent-living-centres-australia', 'Independent Living Centres Australia (ILCA) is a collective network with member ILC''s from each Australian state and the ACT.', 1, 1, 0, '0CqhxKtOGbmuvyj9.jpg', '1300 885 886', '', 'http://ilcaustralia.org.au', 'info@ilcaustralia.org.au', '', '', '', '17 Patrick St, Blacktown, New South Wales', '-33.7706119', '150.90416770000002', 0, '2015-11-19 12:43:15', '2015-12-16 00:27:00'),
(1141, 325, 'CEREBRAL PALSY INNOVATIVE CHOICES', 'cerebral-palsy-innovative-choices', 'The Cerebral Palsy Innovative Choices (CPIC) program has been assisting people with cerebral palsy and their families since 1997. CPIC is a program that gives you greater control in managing your own care. The focus of CPIC is on empowering you to control and coordinate your own support service, by allowing YOU to choose the support worker that YOU want. The program also helps you to manage your funding/allocated hours, leaving you free to live the lifestyle you want.CPIC is managed by the Cerebral Palsy Support Network (CPSN). The program was developed in response to a growing need for a more flexible approach to accessing support services', 1, 1, 0, 'V1gGbeBom192cBP4.jpg', '1300 277 600 or (03) 9478 1001', NULL, 'http://cpinnovativechoices.org.au/', 'enquire@CPinnovativechoices.org.au', NULL, NULL, NULL, '525 High St Preston VIC 3072 Australia', '-37.73640001228978', '145.003917', 0, '2015-11-19 12:43:16', '2015-12-06 12:49:57'),
(1142, 326, 'RIAC Regional Information and Advocacy Council Inc', 'riac-regional-information-and-advocacy-council-inc', 'The Rights Information and Advocacy Centre Inc (formerly Regional Information and Advocacy Council) (RIAC) is a not for profit organisation operating throughout Geelong, central, northern and north-western Victoria providing information and advocacy support to individuals, families, carers and communities.The history, culture, diversity and value of all Aboriginal and Torres Strait Islanders, their Elders and Respected Persons are recognised and acknowledged.', 1, 1, 0, 'xbQEVgdCnfYmsGZl.jpg', '1800 221 944, (03) 5221 8033', NULL, 'http://www.riac.org.au', 'enquiry@riac.org.au', NULL, NULL, NULL, '21 Regent Street, Belmont VIC 3216', '-38.17436301248508', '144.34554400000002', 0, '2015-11-19 12:43:16', '2015-12-06 12:49:58'),
(1143, 327, 'E.W. Tipping Foundation', 'ew-tipping-foundation', 'Disability Services:Residential Accommodation,  Support in Your Own Home,  Respite,  Community Access, Recreation and Training,  Types of Disability,  Specialist Services,  Disability FundingServices for Young People:For some young people, living at home with their families is not possible for a range of reasons that may be beyond their control. No matter what their situation, young people always have a right to protection, support and education.In cases where young people cannot live at home, E.W. Tipping Foundation is able to provide care and support, and ensure that they are placed in a safe situation where they are provided with the opportunities they are entitled to.', 1, 1, 0, 'qZZU4dhWTGv17bym.jpg', '(03) 9564 1000', NULL, 'http://www.tipping.org.au/', 'info@tipping.org.au', NULL, NULL, NULL, '1036 Dandenong Road, Carnegie VIC', '-37.883801012355256', '145.05379200000004', 0, '2015-11-19 12:43:16', '2015-12-06 12:49:58'),
(1144, 328, 'VMS Vehicle Modification Specialists', 'vms-vehicle-modification-specialists', 'VMS can make your vision a realityVMS Group is conveniently located in Geelong, Victoria allowing easy access for clients from Melbourne and country Victoria to visit.Whether you want bus refurbishments or repairs, motorhome renovations, food van installations, or disability conversions, VMS can do the lot. Our skilled body building and electrical teams can take care of the complicated stuff so you can focus on running your business, getting your life organised or just simply relaxing.Feel free to call or come in and see our friendly team to discuss your ideas and receive a no obligation quotation.', 1, 1, 0, 'sraDFhngSH9xvgFJ.jpg', ' (03) 5278 4705', NULL, 'http://vmsgroup.net.au', 'info@vmsgroup.net.au', NULL, NULL, NULL, '6 Kim Court North Geelong 3215', '-38.10409601245356', '144.34836500000006', 0, '2015-11-19 12:43:16', '2015-12-06 12:49:58'),
(1145, 329, 'AQA Peer Support', 'aqa-peer-support', 'We believe that it is important people keep in contact after leaving hospital. The notion of Peer Support, of spinally injured people receiving information from other spinally injured people (ideally with a similar level of disability) is the philosophy of the AQA Information/Peer Support Department.Peer support is available to people with spinal cord injuries or similar physical disabiliities as well as to their families and friends, encouraging people to contact us by phone or email. We attend the Austin Hospital''s Country Spinal Clinics in regional Victoria and Tasmania and regard this as a vital part of peer support.By contacting a peer support person you may be rapidly solving a problem common to many. You may need help with, for example getting dressed, returning to the workplace, dealing with Centrelink, sexuality, even with accessible accomodation for holidays. Maybe you just need a sounding board for an idea or company for a counter lunch and a beer.', 1, 1, 0, 'S4WTjH2TdCG1UDkt.jpg', '(03) 9489 0777, Toll Free: 1800 999 128', NULL, 'http://www.aqavic.org.au/peer_support.html', 'nazimerdem@aqavic.org.au  petervanbenthem@aqavic.org.au', NULL, NULL, NULL, '440 Heidelberg Road Fairfield, Victoria 3078', '-37.78340011231065', '145.0177377', 0, '2015-11-19 12:43:17', '2015-12-06 12:49:59'),
(1146, 330, 'Epilepsy Foundation', 'epilepsy-foundation', 'Our services include information, advice and support, epilepsy counselling, case management and practical assistance, as well as education and training, social and psychological research and advocacy for and with people with epilepsy.We work to raise awareness of disorder in organisations and the broader community to reduce stigma and create a more welcoming and inclusive society.Our services can be accessed over the phone, in person, via e-mail or in a range of community settings, such as in a person’s home, school or workplace.', 1, 1, 0, 'c6uplEsw9pktj2c1.jpg', '(03) 8809 0600  Helpline: 1300 852 853 (Aust. wide)', NULL, 'http://www.epinet.org.au', 'epilepsy@epilepsyfoundation.org.au', NULL, NULL, NULL, '587 Canterbury Road, Surrey Hills Victoria 3127 (enter via Stirling Crescent)', '-37.82563701232939', '145.09475469999995', 0, '2015-11-19 12:43:17', '2015-12-06 12:49:59'),
(1147, 329, 'AQA Victoria Ltd', 'aqa-victoria-ltd', 'AQA Victoria Ltd provides information, support, personal care and community access services to improve the quality of life of people with physical disabilities.', 1, 1, 0, '671NOyKHffdxUoWV.jpg', '(03) 9482 4373  ', NULL, 'http://www.aqavic.org.au', 'admin@aqavic.org.au', NULL, NULL, NULL, '440 Heidelberg Road, Fairfield VIC 3078', '-37.78340011231065', '145.0177377', 0, '2015-11-19 12:43:17', '2015-12-06 12:50:00'),
(1148, 331, 'Association for Children with a Disability', 'association-for-children-with-a-disability', 'Whether you’re a parent, carer, sibling, family member or a professional who works with children and families, ACD can help you make the most of available services and supports to achieve a positive future.ACD is the leading advocacy and information service for children with any type of a disability and their families living in Victoria.ACD acknowledges Aboriginal and Torres Strait Islander peoples as First Australians and recognises their culture, history, diversity and their deep connection to the land. We recognise the distinct rights and perspectives of all Aboriginal and Torres Strait Islander people. We also acknowledge that ACD is on the land of the Kulin Nation and we pay our respects to their Elders past and present.We provide pre-service training and professional development on family centred practice and raise awareness of disability from a family perspective.Our contribution to improvements in policy and service system delivery is driven by our deep understanding of what children and families need to have a good life.It’s what we are passionate about because we know from personal experience how disability changes lives. Raising a child with a disability brings rewards and achievements and but also many challenges.ACD membershipOur strength lies in our in-depth knowledge of service systems and our active members of families of children with any type of disability and others.Membership is FREE for families for the first year and it’s easy to join now.', 1, 1, 0, 'H9m2AgngatkUNDah.jpg', '03 9818 2000, (rural callers)  1800 654 013 ', NULL, 'http://acd.org.au/', 'mail@acd.org.au', NULL, NULL, NULL, 'suite 2, 98 Morang Road Hawthorn Vic 3122', '-37.826203562329674', '145.0237522', 0, '2015-11-19 12:43:18', '2015-12-06 12:50:00'),
(1149, 331, 'Changing Places', 'changing-places', 'Every day, thousands of Australians are confined to their home by lack of appropriate toilet facilities. The only alternatives are being changed on the floor of an unhygienic public toilet or remaining in soiled clothing. There are around 200,000 Australians with a disability who require assistance to meet their toileting needs. Across the country there are only a small handful of toilets which provide the facilities they need like full sized change tables and hoists. The Changing Places project is advocating for a network of safe and hygienic fully accessible toilet facilities in recreational venues, transport hubs, shopping centres and other convenient locations across the country. ', 1, 1, 0, 'bNd6ZzXeVkF3zDVN.jpg', '(03) 9818 2000, (rural callers)  1800 654 013  ', NULL, 'http://changingplaces.org.au/', 'info@changingplaces.org.au', NULL, NULL, NULL, ' Suite 2, 98 Morang Road Hawthorn VIC 3122 ', '-37.826203562329674', '145.0237522', 0, '2015-11-19 12:43:18', '2015-12-06 12:50:01');
INSERT INTO `listings` (`id`, `user_id`, `title`, `slug`, `description`, `approved`, `verified`, `spam`, `logo`, `phone`, `phone_afterhours`, `website`, `email`, `facebook`, `twitter`, `service_area`, `address`, `latitude`, `longitude`, `imported`, `created_at`, `updated_at`) VALUES
(1150, 332, 'LifeAssist &#8211; Uniting Care', 'lifeassist-8211-uniting-care', 'UnitingCare lifeAssist has been assisting vulnerable and disadvantaged people, as well as their carers and families, in Melbourne''s eastern suburbs since 1987.We now provide government-funded services throughout Melbourne''s Eastern and Northern Medical Regions, Disability Solutions in the NDIS Barwon Region, and self-funded supports throughout metropolitan Melbourne, the Mornington Peninsular and some regional Victorian locations.Until mid-2014 we were known as UnitingCare Community Options (UCCO).Our name may have changed, but our commitment to achieve ''a good life for all'' remains the same.  We assist people in achieving their goals to live the life they choose, living happily and productively in the familiar surroundings of their own homes and communities. At lifeAssist we are committed to service excellence and are internationally accredited to the ISO 9001:2008 set of quality management standards.We continue to support people with short-term, long-term and even lifelong vulnerabilities.  We also acknowledge that at some stage in life potentially everyone will feel vulnerable.  Often this is because of some unexpected crisis or change in circumstance which can leave people feeling overwhelmed and not knowing where to turn for help.At lifeAssist we are committed to providing the most appropriate support, whether free, government-funded or self-funded services, to anyone who needs assistance either for themselves or for someone close.We have grown to the point where we now assist over 4000 people anually through government-funded programs and countless more through either referral or self-funded services.Our research partnership with Deakin University allows us to provide services that are world’s best practice, derived from evidence-based research, delivered by experienced, professional experts.We operate as part of the wider UnitingCare Australia network which provides social services to over 2 million people each year in 1,600 sites in remote, rural and metropolitan Australia.', 1, 1, 0, 'TBvXHvXlQH9D0h38.jpg', '1300277478', NULL, 'http://www.lifeassist.org.au/', 'info@lifeassist.org.au', NULL, NULL, NULL, 'Ground Floor, Building 5, 530-540 Springvale Road, Glen Waverley, VIC', '-37.90224501236346', '145.16293699999994', 0, '2015-11-19 12:43:18', '2015-12-06 12:50:01'),
(1151, 333, 'CodaCare', 'codacare', 'Hospital Furniture Manufacturers/Suppliers and Mobility Equipment DistributorsCodacare is 100% Australian owned.  Our story starts way back in 1967, and to this day we continue to build on our heritage of user-centric design, quality local manufacturing and outstanding client service. As leading hospital furniture suppliers, we believe in providing long term value for money for Australia’s hospitals, rehabilitation centres, aged care facilities and other healthcare organisations. We do this by starting from the ground up; from the moment we begin designing each table, trolley or cabinet, to the moment you receive your order, you and your patients will be treated with the respect and attention you deserve.CodaCare are also the sole distributors for technologically advanced mobility equipment such as the wheelchair stair climber, tracked stair climber, electric standing frame and stair climber. Our products carry all types of wheelchairs on stairs with a structure consisting of moving rubber tracks and a tiller which allows steering and anchoring of a wide range of wheelchairs.When you work with us, you can be sure that you will be assisted by someone that is part of the Codacare family and that you will receive a product that is made by hands which are dedicated to good standards of craftsmanship. Not only do we uphold the highest national and international standards for design and manufacturing in the health sector, we offer our clients an unparalleled service experience. Our experience in customer service and knowledge in furniture making is the reason why we were awarded the Australian Business Awards in 2013.“What sets them apart is their enthusiasm.”', 1, 1, 0, 'bzihMPFMPgWEhI1M.jpg', '1800771381', NULL, 'http://www.codacare.com.au', 'info@codacare.com.au', NULL, NULL, NULL, 'Unit 7,  40 Abbotts Road  Dandenong South 3175', '-38.03391301242219', '145.21643000000006', 0, '2015-11-19 12:43:18', '2015-12-06 12:50:01'),
(1152, 334, 'Summer Foundation', 'summer-foundation', 'Established in 2006, the Summer Foundation is committed to growing a movement that will resolve the issue of young people living in nursing homes. Supporting, informing and empowering people with disability and their families is key to resolving this issue.We build the capacity of this sector rather than focus on building our own organisation. We share knowledge, skills and leadership with other organisations. We collaborate with other non-profits organisations to increase funding for the disability sector rather than compete for scarce resources. We share credit and power within the organisation and with other organisations. Preserving our credibility is paramount; we are committed to integrity in our relationship with others and the presentation of facts.The organisation has three key areas of focus:Conducting and fostering research that provides an evidence base for policy changeSupporting people with disability to share their stories with the Australian community to highlight the importance of our work, and keep the issue on the political agendaDeveloping integrated housing demonstration projects in order to increase the range and number of supported accommodation options.The mission of the Summer Foundation is to resolve the issue of young people living in nursing homes.Our vision is that young people with disability and complex care needs will have inherent value as members of our society, with access to services and accommodation that support their health and well-being.In Australia, approximately 200 people under 50 are admitted to aged care nursing homes each year. Young people in nursing homes want a range of creative and innovative solutions to enable them to actively participate in the community and have a real choice about where they live.There needs to be systemic change and a dramatic increase in the number of supported housing options to avoid nursing home admissions. The key aim of the Summer Foundation is to change human service policy and practice related to young people in nursing homes. The foundation draws on a range of strategies to influence health, housing and disability services policy and practice related to this target group.', 1, 1, 0, 'kkLpw31PCGbpDeAH.jpg', '1300626560', NULL, 'http://www.summerfoundation.org.au', 'info@summerfoundation.org.au', NULL, NULL, NULL, 'PO BOX 208 Blackburn VIC 3130', '-37.82152614375623', '145.15195065', 0, '2015-11-19 12:43:19', '2015-12-06 12:50:02'),
(1153, 335, 'National Auslan Interpreter Booking &#038; Payment Service', 'national-auslan-interpreter-booking-038-payment-service', 'NABS is the National Auslan Interpreter Booking and Payment Service.  NABS is funded by the Australian Government to provide interpreters FREE of charge to people who use sign language to communicate and would like to book an interpreter for private health care appointments.This is a FREE service to Sign Language Users and Health Care Providers.All interpreting services to Aboriginal and Torres Strait Islander Sign Language users are provided FREE for both public and private health care appointments.', 1, 1, 0, 'uGKKgDfSWWl5Fcdu.jpg', '1800246945', NULL, 'http://www.nabs.org.au', 'bookings@nabs.org.au', NULL, NULL, NULL, '930 Gympie Rd, Chermside QLD', '-27.38330125822566', '153.03021294999996', 0, '2015-11-19 12:43:19', '2015-12-06 12:50:02'),
(1154, 336, 'SHOPRIDER MOBILITY', 'shoprider-mobility', 'Shoprider Australia located in Perth, Western Australia is the importer and wholesaler for the SHOPRIDER BRAND of scooters, electric bikes and electric wheelchairs and distributes product throughout Australia with over 100 dealers.We also manufacture a large range of accessories for most makes and models under the “Scooter Xtra’s” logo.  Shoprider Australia also has access to  the extensive range of Products from  These products include Daily living Aids  ( Walkers /  Electric Beds / Lift chairs) and Electric Pedal Assist Bikes', 1, 1, 0, 'gIV3AdkseI1WGsXy.jpg', '1800 672 633     (08) 9248 4180', NULL, 'http://www.shoprider.com.au', 'Marketing@shoprider.com.au', NULL, NULL, NULL, '1 Business Way Malaga Western Australia    PO Box 2121, MALAGA, WA, 6944', '-31.85502400986732', '115.89470899999992', 0, '2015-11-19 12:43:19', '2015-12-06 12:50:02'),
(1155, 337, 'Second Skin Pty Ltd', 'second-skin-pty-ltd', 'Our Second Skin team consults with families, therapists and medical practitioners to prescribe, manufacture and supply custom made Compression Garments and Dynamic Splints. Our products are prescribed to assist in the management of acute, chronic or degenerative medical conditions.We provide custom made Compression Garments for clients with burns, traumatic injuries, lymphoedema, and a broad range of other medical conditions. We are world leaders in the design and manufacture of compression garments for the management of paediatric and adult burns and traumatic injury.Our Dynamic Splints are a world first innovation in the splinting management of children and adults with neurological conditions. Splints are prescribed for clients with cerebral palsy, acquired brain injury, cerebrovascular accident (CVA/stroke), autistic spectrum disorders and congenital abnormalities.The Second Skin team is committed to fostering a collaborative environment that promotes and encourages innovative solutions to the medical and clinical challenges presented. Second Skin Garments and Splints are completely custom made - no design is seen as being standard.', 1, 1, 0, 'I0ZbIn7rsNQ2wi1Y.jpg', '(08) 9201 9455 ', NULL, 'http://www.secondskin.com.au', 'perth@secondskin.com.au', NULL, NULL, NULL, 'Unit 15, 386 Scarborough Beach Rd, OSBORNE PARK, WA, 4178', '-31.910876', '115.81667600000003', 0, '2015-11-19 12:43:19', '2015-12-06 12:50:03'),
(1156, NULL, 'ISADD Pty Ltd', 'isadd-pty-ltd', 'Therapy and Support Services for Children, Adolescents and Adults living with Autism/ASDISADD provides a holistic, evidence based service to children, adolescents and adults with Autism Spectrum Disorders and other related disabilities. Advice and support is also provided to families and carers and we regard parents as essential partners in achieving positive change. All interventions are based on behavioural strategies such as Applied Behaviour Analysis and Cognitive Behavioural Therapy which are individualized and tailored to meet needs and are evaluated regularly. Strategies are reviewed, modified and revised as new evidence suggests.ISADD was established in 1994 in Perth. Western Australia by Jura Tender and Jennifer Bolland, and was the first provider to offer ABA based early intervention services in Australia and South East Asia, based on the Lovaas model, as both principals had studied under I.O. Lovaas. Today ISADD provides modern ABA, and is responsive to new evidence as it becomes available. ISADD also has expanded services to all age groups given the obvious need, and has established bases in other countries, although Perth remains ISADD’s Head Office.ISADD provides the following services:Home based Early Behavioural Intervention covering all aspects of developmentSocial, educational and emotional support for school aged childrenCounselling and habilitation training for Adolescents and young AdultsDifferential diagnostic assessments at all age levelsConsultancy to families, schools and carer organizations', 1, 0, 0, 'CAN4QWWWqsSFhbdV.jpg', '(08) 9227 6888', NULL, 'http://www.isadd.org', 'isadd@isadd.org', NULL, NULL, NULL, '50 Angove Street NORTH PERTH WA 6006    PO Box 325, NORTH PERTH, WA, 6906', '-31.929531009895967', '115.85737400000005', 0, '2015-11-19 12:43:20', '2015-12-06 12:50:03'),
(1157, NULL, 'IN Construction Australia', 'in-construction-australia', '', 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'PO Box 600, NORTH PERTH, WA, 6096', '-31.953529', '115.86699529999999', 0, '2015-11-19 12:43:20', '2015-12-06 12:50:03'),
(1158, 338, 'ArjoHuntleigh', 'arjohuntleigh', 'We are dedicated to increasing the quality and efficiency of care.Our products and solutions reduce unnecessary costs by preventing adverse events that impact on patients and caregivers.With 5.500 dedicated employees worldwide, ArjoHuntleigh is a global group with an annual turnover of € 750 million, serving the needs of acute and long-term care in more than 100 countries.Our MissionWe are dedicated to increasing the quality and efficiency of care.Our VisionTo be a world leader in integrated solutions for care of people with reduced mobility and related conditions.', 1, 1, 0, 'sQg7TjJ2AW4unXsZ.jpg', '1800 072 040', NULL, 'http://www.arjohuntleigh.com.au', 'enquiriesau@arjohuntleigh.com', NULL, NULL, NULL, '78 Forsyth Street, O CONNOR, WA, 6163', '-32.056465', '115.78783199999998', 0, '2015-11-19 12:43:20', '2015-12-06 12:50:03'),
(1159, 339, 'Wesley Mission Brisbane', 'wesley-mission-brisbane', 'Wesley Mission Brisbane has been supporting Queenslanders for more than 100 years.We provide a range of vital community services and programs, including emergency and housing support for families and people at-risk of homelessness, disability and employment services, childcare, youth programs and care for Brisbane seniors.', 1, 1, 0, 's1Xm1Rue5CD7fgdP.jpg', '(07) 3621 4500', NULL, 'http://www.wmb.org.au/', 'info@wmb.org.au', NULL, NULL, NULL, '930 Gympie Road, CHERMSIDE, QLD, 4032', '-27.3833002', '153.03022209999995', 0, '2015-11-19 12:43:20', '2015-12-06 12:50:04'),
(1160, 340, 'TrackingCentral Pty Ltd', 'trackingcentral-pty-ltd', 'At Tracking Central wee specialise in offering the latest in wearable technology and personal location devices to our customers.', 1, 1, 0, 'fFKI6eJrZ2R5fXWu.jpg', '1300 255 990', NULL, 'http://www.trackingcentral.com.au', 'info@TrackingCentral.com.au', NULL, NULL, NULL, 'Unit 43, 321 Main Street, KANGAROO POINT, QLD, 4169', '-27.471774', '153.03513399999997', 0, '2015-11-19 12:43:20', '2015-12-06 12:50:04'),
