(1162, 342, 'SWITC &#8211; Support with Interpreting Translating and Communication', 'switc-8211-support-with-interpreting-translating-and-communication', 'Welcome to SWITCSWITC (Support with Interpreting, Translating and Communication) is an interpreting and translation service  open to Non-Government Organisations (NGOs) that are funded by Disability and Community Care Services.SWITC enables NGOs to provide people who use a language other than english free access to interpreters and translators. SWITC will enable your organisation to service your clients fairly at no cost to you.SWITC is able to:Provide an interpreter to your organisation when you have client related meetingsTranslate client related documents and marketing materials into other languagesProvide alternative formats including braille, large print and multiple format audioProvide captioning and hearing loops', 1, 1, 0, '3L2GvpfOCAhn6MPt.jpg', '(07) 3892 8559', NULL, 'http://www.switc.org.au', 'switc@deafsq.org.au', NULL, NULL, NULL, 'PO Box 465, MOOROOKA, QLD, 4105', '-27.5316159', '153.02386879999995', 0, '2015-11-19 12:43:21', '2015-12-06 12:50:05'),
(1163, 343, 'Sexton Trading Company Pty Ltd', 'sexton-trading-company-pty-ltd', 'For hospital &amp; operation theatre linen, patient &amp; medical staff apparel, Accumax &amp; Maxifloat, pressure reduction mattresses for general &amp; intensive care areas, &amp; nursing home residents requirements', 1, 1, 0, 'tJuTYtpzNgYSmrSY.jpg', '(07) 3265 9999', NULL, 'http://www.sexton.com.au', 'sexton@sexton.com.au', NULL, NULL, NULL, '72 Crockford Street, NORTHGATE QLD 4013   PO Box 135, HAMILTON, QLD, 4007', '-27.387588008227183', '153.07909500000005', 0, '2015-11-19 12:43:21', '2015-12-06 12:50:05'),
(1164, 344, 'Paediatric Physiotherapy', 'paediatric-physiotherapy', 'Treatment of babies and children with difficulties in posture, movement, and development.ExamplesDevelopmental delay (e.g. floppy infant syndrome)Neurological motor disturbances (e.g. cerebral palsy and syndromes)Orthopaedic problems (e.g. torticollis, hip dysplasia, talipes, flatfoot)Peripheral lesions (e.g. Erb''s palsy and spina bifida)Respiratory problems (e.g. cystic fibrosis, asthma and CLD)My ApproachTo ensure the best possible outcomes for you, I make certain that the sessions include a strong educational component for the parents or carers so that they are able to perform the most appropriate exercises for their child. I discuss, review and adjust these exercises each time with the parents or carers, and encourage them to give their child a short and intense boost of therapy a couple of times each day. [more...]Techniques I UseBobath therapy, Vojta therapy, orthopaedic techniques, respiratory therapy, baby and remedial massage.My BackgroundI have more than 20 years of experience in paediatric treatment. I also work in a therapy centre for moderate to severe disabled children in Nambour.', 1, 1, 0, 'ADQQbYQAZMaSbcDk.jpg', '(07) 54933429   Mob 0488 723 370', NULL, 'http://www.paediatricphysio.com.au', 'paediatricphysio@yahoo.com.au', NULL, NULL, NULL, '8 Firetail Court, WURTULLA, QLD, 4575', '-26.757899', '153.135766', 0, '2015-11-19 12:43:21', '2015-12-06 12:50:05'),
(1165, 345, 'Out and About Healthcare', 'out-and-about-healthcare', 'Out and About Healthcare supplies mobility scooters, electric wheelchairs, bathroom aids and mobility equipment throughout Australia/NZ.', 1, 1, 0, 'I0SgR1m9A5un57nS.jpg', '1300 366 545   07 32049217  ', NULL, 'http://www.outandabouthealthcare.com.au', 'sales@oahealthcare.com.au', NULL, NULL, NULL, 'Unit 2, 2-8 Kabi Circuit, DECEPTION BAY, QLD, 4508', '-27.19636', '153.01385300000004', 0, '2015-11-19 12:43:23', '2015-12-06 12:50:06'),
(1166, 346, 'NDLS', 'ndls', 'Our services:Asset design and establishmentAsset ManagementProject ManagementTenancy ManagementCustomer representationHome modification assessment and works deliveryWho We Are:  National Disability Living Solutions, (NDLS) is a not-for-profit, limited by guarantee organisation that provides specialty accommodation and accommodation services to people with disability, Government departments and NGO’s that work in the disability sector.', 1, 1, 0, 'OrI1aeK1ByAIV7bm.jpg', '(07) 3118 1724', NULL, 'www.ndls.org.au', 'info@ndls.org.au', NULL, NULL, NULL, 'Building 6, 2404 Logan Road, EIGHT MILE PLAINS, QLD, 4113', '-27.571572', '153.09096499999998', 0, '2015-11-19 12:43:23', '2015-12-06 12:50:07'),
(1167, 347, 'My Life Consultancy', 'my-life-consultancy', 'The ''My Life'' service helps Queenslanders live the life they want to live. We help people with a disability, their families and carers with self-directed support options.Target GroupYou are eligible for My Life Consultancy host provider services if you are under 65 years of age and:Have a disability and are eligible for disability services under the Department of Communities, Child Safety and Disability Services eligibility policy.Have individualised funding that is ongoing (recurrent).Reside or receive services within Queensland.Host Provider ModelMy Life Consultancy offers a flexible host provider service that will be based on how you choose to manage your funding.You are offered a FREE initial face to face or phone interview of up to 2 hours with a dedicated consultant. We will discuss your assessed disability support needs and what you need from a host provider. We will then determine the appropriate level of host provider support, the best way of providing that support to you and advise you of relevant charges involved.If you choose My Life Consultancy as your host provider, we will work with you to develop flexible and creative approaches to meet your disability support needs, within the Your Life Your Choice guidelines. The range of supports and services considered will be tailored to each person’s individual needs.', 1, 1, 0, 'knd5ypq4nNFbIkqe.jpg', '1800 275 753', NULL, 'http://www.cpl.org.au', 'cniethe@cpl.org.au.', NULL, NULL, NULL, '55 Oxlade Drive New Farm QLD 4005 PO Box 386, FORTITUDE VALLEY, QLD, 4006', '-27.47282400825718', '153.04861399999993', 0, '2015-11-19 12:43:24', '2015-12-06 12:50:08'),
(1168, 348, 'Made to Measure Services', 'made-to-measure-services', 'MADE TO MEASURE SERVICESMade to Measure Services provides Australia wide payroll, bookkeeping and administration packaged solutions, specialising in Not-for-Profit organisations and those who wish to Self Direct, or manage, their disability government and/or private funding.By freeing you of the burden of finanical management, we''ll Help U Grow by giving you the time to develop the kind of life you wish to have for yourself, your family member, friend, or participants.We also understand that we aren''t dealing with businesses that have a full understanding of payroll and working with employees. Hence, we have the patience to realise you may make a mistake. We may still make a charge, depending on how much time it takes to fix up any mistakes, but everything can be fixed.', 1, 1, 0, 'awcc9QtPS8r4hcf4.jpg', '(07) 3889 1717', NULL, 'http://www.m2mserv.com.au', 'admin@m2mserv.com.au', NULL, NULL, NULL, 'PO Box 188, PETRIE, QLD, 4502', '-27.2690395', '152.97650380000005', 0, '2015-11-19 12:43:25', '2015-12-06 12:50:09'),
(1169, 349, 'Aidacare Pty Ltd &#8211; Acacia Ridge', 'aidacare-pty-ltd-8211-acacia-ridge', '', 1, 1, 0, 'H0SIYR7jkFl6KB5Z.jpg', '07 3086 2900  02 8706 2300', NULL, 'http://www.aidacare.com.au', NULL, NULL, NULL, NULL, '252 Bradman St, ACACIA RIDGE, QLD, 4110', '-27.589496', '153.03829300000007', 0, '2015-11-19 12:43:25', '2015-12-06 12:50:09'),
(1170, 350, 'TADACT', 'tadact', 'Technical Aid to the Disabled ACT (TADACT) is a not for profit organisation that specialises in creating or modifying equipment for people with a disability of all ages, older people, and supporting their carers.We are a volunteer-based organisation dedicated to enabling independence for people with disabilities of all ages, older people, and their carers in the ACT and South Eastern NSW through the creative application of technology to meet individual needs.This will help them to better participate in and contribute to the community.Although TADACT is a registered provider under the NDIS it will still support those people with disabilities, older people, and their carers who are not eligible for NDIS funding.', 1, 1, 0, 'B6jxrl3EwqKUQjkS.jpg', '(02) 6287 4290', NULL, 'http://www.technicalaidact.org.au', 'info@tadact.org.au   ', NULL, NULL, NULL, '27 Mulley Street, Holder, ACT 2611   PO Box 3827, WESTON CREEK, ACT, 2611', '-35.331872711257105', '149.0495919', 0, '2015-11-19 12:43:25', '2015-12-06 12:50:10'),
(1171, 351, 'Scooters Australia Canberra, Scooters Australia ACT, Guardian', 'scooters-australia-canberra-scooters-australia-act-guardian', 'We are Canberra''s first full ''mobile'' mobility equipment provider. We''re here to help you maintain your independence.Not in Canberra? No problem, you can shop by phone by calling us on 02 6288 3538.We supply many brands from many suppliers, including being Canberra''s only Authorised Scooters Australia Dealer.Our unique home delivery service and comprehensive home demonstrations make life easier for you because you don''t need to visit a shop. We come to you so you can view and try products at home. There is no-obligation to purchase.Our fully equipped mobile workshop can also undertake servicing and repairs at your location. Getting your scooter repaired and serviced is now easier than ever.', 1, 1, 0, 'VceI3bnAK40UeIHF.jpg', '(02) 6288 3538  1300 622 633', NULL, 'http://www.scootersaus.com.au/', 'info@guardianmobility.com.au', NULL, NULL, NULL, 'PO Box 7234, DUFFY, ACT, 2611', '-35.3372165', '149.03209779999997', 0, '2015-11-19 12:43:25', '2015-12-06 12:50:10'),
