(1173, 352, 'Zyteq Pty Ltd', 'zyteq-pty-ltd', 'Zyteq is an independent Australian specialist company offering Assistive Technologies and services for communication, rehabilitation, special education and technology access. Zyteq''s range of products focuses on high quality Assistive Technologies and associated services developed especially to provide solutions and assistance to individuals of all ages. Zyteq''s products provide communication using devices with voice output, access to computers, tablets and ipads and options to control appliances around the house. These assistive technologies assist to increase and improve functional capabilities and maintain skills.  Outcomes include participation, inclusion and achievement in education, home, work, leisure activities or social life.', 1, 1, 0, 'AnkirK4L7NpJndgg.jpg', '(03) 9696 2944', NULL, 'http://www.zyteq.com.au', 'info@zyteq.com.au', NULL, NULL, NULL, 'PO Box 190, SOUTH MELBOURNE, VIC, 3205', '-37.8323792', '144.96043329999998', 0, '2015-11-19 12:43:25', '2015-12-06 12:50:10'),
(1174, 353, 'Yooralla', 'yooralla', 'Yooralla''s services are developed in partnership with people with disability and in many cases, their families and carers. We provide essential services for people of all ages and disabilities, regardless of whether a person is born with or acquires a disability as the result of accident, ill health or age.Our services cover every aspect of living, both practical and aspirational. We provide a range of accommodation alternatives, respite, in-home support, therapy, attendant care, specialised equipment, employment, recreation, information, education and training, and practical skills for daily living.', 1, 1, 0, 'BzgB3UkenhxaDkot.jpg', '(03) 9666 4500  For hearing/speech impaired call 1800 555 660.', NULL, 'http://www.yooralla.com.au', 'yooralla@yooralla.com.au', NULL, NULL, NULL, '244 Flinders Street Melbourne, Victoria 3000  PO Box 200 Flinders Lane, MELBOURNE, VIC, 8009', '-37.81827111232613', '144.9670618', 0, '2015-11-19 12:43:26', '2015-12-06 12:50:10'),
(1175, 354, 'Work Health Rehab &#8211; Occupational Therapy/Allied Health', 'work-health-rehab-8211-occupational-therapyallied-health', 'Work Health Rehab was established in 2012 with the goal of offering clients legitimate client centred Allied Health Services. The introduction of the NDIS, and the potential that this offered in our own region was the catalyst to enabling this to occur. Our aim and focus (and slogan!) is to be ‘Effecting Change’ for all of our clients regardless of referral source. We are based out of Jan Juc, along the Great Ocean Road in Victoria and provide Allied Health Services in flexible and efficient ways. The work history of our team is varied having worked in isolated rural areas in Community Rehabilitation, working with young men following ABI’s in regional areas, being engaged with national firms in assisting with managing their complex compensable (WorkSafe) and non Compensable (self funded injury prevention) clients and providing design advice/modifications on farming equipment/workplaces/homes. Therapists have worked with the NDIS, Dept of Veteran Affairs, WorkSafe Vic, State Wide Equipment Program, Vehicle Modification Subsidy Scheme, Home/Workplace Modifications, Skills Training and Development, Duty/Task analysis &amp; Modification, Employer Assistance Fund – Workplace Modifications, National Panel of Assessors –DEEWR amongst others. Historically, we have delivered our consultancy services to a number of Canadian Occupational Rehabilitation Providers, in particular with the merging of a number of businesses, developing/modifying existing staff training and adapting/creating practical policy and procedure manuals and analysing client data and feedback to improve client/therapist relationships.', 1, 1, 0, 'h5tRIFb4qOrJm175.jpg', '0422 573 795 ', NULL, 'http://www.workhealthrehab.com', 'brad@workhealthrehab.com', NULL, NULL, NULL, '23 Gairloch Ave Jan Juc VIC 3228', '-38.34181', '144.29900599999996', 0, '2015-11-19 12:43:26', '2015-12-06 12:50:11'),
(1176, 355, 'Word of Mouth Technology', 'word-of-mouth-technology', 'Word of Mouth Technology started 20 years ago. We are now the leading supplier of assistive devices for Deaf and Hard of Hearing people in Australia.', 1, 1, 0, 'WszlUyjkW8xkCddN.jpg', '(03) 9723 0660 TTY (03) 9723 0660 ', NULL, 'http://wom.com.au', 'info@wom.com.au', NULL, NULL, NULL, '6 Sturt Street South, Croydon, Victoria, 3136  PO Box 1001, CROYDON, VIC, 3136', '-37.796322', '145.28103599999997', 0, '2015-11-19 12:43:27', '2015-12-06 12:50:11'),
(1177, 356, 'Warren Gibson &#8211; Clinical Psychologist', 'warren-gibson-8211-clinical-psychologist', 'Warren Gibson is a registered consultant psychologist with over ten years experience in the fields of disability and mental illness. He has worked for a range of agencies, government departments and local schools. Warren has also worked with a wide variety of client groups with complex and challenging issues, including:\n	autism and asperger''s syndrome	depression and anxiety	intellectual disability and ABI	gambling addiction', 1, 1, 0, 'fzkBgoIlgLwnqBB3.jpg', 'Appointments (03) 8851 3655  Enquiries 0409 237 064', NULL, 'http://warrengibson.com.au', 'reception@theasdclinic.com.au', NULL, NULL, NULL, 'The ASD Clinic, Suite 2, 830 High Street, KEW EAST, VIC, 3102', '-37.794354', '145.06273599999997', 0, '2015-11-19 12:43:27', '2015-12-06 12:50:12'),
(1178, NULL, 'Winchelsea and District Taxi PTY LTD', 'winchelsea-and-district-taxi-pty-ltd', 'For prompt and friendly service (10-seater bus available), call Stan and Debbie.', 1, 0, 0, 'cXp7pG2JTZtfUA1b.jpg', '(03) 5267 2888 Mob 0429 672 888 ', NULL, NULL, 'winchtaxi@bigpond.com', NULL, NULL, NULL, '66A Batson Street, WINCHELSEA, VIC, 3241', '-38.245184', '143.99726899999996', 0, '2015-11-19 12:43:27', '2015-12-06 12:50:12'),
(1179, NULL, 'Wimmera Speech Pathology', 'wimmera-speech-pathology', 'Speech Pathology services can be an investment for your child’s future. I specialise in:Children 0-18 yearsSpeech – Clear speech means your child can freely communicate with children and adults in his or her life.Clear speech will also asssist as your child begins to read and spell. When your child is an adult the effects of clear speech may be seen in the workplace. A business manager recently shared how he had to choose between two insurance agents identical quotes. The Insurance Agent with the clear speech won the quote. The unsuccessful insurance agent could not be clearly heard on the telephone.Language – Language is also an important area where a child can be assisted to understand more of what is said to him at home and in the classroom. He can also be assisted to express what he needs to say as this is not easy for all childrenReading, Spelling, Writing – If your child is struggling with Reading, Spelling or Writing I am very keen to assist your child in these areas. These three areas are so important to your child’s overall progress at school.Autism Spectrum Disorders – Living with Autism Spectrum Disorder can be tough for children. During the last few years experts, eg Dr Tony Attwood, Dr Carol Gray, Dr Steve Gutstein and Dr Richard Eisenmajor, have shared with Speech Pathologists, such as myself, a lot of information and strategies we can learn to make a child with Autism Spectrum Disorder’s life easier.Relationship Development Intervention (RDI) – RDI is one of the main interventions I use with Autism, which was devised by Steve Gutstein. See below for more information on how the RDI program works.A Speech Pathology Service on a Farm – Travelling a distance to attend a Speech Pathologist who works from her farm home may appear inconvenient. However, many parents find the warm atmosphere, with tea and coffee available, relaxing while I work with their child in a lesson, designed to be both fun and interesting for their child. The working farm can be viewed from the safe boundary of the house yard fence. Farm activities are often very motivating for the children that need the services of a Speech pathologist.', 1, 0, 0, 'jbDSjOOE3mcZiTza.jpg', '(03) 5397 4214  Mob 0417 105 820', NULL, 'http://www.fletapohlnerspeechpathology.com.au', 'fletapohlner@bigpond.com', NULL, NULL, NULL, '890 Kiata North Rd, Nhill VIC 3418, Australia', '-36.29055846166123', '141.80863515', 0, '2015-11-19 12:43:28', '2015-12-06 12:50:12'),
(1180, 357, 'Wild Rumpus Community Services', 'wild-rumpus-community-services', 'Wild Rumpus Community Services provide a range of support options for children and young people who have a disability. We provide support with an emphasis on increasing skill development and social opportunities - offering individuals more flexibility and creativity in their supports. Wild Rumpus have launched a number of programs, which were developed based on the needs and interests of families we support. They include group activities on weekends, programs for pre-school aged children, camps and overnight supports, occupational therapy, case management (service coordination), after-school programs, indepdent living skills, transitional planning for young people, as well as our sibling support program - Bellarine Pizza Cats.Wild Rumpus first launched in September 2012 by founding member James Asciak, who has worked for 12 years supporting young people with a disability. As The National Disability Insurance Scheme (NDIS) rolls out, we see a greater number of people with a disability have more opportunities to access meaningful supports. Since our registration with the National Disability Insurance Agency (NDIA), we have seen sharp demand for our services - and work tirelessly to process all new referrals.Wild Rumpus have a passion for providing innovative options in order to support people with a disability and their families in new and creative ways. We understand that everyone is different, with different needs and interests, which is why we don''t provide ''sausage factory'' supports. We work tirelessly at developing new programs, trialing new ideas, and placing ourselves as the next generation of disability support providers. Wild Rumpus is a small service without a bloated management system - so the people supporting you are the ones shaping the service we provide.', 1, 1, 0, 'NJEX7zzadv6xaRyO.jpg', ' (03) 5245 8539, Mob 0488 138 251', NULL, 'http://www.wildrumpus.org.au', 'intake@wildrumpus.org.au ', NULL, NULL, NULL, '78 Bonnyvale Road, OCEAN GROVE, VIC, 3226', '-38.265547', '144.55221700000004', 0, '2015-11-19 12:43:28', '2015-12-06 12:50:14'),
