(1186, 361, 'WAURN PONDS PHYSIOTHERAPY CLINIC', 'waurn-ponds-physiotherapy-clinic', 'The Waurn Ponds Physiotherapy Clinic has been operating since 2005, and is located in the new state-of-the-art Leisurelink Aquatic and Recreation Centre.In addition to our usual friendly, professional, hands-on Physiotherapy and Podiatry services, we now have Hydrotherapy, Massage and Exercise Physiology on site.NOTE: You don’t need to be a Leisurelink member to attend the Waurn Ponds Physiotherapy Clinic.', 1, 1, 0, '2HmDqhl96sC9KXQb.jpg', '(03) 5245 7577', NULL, 'http://coriobayhealth.com.au/locations/waurn-ponds/', 'waurnponds@coriobayhealth.com.au', NULL, NULL, NULL, 'LEISURELINK AQUATIC CENTRE,  140 PIONEER ROAD, WAURN PONDS,', '-38.19695201249518', '144.32304', 0, '2015-11-19 12:43:30', '2015-12-06 12:50:16'),
(1187, 362, 'Wathaurong Aboriginal Co-operative Ltd', 'wathaurong-aboriginal-co-operative-ltd', '“As owners and custodians of Wathaurong land we are committed to working togetherto provide a secure future for our community by upholding the dignity of our ancestors, respecting our Elders and others, and instilling a sense of cultural pride and belonging inour children and our children’s children”.“The Wathaurong Aboriginal Co-operative welcomes all Aboriginal people and providesa place where community members experience social and cultural connectedness andunity, have a voice, celebrate culture and identity; promoting self determination,community healing, well-being and advancement”.&nbsp;The primary purpose of the Wathaurong Aboriginal Co-operative is to provide holistic and culturally secure service responses to meet the specific needs of the Aboriginal community.Our overall objective is to provide our members and Aboriginal families living or in transit in the service delivery area of Wathaurong''s traditional boundaries with assistance, an increased and improved access to a range of culturally appropriate health, housing, education, employment and cultural services, contribute to improvements in community well being and build the capacity of the community to control its own affairs and achieve self-determination.', 1, 1, 0, 'ueFGo4p9QvS4DbeE.jpg', '(03) 5277 0044 ', NULL, 'http://www.wathaurong.org.au', 'admin@wathaurong.org.au', NULL, NULL, NULL, '62 Morgan Street NORTH GEELONG, 3215, VIC PO Box 402, NORTH GEELONG, VIC, 3215', '-38.09985086245168', '144.3453877999999', 0, '2015-11-19 12:43:30', '2015-12-06 12:50:16'),
(1188, 363, 'VMS Group', 'vms-group', 'VMS Group is conveniently located in Geelong, Victoria allowing easy access for clients from Melbourne and country Victoria to visit.Whether you want bus refurbishments or repairs, motorhome renovations, food van installations, or disability conversions, VMS can do the lot. Our skilled body building and electrical teams can take care of the complicated stuff so you can focus on running your business, getting your life organised or just simply relaxing.Feel free to call or come in and see our friendly team to discuss your ideas and receive a no obligation quotation.', 1, 1, 0, 'fqknmpA8I38dfotv.jpg', '(03) 5278 4705', NULL, 'http://www.vmsgroup.net.au', 'info@vmsgroup.net.au', NULL, NULL, NULL, '6 Kim Court North Geelong 3215 PO Box 156, NORTH GEELONG, VIC, 3215', '-38.10409601245356', '144.34836500000006', 0, '2015-11-19 12:43:30', '2015-12-06 12:50:16'),
