(1201, 374, 'Trend-Craft Building Services', 'trend-craft-building-services', 'Trend-Craft Home Improvements deal in creating elegant, enjoyable and liveable spaces for you and your family.Be it the awe-factor of the entertainer’s kitchen or the sophistication of an airy family room, we aim to make the most of your living space.Our services are always customized to tailor fit the needs of you and your home for today and the many years ahead…', 1, 1, 0, 'AvxHNshPxv4KDixD.jpg', '(03) 5240 4111', NULL, 'http://www.trend-craft.com.au', 'admin@trend-craft.com.au', NULL, NULL, NULL, 'Unit 3, 141-143 Victoria Street NORTH GEELONG, 3215, VIC  PO Box 740, GEELONG, VIC, 3220', '-38.12210501246161', '144.34630900000002', 0, '2015-11-19 12:43:33', '2015-12-06 12:50:21'),
(1202, 375, 'Trefoil Care Services', 'trefoil-care-services', 'Trefoil Care Services is an organization wholly owned by Triquetra Visions Pty. Ltd.Trefoil Care Services was founded in 2013 as a Nursing Services, Rehabilitation, disability care, Aged care, personal care and home help services organisation.Disability CareRehabilitation, Independent living skillsand community access programsOur Independent living and Community access programs help clients work towards goals that they and their treating health team have identified. Our services may include:Personal care services;Therapy and Rehabilitation support;Assistance with community access and participation;Assistance achieving vocational and / or recreational goals;Supervision and / or assistance with childcare.Disability Home Modification Quotations and ServiceWe can arrange Trade based quotations, and in most cases attend to the modifications as prescribed by a client’s treating or BASSA Occupational Therapist. Enquiries should be directed to info@trefoilcareservices.com.au&nbsp;', 1, 1, 0, 'fTL7LsU1umfTmx7l.jpg', '1300 033 645 ', NULL, 'http://www.trefoilcareservices.com.au', 'info@trefoilcareservices.com.au', NULL, NULL, NULL, 'PO Box 142, BEAUFORT, VIC, 3373', '-37.4292539', '143.38375280000002', 0, '2015-11-19 12:43:33', '2015-12-06 12:50:22'),
