(1208, 380, 'Torquay Physiotherapy  &#038; Sports Treatment Clinic', 'torquay-physiotherapy-038-sports-treatment-clinic', 'We pride ourselves in providing a friendly, caring and professional health service from experienced physiotherapists and reception staff. The clinic has five treatment areas including a physiotherapy gym. Our five physiotherapists are experienced in many techniques.', 1, 1, 0, '9Mw9iwwOtHHTKa9x.jpg', '(03) 5261 6416', NULL, 'http://coriobayhealth.com.au/locations/torquay/', 'torquay@coriobayhealth.com.au', NULL, NULL, NULL, '9 Great Ocean Road, Jan Juc 3228', '-38.33940901255924', '144.30929600000002', 0, '2015-11-19 12:43:34', '2015-12-06 12:50:24'),
(1209, NULL, 'Therapy Connections Victoria', 'therapy-connections-victoria', 'Welcome to Therapy Connections VictoriaTherapy Connections Victoria (TCV) provides speech pathology and case management services for children and adults.We support each person to maximise their communication, participation and independence at home, school and work. We do so through assessment and tailored therapy.TCV is owned and operated by Sally Smallwood. Sally has worked as a speech pathologist since 1999 and has extensive experience in acute hospitals, rehabilitation settings and community-based private practice. Sally is currently undertaking a Master of Occupational Therapy Practice.Sally is a Member of Speech Pathology Australia, a Certified Practicing Speech Pathologist and Member of the Case Management Society of Australia.Services· Speech pathology assessment and therapy for children and adults with speech, language and social communication difficulties.· Assessment and management of swallowing function.· Specialised case management services to support individuals with cognitive and communication difficulties.', 1, 0, 0, '4GiDVhrcLSbh22K2.jpg', '0422 008 703', NULL, 'http://www.therapyconnectionsvictoria.com.au', 'sally.smallwood@mail.com', NULL, NULL, NULL, 'Suite 123, 585 Little Collins St, MELBOURNE, VIC, 3000', '-37.817871', '144.95544399999994', 0, '2015-11-19 12:43:34', '2015-12-06 12:50:24'),
(1210, NULL, 'The Speech Lady', 'the-speech-lady', 'The Speech Lady is a speech therapy practice run by Tamara Dowling. Tamara specialises in working with children with complex developmental needs, by reducing tears and releasing the child into their future.&nbsp;How it worksWe Live where you live. We come to you- at home school and child care.We Listen  to your experience, concerns and ideas. They make a difference to the way we think and what we do.We Share  our experience, our perceptions and strategies with you so that you become confident in supporting your child to be the best they can be.We Think  about new trends and research.We Deliver  services to individual children and their families as well as to organizations including schools, kindergartens and childcare.', 1, 0, 0, 'Jt1NrIpX0nSuGQcV.jpg', '0431 639 589', NULL, 'http://www.thespeechlady.com.au', 'tamara@thespeechlady.com.au', NULL, NULL, NULL, '12 Prominence Boulevard, ARMSTRONG CREEK, VIC, 3217', '-38.2399463', '144.3660311', 0, '2015-11-19 12:43:35', '2015-12-06 12:50:24'),
