(1212, NULL, 'The Neuro Practice &#8211; Ballarat', 'the-neuro-practice-8211-ballarat', 'The Neuro Practice physiotherapy offers personalised therapy and guidance to assist you to reach your physical potential. The Neuro Practice was established in 2002. It was created in response to the need for people to be able to access specialised Neurological Physiotherapy services across central Victoria. Therapists at The Neuro Practice are experienced clinicians who work with their clients to identify their therapy goals and provide expert assessment, treatment and education. In addition to neurological physiotherapy we also specialise in paediatric physiotherapy and are skilled in a range of other physio disciplines. We offer physiotherapy sessions in our easily accessible treatment rooms or provide home based therapy when it is more suited to the client''s level of ability and functional needs. The Neuro Practice clinicians are able to assist with tailored home exercise programs, carer training, community hydrotherapy, gymnasium programs and prescription of customized equipment. Group therapy has commenced at The Neuro Practice to ensure greater access to prescribed exercise, strength and balance re-training to assist you with your program. The Neuro Practice has consulting rooms in Bendigo and Ballarat with specialised equipment for neurological conditions. We also cater for clients from other parts of Victoria from Shepparton and Seymour in the east to as far west as Hamilton and Portland. All Therapists are committed to ongoing clinical education and work under the guidelines of evidence based practice. We abide by the Australian Physiotherapy Association ethics and code of conduct.', 1, 0, 0, 'xZSar8D4nPDHelft.jpg', '(03) 5332 0564', NULL, 'http://theneuropractice.com.au', 'info@theneuropractice.com.au', NULL, NULL, NULL, '611A Skipton St Redan Victoria 3350', '-37.576713012219194', '143.84441900000002', 0, '2015-11-19 12:43:35', '2015-12-06 12:50:25'),
(1213, NULL, 'The Child and Adolescent Neuropsychology Group', 'the-child-and-adolescent-neuropsychology-group', 'The Child and Adolescent Neuropsychology Group was founded by Dr Renee Testa to provide a diverse range of exceptionally high quality neuropsychological services to professional colleagues in the medical and health sectors, members of the general community including parents and families, in addition to the education sector comprising teachers and schools.', 1, 0, 0, 'gbKdJrJvdTI6ZLU0.jpg', '(03) 9696 6040', NULL, 'http://www.cangroup.com.au', 'info@cangroup.com.au', NULL, NULL, NULL, ' Suite 215, Level 2, 100 Victoria  PO Box 221, COLLINS STREET WEST, VIC, 8007', '-37.81381866232417', '144.9694703', 0, '2015-11-19 12:43:35', '2015-12-06 12:50:25'),
(1214, 382, 'Telespeech Australia &#8211; Online Speech Pathology', 'telespeech-australia-8211-online-speech-pathology', 'Telespeech therapy uses videoconferencing technology to deliver speech pathology services over the internet wherever you may be; at home, school, childcare or in a nursing facility.It is an alternative for people who:• Can’t find a Speech Pathologist in their area• Live a long way from services and want to save the time and expense of travelling• Don’t want to miss work or school to attend an appointment• Have impaired mobility and don’t want to rely on someone else to take them to appointmentsTelespeech therapy is just like face-to-face speech therapy but instead of sitting across the table from the Speech Pathologist you will be viewing each other across the internet on your computer screens. All you need is a computer or tablet with a camera and microphone and an internet connection. There is evidence that clinical outcomes and client satisfaction with telepractice are equivalent to conventional speech therapy.', 1, 1, 0, 'kU9kfUWpuUxWjSno.jpg', ' 0427 465 820 ', NULL, 'www.telespeech.com.au', 'reception@telespeech.com.au ', NULL, NULL, NULL, '340 Ridge Road, HENTY, VIC, 3312', '-37.62169701223906', '141.51293299999998', 0, '2015-11-19 12:43:36', '2015-12-06 12:50:26'),
(1215, 383, 'Taylor Garwood Designs', 'taylor-garwood-designs', 'TAYLOR GARWOOD DESIGNS offer a comprehensive building design process for a wide range of projects. We offer our clients support and advice throughout every stage of your project. We specialize in all aspects of residential and commercial design and documentation. We have extensive experience designing in a wide range of architectural styles and materials and will suggest all the viable options available to ensure they make an informed decision.Our services include new developments and /or alterations and additions in a variety of different categories. These include:Residential HousesMulti ResidentialRetail &amp; CommercialPublic &amp; Educational', 1, 1, 0, 'mqTVlp4XFc8ffDhP.jpg', '(03) 5261 2614 ', NULL, 'http://www.taylorgarwooddesigns.com.au', 'info@taylorgarwooddesigns.com.au', NULL, NULL, NULL, 'Level 1, 38-40 Bell Street Torquay, Victoria 3228  PO Box 87, TORQUAY, VIC, 3228', '-38.3312190693995', '144.27967809999996', 0, '2015-11-19 12:43:36', '2015-12-06 12:50:26'),
