(1218, 385, 'Talking Together Speech Pathology', 'talking-together-speech-pathology', 'We are a family focused service which specialises in speech, language and communication development for children 0 - 6 years of age. We aim to make intervention both fun and flexible. Services are provided in a range of settings including home, schools, childcare centres and our clinic room so that you are able to choose which best suits you and your child.We hope to provide you with information on developmental milestones and the range of therapy options available for you and your child so they may be the best communicators they can be.', 1, 1, 0, 'ogFq34lm8i8wuCXk.jpg', '0411624218', NULL, 'http://www.talkingtogether.com.au', 'talkingtogether@spin.net.au', NULL, NULL, NULL, '64 Sydney Pde, GEELONG, VIC, 3220', '-38.152636', '144.36807899999997', 0, '2015-11-19 12:43:36', '2015-12-06 12:50:27'),
