(1224, 389, 'Supreme Health Services', 'supreme-health-services', 'Supreme Health Services provides high quality, home based care which is efficient, effective and timely to our clients.Our carer services are available 24 hours, 7 days a week, on a live-in or live-out basis.Our in-home services are tailored to meet the client''s care requirements and are provided on a one-on-one basis, thus addressing the uniqueness of each individual''s needs, privacy and dignity.Supreme Health Services approach is both professional and friendly, aiming at building relationships. We provide prompt, quality service through our bilingual carers who are able to respond to emergency shifts.Our staff are motivated and experienced and committed to Supreme Health Services core values.', 1, 1, 0, 'oY6LweraXETBy4p5.jpg', '(030 9571 2224', NULL, 'http://www.supremehealthservices.com.au', 'support@supremehealthservices.com.au', NULL, NULL, NULL, 'PO BOX 88, GLEN HUNTLY, VIC, 3163', '-37.8901258', '145.04216070000007', 0, '2015-11-19 12:43:38', '2015-12-06 12:50:29'),
