(1228, 391, 'State Wide Equipment Program', 'state-wide-equipment-program', 'The State-wide Equipment Program (SWEP) is a sub-division of Ballarat Health Services which oversees a number of different ‘assistive technology’ programs.SWEP provides Victorian people who either have a permanent or long-term disability or are frail aged with subsidised aids, equipment and home and vehicle modifications to enhance their independence and facilitate community participation.SWEP incorporates the following programs:Programs within the Victorian aids &amp; equipment state-wide equipment network are funded by the Department of Human Services and include:o    Aids and Equipment Program (A&amp;EP)o    Continence Aids (CA)o    Domiciliary Oxygen Program (DOP)o    National Disability Insurance Scheme (NDIS)o    Supported Accommodation Equipment Assistance Scheme (SAEAS)o    Top-up fund for Children (TFC)o    Vehicle Modification Subsidy Scheme (VMSS)Programs within the Community Equipment Programs (CEP) are funded by the Department of Human Services and include:o    My Future My Choice (MFMC)o    Open Place (OP)A program funded by the Australian Government Department of Education, Employment and Workplace Relations (DEEWR), Office of Early Childhood Intervention and Childcare is managed by SWEP on behalf of the Gowrie Institute:o       Specialist Equipment Library (SEL)&nbsp;The Victorian State-wide equipment program (SWEP) provides people with a permanent or long-term disability with subsidised aids and equipment to enhance independence in their home, facilitate community participation and support families and carers in their role. SWEP aims to enhance the independence and safety of people with a disability in their own home, facilitate their participation in the community and support families and carers. SWEP is a suite of programs funded by the Department of Human Services and administered by Ballarat Health Services. Principles The key principles underpinning the SWEP are to improve outcomes for individuals and aim to achieve a customer focused service through: ? Streamlined and timely access to an integrated and coordinated service delivery system. ? Transparent processing, prioritisation and equitable access. ? Efficient and cost effective use of resources. Objectives The objectives of the Victorian State-wide equipment program (SWEP) are to provide: ? Subsidised aids and equipment that support goals and plans of an individual at key life stages. ? Streamlined, single point of access for individuals irrespective of their place of residence. ? A cost-effective aids and equipment program which maximises assistance to as many individuals as possible.', 1, 1, 0, 'VExRN1m1jwCenyIs.jpg', '1300 747 937', NULL, 'http://swep.bhs.org.au/', 'swepcentralintake@bhs.org.au', NULL, NULL, NULL, 'PO Box 1993, BAKERY HILL, VIC, 3354', '-37.6838895', '144.58453859999997', 0, '2015-11-19 12:43:39', '2015-12-06 12:50:31'),
(1229, 392, 'St. Mary&#8217;s Health Services Pty. Ltd.', 'st-mary8217s-health-services-pty-ltd', 'St Mary’s Health Services is a privately owned organisation that offers quality home-based care to people living with disabilities.We provide 5 star care services for as little as one hour, or for 24 hours, 7 days per week, across metropolitan Melbourne.Support services are tailored to meet the needs of the individual and include:	Personal care	Home care	Companionship, shopping and transport	Respite care	Live-in care', 1, 1, 0, 'inm9I7lF7BuwPtAr.jpg', '(03) 9773 8234  Mob 0423 118 886', NULL, 'http://www.stmaryshealthservices.com.au', 'info@stmaryshealthservices.com.au', NULL, NULL, NULL, 'PO Box 5600, MORDIALLOC, VIC, 3195', '-38.0065242', '145.0863336', 0, '2015-11-19 12:43:39', '2015-12-06 12:50:31'),
