(1232, NULL, 'Spectrum House', 'spectrum-house', 'Spectrum House is a small, passionate and dedicated team of Psychologists and Behavioural Intervention Specialists, located in Balwyn North, Victoria.We offer our clients ‘Education, Understanding and Skills for Life’ by working closely with:	Individuals	Parents	Children	Teachers	Other Professionals', 1, 0, 0, 'GfGV7Jp0RS5LW1rp.jpg', '(03) 9888 4000', NULL, 'http://www.spectrumhouse.net', ' info@spectrumhouse.net', NULL, NULL, NULL, '1 Morris Street Balwyn North VIC 3104  ', '-37.802214012318984', '145.07764999999995', 0, '2015-11-19 12:43:39', '2015-12-06 12:50:32'),
(1233, 394, 'Southern Way Direct Care Service Inc', 'southern-way-direct-care-service-inc', 'Southern Way Direct Care Service Inc is a qualified and experienced Community Service Organisation that provides service, care, support and accommodation to people with disabilities in the South West Region.It is a local, non-government, not for profit, charitable organisation that provides high quality care, support, accommodation, life skills training and community access to people with disabilities primarily in Warrnambool as well as the South West region of Victoria.Southern Way was established in 1990, is incorporated under the Association Incorporation Act 1981 and is a key member of the South West Disability Network and Community South West which are consortiums of other regional community service organisations working in collaboration for the benefit of clients.Today, services are provided to over 150 people, a stable, qualified, experienced work force of 80 people are employed and gross operating expenditure currently amounts to $2.3 million p.a.  Southern Way is committed to providing high quality and accountable accommodation that can be adapted to meet resident’s changing and challenging needs.Southern Way currently successfully operates four group homes in Warrnambool and a fully supported, facility based respite home.Residents attend vocational workplaces, day placements/activities, etc that are operated by other local community service organisations that support people with disabilities. Southern Way plays a key and integral role in cooperation and collaboration with the other service providers to achieve a desired outcome for residents.', 1, 1, 0, 'YmtT3aXuMZUA9ONb.jpg', '(03) 5564 3444', NULL, 'http://www.southernway.net', 'admin@southernway.net', NULL, NULL, NULL, '181 Fairy Street WARRNAMBOOL, 3280, VIC', '-38.37872301257697', '142.480587', 0, '2015-11-19 12:43:40', '2015-12-06 12:50:33'),
(1234, 395, 'Southern Cross (Car-with-Driver) Service', 'southern-cross-car-with-driver-service', 'Southern Cross specialises in chauffeur cars Melbourne wide and airport transfers Melbourne wide.We understand the importance of being on time, every time with our VHA cars. Our clients have “peace of mind”, knowing their VHA cars Melbourne obligations are well known to our experienced drivers. Our drivers are career professionals, with the pride, respect and integrity appropriate for chauffeur Melbourne services. Our VHA cars are available to you 365 days a year and we commit to being there when you need us every time.Our fleet of VHA cars are based Melbourne wide to meet the needs of our diverse clients. Each vehicle is a current model luxury car that is fastidiously maintained for comfort and pleasure.', 1, 1, 0, 'FgNHgJSEHqhOLLP0.jpg', '1300 72 66 30 Int: +61 3 9371 2666', NULL, 'http://vha.com.au', 'bookings@vha.com.au', NULL, NULL, NULL, '1st Floor, 348 Arden Street, KENSINGTON, VIC, 3031', '-37.799189', '144.93440110000006', 0, '2015-11-19 12:43:40', '2015-12-06 12:50:33'),
(1235, 396, 'Solve Disability Solutions Inc. (formerly TADVIC)', 'solve-disability-solutions-inc-formerly-tadvic', 'Solve Disability Solutions (formerly TADVIC) is a not-for-profit organisation that makes and modifies equipment for people with disabilities whose needs cannot be met commercially. The specific equipment needs of people with disabilities varies enormously. Solve Disability Solutions can assist where a custom-made solution is required.Our therapists and volunteers work together to improve the quality of life of people with disabilities by increasing their independence and providing them with the opportunity to pursue their goals at home, school, work and at leisure.With a metropolitan base, ten regional branches and over 160 active volunteers, Solve Disability Solutions completes over 650 projects throughout Victoria every year.', 1, 1, 0, '7M8nOai5tUXX2Qav.jpg', ' 1300 663 243', NULL, 'http://www.solve.org.au', 'info@solve.org.au', NULL, NULL, NULL, 'C/- Royal Talbot Rehabilitation Centre, 1 Yarra Boulevard, KEW, VIC, 3101', '-37.789602212313376', '145.02443619999997', 0, '2015-11-19 12:43:40', '2015-12-06 12:50:33'),
(1236, 397, 'Solutions For life', 'solutions-for-life', 'People say we’re all seeking the meaning of life. I think that what we’re really seeking is the experience of being alive - Rudyard KiplingSolutions for Lifecan provide effective solutions to a range of private or corporate issues that detract from the overall quality of life.', 1, 1, 0, '3G1t6mRc2GVjEGkd.jpg', '0419 322 385', NULL, 'http://www.solutions.net.au', 'cameocc@westnet.com.au', NULL, NULL, NULL, 'PO Box 163, INVERLEIGH, VIC, 3321', '-38.1018952', '144.05117770000004', 0, '2015-11-19 12:43:41', '2015-12-06 12:50:34'),
(1237, 398, 'SkillsConnection Inc.', 'skillsconnection-inc', 'Starting from scratch......If you are someone, or are caring for someone, who has recently been assessed as having a disability SkillsConnection is here to help. We can also help you with understanding, planning and arranging NDIS funded supports.We know how challenging and confusing trying to understand and access the various systems of support can be.If you feel that you are being "given the run around", "banging your head against a brick wall" or just getting "bogged down in regulations and complications" then let us help you sort it out and get the results you are looking for.You can call us or make an appointment and talk with one of our experienced and extremely "client focussed" staff who will help you to navigate the system, access the available resources and arrange ongoing support that is tailored to suit your specific needs.At our Rae St. offices we can help you arrange......NDIS Funded SupportsCase managementIndividual SupportIn home respiteGroup activitiesSupported employmentAccredited trainingOutings &amp; entertainment', 1, 1, 0, 'f6m6aqfbcOwyhvIo.jpg', '(03) 5231 2333', NULL, 'http://www.skillsconnection.org.au', 'info@skillsconnection.org.au', NULL, NULL, NULL, '50 Rae Street COLAC, 3250, VIC   PO Box 356, COLAC, VIC, 3250', '-38.34231001256056', '143.59004500000003', 0, '2015-11-19 12:43:41', '2015-12-06 12:50:34'),
