(1239, 399, 'Simply Helping Pty Ltd', 'simply-helping-pty-ltd', '...is a private provider of a suite of in-home care and support services to our elderly population, families and individuals living with a disability, clients of brokerage organisations and for those seeking services as a life-style choice.Our professional support extends to organisations, and both private or funded individuals.Since 1998, we''ve steadily built our reputation for excellence and are currently expanding nationwide. Our team of qualified and fully experienced carers are coordinated by our local managers responsible for service provision in their own regions. This structure allows for greater involvement in support provision and much less bureaucracy in managing services.All our dedicated staff are trained, with ongoing support through mentoring and professional development programmes. An active client and staff feedback system ensures continuous improvement and reinforces our client service commitment.Simply Helping applies insight to organisational, family and individual needs encouraging a professional, flexible and customised approach for every client.Our simple mission is to add value, meaning and dignity to the lives of others.Use our search engine to locate an item in this web site...&nbsp;', 1, 1, 0, 'b5RvOCoO5fNSBu52.jpg', '(03) 5381 2076', NULL, 'http://simplyhelping.com.au', ' info@simplyhelping.com.au ', NULL, NULL, NULL, '24 Pynsent Street HORSHAM, 3400, VIC  PO Box 870, HORSHAM, VIC, 3402', '-36.71532271184339', '142.20282769999994', 0, '2015-11-19 12:43:41', '2015-12-06 12:50:34'),
