(1248, 351, 'Scooters Australia Pty Ltd', 'scooters-australia-pty-ltd', 'Australia Wide SpecialistsScooters Australia commenced business in 1992 and the same owners still run the company. So we know just about all there is to know about this industry. We don''t try to sell a whole range of products, but concentrate mainly on mobility products where we have developed a strong reputation for expertise.We have outlets or dealers in almost all parts of Australia, both in metropolitan areas and regional centres. If you travel and have a problem with your scooter, there is a good chance you will be able to find an outlet not too far away.', 1, 1, 0, '7ecuT54s3kWEptYh.jpg', ' 1300 622 633', NULL, 'http://www.scootersaus.com.au', 'dandenong@scootersaus.com.au', NULL, NULL, NULL, 'Unit 4, 355 South Gippsland Hwy, DANDENONG SOUTH, VIC, 3175', '-38.027753', '145.245142', 0, '2015-11-19 12:43:43', '2015-12-06 12:50:37'),
