(1253, NULL, 'Safety Link', 'safety-link', 'Monitored 24/7 emergency assistance at the touch of buttonPersonal Monitoring &amp; Alarm Service (PERS)Safety Link is a Personal Emergency Response Service that was established to keep people who live alone at home, in touch with their family, friends and even medical care if they should need it.Safety Link provides its services to Government Departments, Retirement Villages, as well as many Community Groups and individuals across Australia.It is designed for elderly people — or anyone who lives alone — who need a simple and reliable way to keep connected to family, friends and others who can help them in an emergency.With Safety Link, you can immediately summon assistance via simple, touch-of-a-button access.Safety Link prides itself on helping maintain clients’ independence and recognises its successes are due to the dedicated friendly employees who provide a personal and caring service to its clients.', 1, 0, 0, 'vBuIMZqgyBmEBxLi.jpg', '1800 813 617', NULL, 'http://www.safetylink.org.au', 'info@safetylink.org.au', NULL, NULL, NULL, 'Ground Floor, 16 Eastwood Street, BALLARAT CENTRAL, VIC, 3350', '-37.564972', '143.861764', 0, '2015-11-19 12:43:43', '2015-12-06 12:50:38'),
(1254, NULL, 'Saddle On Pty Ltd', 'saddle-on-pty-ltd', 'Located just 15km northeast of the Geelong CBD and only 30mins from Melbourne, Werribee and Point Cook. Saddle On Riding School’s facilities are set on 78 acres and include 2 indoor riding arenas, three outdoor arenas, lunging arena, cross country and jumping course, undercover horse bays, agistment facilities, and more.At Saddle On Riding School Geelong, you can enjoy:Horse Riding LessonsSchool Excursions / Group Activity BookingsHorse Riding PartiesBMX PartiesPremium Accredited Equine EducationHorse Riding Day CampsHorse Agistment', 1, 0, 0, 'W73yCSTrzBWhGPi9.jpg', '(03) 5282 4017 Mob 0412 773 411', NULL, 'www.saddleon.com.au', 'enquiries@saddleon.com.au', NULL, NULL, NULL, '550 Elcho Road, LOVELY BANKS, VIC, 3213', '-38.02215501241693', '144.321238', 0, '2015-11-19 12:43:44', '2015-12-06 12:50:38'),
