(1264, 410, 'RDNS', 'rdns', 'At RDNS we’re here for everybody. Whether you’re an individual needing medical care at home, a GP with a patient who could benefit from home care or a doctor transitioning a patient from hospital to home, we’re by your side.If you’re an employer wanting to make sure your staff are well looked after, we can help. And if you’re new to Australia and you’re having difficulty understanding your health situation because of a language barrier, that’s no barrier to you accessing home nursing.', 1, 1, 0, 'G8wiyQmW4fboRUWs.jpg', '1300 334 455', NULL, 'http://www.rdns.com.au', 'info@rdns.com.au', NULL, NULL, NULL, '31 Alma Road, ST KILDA, VIC, 3182', '-37.86102501234512', '144.98577699999998', 0, '2015-11-19 12:43:45', '2015-12-06 12:50:40'),
(1265, 411, 'Rachel Jeffery', 'rachel-jeffery', 'Accredited Practising Dietitian and Accredited Practising Nutritionist,Rachel currently writes for Food On Tap and is regularly called upon as a nutrition expert for media commentary.Rachel works as a private consultant and independent Dietitian spokesperson for print, radio and television media requests.', 1, 1, 0, 'KzvgGFmVp5Sxf7gZ.jpg', '(03) 5222 6868', NULL, 'http://www.racheljeffery.com', 'rachelmgjeffery@gmail.com', NULL, NULL, NULL, 'Latrobe Health Centre, 291 Latrobe Terrace, GEELONG, VIC, 3220', '-38.151231', '144.35232399999995', 0, '2015-11-19 12:43:45', '2015-12-06 12:50:40'),
(1266, NULL, 'Push Mobility', 'push-mobility', 'Who We ArePush Mobility is a disability equipment dealer and distributor based in Melbourne, Australia dedicated to providing disability equipment that is fun, exciting and pushes the boundaries of what disability equipment should be.Why Push Mobility?With many disability products now in the market, our customers have never had so many options to consider. Our goal is to help improve the quality of life for people that live with a disability and those that they associate with. We aim to offer products that people don’t just like but love. If you love your wheelchair, you will take pride in getting out and using it.We work with manufacturers that do everything possible to tailor a chair to your desires. Whether it be a small modification or a radical colour concept, it’s all possible. We aim to make our products as affordable as possible, finding ways to bring down the price without comprising on quality or service.', 1, 0, 0, '4IGVq0szzAq0zi8V.jpg', '1300 721 328', NULL, 'http://www.pushmobility.com.au', 'info@pushmobility.com.au', NULL, NULL, NULL, '341 George Street, FITZROY, VIC, 3065', '-37.7991639', '144.9818001', 0, '2015-11-19 12:43:45', '2015-12-06 12:50:41'),
