(1269, 413, 'Pro Feet Podiatry', 'pro-feet-podiatry', 'How Podiatry can help you...As Podiatrists, we love being a part of your health team, helping to keep you active, healthy and happy.Our team of professional, experienced and caring Podiatrists are qualified to help you with all of your foot, ankle and lower limb related problems:Plantar Fasciosis / Heel painMedial tibial stress syndrome / "Shin splints"Footwear managementForefoot painStress fracturesIn growing toe nailsArch painCAM Walker fittingHallux Valgus / BunionsChildren''s feetRunning technique &amp; efficiencyArthritic foot painDiabetes foot careSkin and nail conditionsFungal toenail managementPlantar wartsCorns &amp; callusPodiatry management can also be beneficial as part of the overall management of more proximal (further up) problems:Knee pathologiesHip painLower back painITB friction syndromeOur Podiatry team use clinical experience and progressive Podiatry tools to assess and manage your condition:Treadmill video assessmentDoppler ultrasoundPhotodynamic Therapy (PACT) - Fungal Nail TreatmentLaser scanned orthotic devicesRunning &amp; walking video assessmentShock wave therapy3D Pressure sensor assessment', 1, 1, 0, 'r4MWxhjAQ7zMpnh9.jpg', '(03) 5251 5724', NULL, 'http://www.profeetpodiatry.com.au', 'admin@profeetpodiatry.com.au ', NULL, NULL, NULL, '1 East Street  (off Palmerston Street) Drysdale, 3222', '-38.175030923403284', '144.5663505', 0, '2015-11-19 12:43:46', '2015-12-06 12:50:42'),
