(1271, NULL, 'Praxis Disability Consulting', 'praxis-disability-consulting', 'Solutions to the challenges that your disability service organisation faces. Delivering better outcomes for your clients and staff.\nPraxis is the process by which a theory, lesson, or skill is enacted, practised, embodied, or realised. For us it’s simply the practice of taking theory or knowledge and applying it to current work practices to ensure better client outcomes.\nSystems change and capacity-building efforts, based on evidence based practice!\nAs disability professionals who work and research in our chosen fields, we’re ideally positioned to work with your organisation and staff to assist you to adopt best practice in the field of disability.\nReal life experience supported by up to date thinking and knowledge.\nAt Praxis, we don’t believe in a “one size fits all approach”.\n', 1, 0, 0, 'A2neB9iSGd2kh0D4.jpg', '(03) 97291581 Mob  0427814840 ', NULL, 'http://www.praxisdisabilityconsulting.com.au', 'peter.smith@praxisdisabilityconsulting.com.au     petersmith1@me.com', NULL, NULL, NULL, '59 Hume St, RINGWOOD EAST, VIC, 3135', '-37.821909', '145.25880400000005', 0, '2015-11-19 12:43:46', '2015-12-06 12:50:42'),
