(1276, 416, 'People Outdoors', 'people-outdoors', 'About People OutdoorsPeople Outdoors is a community based non-profit organisation established by the Australian Camps Association in 1989. People Outdoors strives to provide recreation activities to all people with disabilities.This includes various types of programs to enable children, teenagers and adults with disabilities to participate in outdoor adventure programs and weekend camping experiences.People Outdoors works with individuals who have a physical or intellectual disability or an acquired brain injury.Programs may be restricted to individuals or groups from a certain area, however, we can work in all areas if appropriate funding can be sourced. Please see our programs page for more details.People Outdoors strives to provide the highest level of service, safety and enjoyment on all of our programs.Our Vision  -  "Adventure for All"', 1, 1, 0, 'nA2BmccivD72A0UB.jpg', '(03) 9365 7150  Voice/ Land Line (03) 9430 2950', NULL, 'http://www.peopleoutdoors.org.au/', 'peopleoutdoors@auscamps.asn.au', NULL, NULL, NULL, '1/14 Concorde Drive, KEILOR PARK, VIC, 3042', '-37.72226801228355', '144.84938999999997', 0, '2015-11-19 12:43:47', '2015-12-06 12:50:44'),
(1277, 417, 'Pathways', 'pathways', 'Pathways promotes and facilitates personal recovery and community integration, in order to improve the quality of life of people affected by mental health issues.', 1, 1, 0, 'HMVTogXJ78rsywKa.jpg', ' (03) 5229 8295', NULL, 'http://www.pathways.org.au', 'admin@pathways.org.au', NULL, NULL, NULL, '61 Pakington St.,  Geelong West, VIC   PO Box 7168, GEELONG WEST, VIC, 3218  ', '-38.13546501246761', '144.34893899999997', 0, '2015-11-19 12:43:47', '2015-12-06 12:50:44'),
(1278, 418, 'Pace Exercise Physiology', 'pace-exercise-physiology', 'One–on-one sessions and Group classesOne–on-one sessionsManaging your injury or condition through exercise can be the healthiest thing for your body.PACE provides personalised one-on-one consultations with experienced Exercise Physiologists to teach you how to move and perform exercise with perfect execution. This provides you with the tools and knowledge of how to manage your condition and perform your exercises yourself at home.Firstly we recommend you undertake an initial assessment to identify your major problems and to understand your medical history. At this time we identify the root cause of your condition/s and help your work towards correcting these problems through exercise and lifestyle changes.We can provide you with a detailed home exercise program and designed eating plans to help optimise your health. We work closely with your GP and other allied health specialists to maximise your results and wellbeing.Group classesPACE offers a wide range of group exercise classes, from the beginners to the advanced athlete to keep you fit and healthy. Group sessions are fun and affordable way to keep your new habits on track!Groups are run by Accredited Exercise Physiologist or exercise specialist with boutique style number from 4-8 in a class. Groups are also customisable so please contact us for more info on this option.', 1, 1, 0, '9SvbxCETHxGAgoBZ.jpg', '(03) 9770 6770', NULL, 'http://www.pacehm.com.au/locations/frankston/', 'info@pacehm.com.au', NULL, NULL, NULL, '24 Yuille Street, FRANKSTON SOUTH, VIC, 3199', '-38.153274', '145.12448300000005', 0, '2015-11-19 12:43:48', '2015-12-06 12:50:44'),
(1279, 419, 'Otway Health &#038; Community Services', 'otway-health-038-community-services', 'Otway Health is located in the picturesque harbour town of Apollo Bay, some 190km south west of Melbourne. We are block funded as a Multi-purpose Service (MPS) providing a wide range of clinical and community services to the catchment area from Lavers Hill to Wye River.The diversity of our region and the challenges presented with offering services to cater for the 3,500 residents in the area (swelling to around 20,000 during the summer months) means the flexibility offered by our service is well-suited to this region.Our main challenge is our geographically isolated location. Apollo Bay is surrounded by the steep hills of the Otway Ranges and access to and from major towns is time consuming due to the steep terrain and winding road access. Travel times to Geelong are up to two hours in off peak times and are considerably longer during peak tourist times. Inland, the closest town is Colac, which is over an hours travel time, being 75 kilometres away. A lack of public transport, for all the communities in the southern part of the Colac Otway Shire, contributes to the geographic remoteness of the community.Through our Board, Otway Health is accountable to the Commonwealth Government and the Victorian Government for the efficiency and integrity of operations and the quality of the services provided. Funding arrangements for multi-purpose services consist of Commonwealth and State Aged Care as well as Rural Primary Health funding. At a local level these funding arrangements facilitate a greater degree of flexibility to the MPS, allowing a range and type of appropriate services to be provided in response to the identified needs of our community.Otway Health has a joint agreement with both the Commonwealth and Victorian Governments. We are accountable to the Commonwealth and Victorian Governments for the efficiency and integrity of our operations and the quality of the services we provide.', 1, 1, 0, 'NVYG0ay8XnZzfwgq.jpg', '(03) 5237 8500', NULL, 'http://www.otwayhealth.com.au', 'otwayhealth@swarh.vic.gov.au', NULL, NULL, NULL, '75 McLachlan Street APOLLO BAY, 3233, VIC  P.O. Box_84, APOLLO BAY, VIC, 3233', '-38.75455401274733', '143.66424900000004', 0, '2015-11-19 12:43:48', '2015-12-06 12:50:45'),
