(1286, 424, 'Orthotic Motion', 'orthotic-motion', 'Orthotic Motion is a dynamic and experienced Orthotic clinic located in Geelong. Our role is to assess, prescribe, manufacture, fit and provide education of Orthopaedic braces and supports for the whole body. We specialise in: Foot and Ankle, Custom made Foot Orthotics, Chronic Conditions, Fracture Casting/Bracing, Orthopaedic and Rehabilitation Bracing, Medical Compression Garments', 1, 1, 0, '1zca0v6WQdfWXV3V.jpg', '(03) 5222 8884', NULL, 'http://www.orthoticmotion.com.au', 'info@orthoticmotion.com.au', NULL, NULL, NULL, '42 Little Myers Street, GEELONG, VIC, 3220', '-38.152145', '144.35678299999995', 0, '2015-11-19 12:43:49', '2015-12-06 12:50:47'),
(1287, 425, 'Optimal Movement &#8211; Exercise Physiology Services', 'optimal-movement-8211-exercise-physiology-services', 'Optimal Movement’s Accredited Exercise Physiologists (AEP) specialise in the delivery of exercise and lifestyle modification programs for people with chronic conditions and healthy populations on the Bellarine Peninsula and Geelong region.Our AEP’s have extensive knowledge, skills and experience in clinical exercis e delivery and health-behaviour modification counselling for people with chronic disease.Our mission is:To empower people to make positive changes to their health and life that has a valuable impact on their family and the wider communityExercise Physiology is recognised by:MedicareWorkSafePrivate Health Insurers (check with your fund)Department of Veterans’ Affairs (DVA) #Transport Accident Commission (TAC)Clients may be eligible for Medicare rebates for maximum of 5 sessions per calendar year or if clients have Type 2Diabetes they may be eligible for Medicare rebates for an assessment and up to 8 group sessions per calendar year.', 1, 1, 0, 'yKYnPnME3luNc8x5.jpg', '(03) 5251 2958  Mob 0409 960 106 	', NULL, 'http://www.optimalmovement.com.au/', 'info@optimalmovement.com.au', NULL, NULL, NULL, '27-29 High St, DRYSDALE, VIC, 3222', '-38.174563', '144.56946400000004', 0, '2015-11-19 12:43:49', '2015-12-06 12:50:47'),
(1288, 426, 'OPC Health', 'opc-health', 'OPC Health is an Australian owned, ISO9001 accredited company.We have been servicing the Health Industry since 1985 as a national manufacturer and distributor of prosthetic, orthotic, physiotherapy, occupational therapy and podiatry products, electric physiotherapy and chiropractic couches, and electrotherapy and diagnostic ultrasound equipment.OPC Health holds contracts with major health area services and government bodies as a preferred supplier. We take pride in providing the highest level of service to our customers and strive to continue this tradition by partnering with Health Industry innovators.We also offer a Clinical Orthotic Service across a number of clinics in metropolitan Melbourne and rural Victoria.Our national head office and distribution centre is located in the Port Melbourne business precinct, with sales offices in Melbourne, Sydney, Brisbane and Adelaide.', 1, 1, 0, 'AuLDo0lMvYtTuGYr.jpg', '( ﻿03) 9681 9666', NULL, 'http://www.opchealth.com.au', 'accounts@opchealth.com.au', NULL, NULL, NULL, '151 Turner Street, PORT MELBOURNE, VIC, 3207', '-37.8239476', '144.93116899999995', 0, '2015-11-19 12:43:49', '2015-12-06 12:50:47'),
(1289, 427, 'OneStep Education Network', 'onestep-education-network', 'We help people with all levels of physical and cognitive disability, to identify the technology that will best suit them to regain their independence. We can assist from start to finish, to ensure you are setup and trained to make the most of your technology. We can help whether you have just a single issue you want addressed or a complete approach developed.', 1, 1, 0, 'NyAwvkwxqwtcbaaq.jpg', '0408 589 734', NULL, 'http://www.onestep.net.au', 'jeffneal@onestep.net.au', NULL, NULL, NULL, 'P.O. Box 704, PASCOE VALE, VIC, 3044', '-37.730366', '144.92867999999999', 0, '2015-11-19 12:43:50', '2015-12-06 12:50:48'),
