(1292, NULL, 'On The Up and Up &#8211; Counselling and Psychological Services', 'on-the-up-and-up-8211-counselling-and-psychological-services', 'My business is based on the belief that my client''s needs are of the utmost importance. I am committed to meeting those of your needs. As a result, a high percentage of my business is from repeat clients and referrals.Specialising in the treatment of:Anxiety &amp; PhobiasAnger ManagementAssertivenessConflict ResolutionDepressionDisability &amp; Sexual HealthGender &amp; Sexual Identity DisordersLife/Personal CoachingLoss and GriefMen''s IssuesShyness &amp; Social Skills DeficitsSexual DifficultiesTraumaWorkplace Counselling', 1, 0, 0, 'LENe94AulJhjiShn.jpg', '0422 375 899', NULL, 'http://www.ballaratcounsellingandpsychology.com.au', NULL, NULL, NULL, NULL, 'Room 16. Level 1, 101 Sturt Street  BALLARAT, VIC   3350 4516 Colac-Ballarat Road, NAPOLEONS, VIC, 3352', '-37.57001119611997', '143.8173703', 0, '2015-11-19 12:43:50', '2015-12-06 12:50:49'),
(1293, 429, 'Ocean Grove Physiotherapy', 'ocean-grove-physiotherapy', 'We pride ourselves in providing a friendly, caring and professional health service from experienced physiotherapists and reception staff. The clinic has four private treatment rooms and a well equipped physiotherapy gymnasium. We have our own outdoor solar heated pool and offer three group hydrotherapy sessions per week.Whatever your age or physical condition, at Ocean Grove Physiotherapy we can help you move well and stay well. Ocean Grove Physiotherapy can also provide home visits, if required.Surfcoast Podiatry co-locate with us to provide all your general, sporting and bio-mechanical treatment needs.', 1, 1, 0, NULL, '(03) 5256 2636', NULL, 'http://coriobayhealth.com.au/locations/ocean-grove/', NULL, NULL, NULL, NULL, '12 Tuckfield Street, OCEAN GROVE, VIC, 3226  ', '-38.258285', '144.53492900000003', 0, '2015-11-19 12:43:51', '2015-12-06 12:50:49'),
