(1295, 430, 'Healthscope Independent Services', 'healthscope-independent-services', 'Healthscope is one of Australia’s leading private healthcare operators, providing services through three divisions:	Healthscope Hospitals - the operation of private hospitals in Australia	Healthscope Pathology - the provision of pathology testing services in Australia and internationally	Healthscope Medical Centres - the operation of medical centres in Australia.', 1, 1, 0, 'MLx8ACAKoLUA77hE.jpg', '(03) 9926 7500 ', NULL, 'http://www.healthscope.com.au', 'info@healthscope.com.au', NULL, NULL, NULL, 'Level 1, 312 St Kilda Rd, MELBOURNE, VIC, 3004', '-37.829113', '144.97085229999993', 0, '2015-11-19 12:43:51', '2015-12-06 12:50:49'),
(1296, 431, 'Noah&#8217;s Ark Inc', 'noah8217s-ark-inc', 'What we doAt Noah’s Ark we offer a range of services and programs that support children aged 0-8 with a range of disabilities, developmental delays and their families.We work in partnership with services, families and communities to give children the best opportunities for growth and development.We do this in two ways:Providing direct support to families who have children with disabilities, particularly to support children’s development through our Early Childhood Intervention Services (ECIS).Providing support to Early Childhood Education and Care (ECEC) services, to support high quality inclusion of children with additional needs, including children with disabilities, Indigenous children and children from Culturally and Linguistically Diverse (CALD) backgrounds. This is done through our Inclusion and Professional Support Program (IPSP).Our services include:Early Childhood Intervention Services (ECIS)Inclusion and Professional Support Program (IPSP)Better Start for Children with DisabilitiesHelping Children with Autism (HCWA)National Disability Insurance Scheme (NDIS)Parent to Parent Gippsland', 1, 1, 0, '9VzJSxwB3Udgp3Kn.jpg', '(03) 8823 8600', NULL, 'http://www.noahsarkinc.org.au', 'noahsarkinc@noahsarkinc.org.au', NULL, NULL, NULL, '1283 Malvern Road, MALVERN, VIC, 3143', '-37.852201', '145.03638999999998', 0, '2015-11-19 12:43:51', '2015-12-06 12:50:50'),
(1297, 432, 'Nissand Community Housing', 'nissand-community-housing', 'Nissand PL (Nissand Community Housing group) was established in early 2005 in response to an unmet need for residents with disabilities being in inappropriate accommodation. The principals Andrew TSINDOS and Rodney NISSEN have worked in the health and allied health sectors for a combination of 57 years, 39 years in rehabilitation and disability sector.Our mission statement is “to provide residents a supportive environment nurturing a very high level of independence, care and focusing on having fun”. We recognise that each resident’s care and treatment is totally dependent on his or her own abilities, needs and wants, no individual is the same and the approach requires balance and focus on the resident.  Nissand recognises that people of any age, or with disabilities, (whether the disabilities are physical, sensory, intellectual, psychiatric or the result of age, accident or illness) are individuals and entitled to the individual support and care of their choice and of the best quality available.Through support, guidance and education is the primary objective to provide a high standard of individualised care for each person in a safe, warm, friendly and comfortable environment of his/her choice.It is the purpose of Nissand Community Housing Group to provide personal support, guidance and assistance to people with disabilities and their carers, so that they may retain as much independence as possible in an environment that is secure and appropriate.We recognizes that people with disabilities (whether the disabilities are physical, sensory, intellectual, psychiatric, or the result of age, accident or illness) are individuals and are entitled to the individual support and care of their choice and of the best quality available.Through support, guidance and education it is the primary objective to provide a high standard of individualised care for each person in a safe, warm, friendly and comfortable environment of his/her choice.Our aim is to ensure that our residents live in a supported accommodation that has the high quality 24-hour care required to sustain and support their care needs. Demonstrating a home like, and liveable environment that is not institutionalised and therefore demeaning, or discriminatory in appearance or description', 1, 1, 0, 'srg8CfZbCtolNC42.jpg', '(03) 9772 2487', NULL, 'http://www.nissand.com.au', 'rgnissen@bigpond.net.au', NULL, NULL, NULL, '588 Nepean Highway CARRUM, 3197, VIC   PO Box 326, CAMBERWELL, VIC, 3124', '-38.0688730124378', '145.12002800000005', 0, '2015-11-19 12:43:51', '2015-12-06 12:50:50'),
(1298, 433, 'Nicole Carvill Psychology', 'nicole-carvill-psychology', 'Work With Our PsychologistsWork with Our PsychologistsOur psychologists would  love to work with you and your child to provide you with the support, information and access to the latest evidence based therapies. Together we can achieve your goals.We only work with children/adolescents and their families. This means we have highly developed skills and experience in helping you and your child. We believe in a strengths based approach which means we help to build on and extend your child’s strengths. We also use a range of innovative interventions to develop a treatment plan to build upon and expand your child’s existing skill set. Our emphasis is on skill development and mindset growth.We offer three types of psychology services:  individual consultations for children and families, group based courses and training and direct support to schools. We are also a registered provider with the National Disability Insurance Agency.Assessment ServicesA comprehensive diagnostic assessment explains why your child is struggling with impulse control, concentration, social skills, reading, maths, spelling or writing. Once you have identified why they are  struggling you then know how to address these issues. Read more about the benefits of assessment here.We provide the following diagnostic assessments:Cognitive assessment to determine giftedness and intellectual functioning.Educational assessments to determine a learning disability (e.g., dyslexia)Working memory assessmentAssessment of executive functioningAutism Spectrum DisorderAttention Deficit DisorderVerbal feedback and a detailed written report that is filled with practical strategies is provided for all diagnostic assessments.', 1, 1, 0, 'xNM9IAnZBmhkaoD6.jpg', '0417 156 254', NULL, 'http://thinknicolecarvill.com/', 'nicolecarvill9@gmail.com', NULL, NULL, NULL, '38 Barrabool Road,  Highton 3216  Geelong PO Box 6184, HIGHTON, VIC, 3216', '-38.170686012483394', '144.325103', 0, '2015-11-19 12:43:51', '2015-12-06 12:50:51'),
(1299, NULL, 'Nicola Goodwin', 'nicola-goodwin', 'Specialist assessment of skills, abilities and needs.Early childhood interventions - travel time specialised group early childhood interventions specialised individual therapy for children with Autism specialised individual therapy for early childhood.Speech and Language Pathology distance travel Speech and Language Pathology in a group Speech and Language Pathology with an individual group multidisciplinary approaches individual multidisciplinary approaches therapy for children with Autism.', 1, 0, 0, NULL, '0408 570 183', NULL, NULL, 'ngoodwin.speech@gmail.com', NULL, NULL, NULL, '27 Gughridge Street Ocean Grove, Victoria', '-38.259289012523205', '144.52134999999998', 0, '2015-11-19 12:43:52', '2015-12-06 12:50:51'),
