(1301, 434, 'Nicholas Jarman', 'nicholas-jarman', 'PHYSIO ROOM GEELONG offers a refreshing approach to Physiotherapy. The clinic is a friendly boutique style clinic providing individualised treatment and focus primarily on your quality of care in a relaxed environment.Our mission is to provide the best physiotherapy and complete customer care to our patients in the Geelong Region.Contact UsWe offer convenient hours, after-hour appointments and home visits', 1, 1, 0, 'KM9sQPuX4nKXULjH.jpg', '(03) 52 212919', NULL, 'http://www.physioroomgeelong.com.au', 'admin@physioroomgeelong.com.au', NULL, NULL, NULL, 'Physio Room Geelong, 309 Pakignton Street, NEWTOWN, VIC, 3220', '-38.157056664181226', '144.34620414999995', 0, '2015-11-19 12:43:52', '2015-12-06 12:50:51'),
(1302, 435, 'Nextt Heath Pty Ltd', 'nextt-heath-pty-ltd', 'Respite Care:    Home respite can provide a few hours break on a regular basis. We also offer  overnight and live-in respite services for carers having difficulty getting residential respite.Case Management:     Case Managers are people who know how to make complex things that affect your well-being run smoothly. They make sure you know and understand your needs.Individual Support:     A package of services which are tailored to enrich you and your support networks. Designed in collaboration with a case manager.Personal Care:     Starting your day feeling refreshed and confident is one way you can feel good about yourself and boost your sense of well-being.Transport Services:     Getting around from one point to another can be difficult for many people. Using community transport or public transport is not always suitable, especially if you need assistance.Domestic Assistance:     These Domestic Assistance and Housekeeping services provide you with help for light housework.  They help reduce the risk of you injuring yourself doing difficult tasks.', 1, 1, 0, 'JCgjzX1MSmNZUlNU.jpg', ' (03) 9829 9100 ', NULL, 'http://www.nextt.com.au', 'enquiries@nextt.com.au', NULL, NULL, NULL, 'Level 5, 534 Church St Richmond East, Victoria 3121PO Box 4335 Richmond East, 3121 VIC ', '-37.81911701232654', '144.998785', 0, '2015-11-19 12:43:52', '2015-12-06 12:50:52'),
(1303, NULL, 'Next Step &#8211; Exercise Physiology', 'next-step-8211-exercise-physiology', 'Next Step – Exercise Physiology operates from various locations throughout Geelong. Our Accredited Exercise Physiologist, Sara Marwick will work with you to control the processes of your pain cycle.  Sara will give you the tools and knowledge to self-manage your pain.&nbsp;Each person is treated as an individual. Sara will provide you with a comprehensive assessment and work with you to establish your personal goals to improve you condition and decrease your pain. Sara follows the latest research in evidence based practice to provide you with a highly individualised exercise program to correct your posture and movement. Her aim is to help decrease your pain and get you enjoying life again!', 1, 0, 0, '7Umqn2paT8V8E4Iu.jpg', '(03) 5241 1155 Mob 0402 851 866', NULL, 'http://www.nextstepep.com.au/', 'sara_marwick@hotmail.com ', NULL, NULL, NULL, '1/98 South Valley Road, HIGHTON, VIC, 3216', '-38.18031501248774', '144.31653900000003', 0, '2015-11-19 12:43:52', '2015-12-06 12:50:52'),
(1304, 436, 'Newtown Physiotherapy &#038; Pilates', 'newtown-physiotherapy-038-pilates', 'Newtown Physiotherapy &amp; Pilates was the first centre in Geelong to offer Pilates exercises sessions. Individual supervised sessions tailored to your specific needs &amp; goals are provided by our fully trained Pilates staff. Our Physiotherapists can structure specific rehabilitation programs for the recovery of back &amp; other injuries. Here at Newtown Physiotherapy we use diagnostic ultrasound to assist the assessment &amp; training of the core muscles. Our Massage Therapists work in conjunction with our physiotherapist providing a wide range of services to our clients.Physical therapy is a natural way to help your body feel betterIf you are recovering from an injury, or are suffering from back, muscle or joint pain, our specialist practitioners can help you. Newtown Physiotherapy &amp; Pilates is a team of professional physiotherapists in Newtown who provide a range of treatments that aim to improve mobility, posture, and injury.Physical therapy is a holistic approach to help you feel better without the assistance of prescribed drugs. It involves evaluating, diagnosing, treating and preventing disorders related to muscle and joint problems. Newtown Physiotherapy &amp; Pilates also specialises in sports-related injuries and can help you get back in the game with minimum fuss and delay. We offer both reformer (machine based) pilates &amp; floor work classes as well.Call us today to book an appointment in Newtown and see how our physiotherapists can improve your overall health.ProductsPillowsSupport BracesStrapping TapesHeat PacksHot / Cold PacksTherabandOrthoticsGift Vouchers AvailableServicesPhysiotherapyClinical Pilates / Reformer PilatesFloor Work / Matwork PilatesMassageMyotherapyPodiatryHydrotherapyHome Visits for Veterans AffairsAssessments for the Disability Care AustraliaWorkcoverTAC', 1, 1, 0, 'vbdWvvlrNX7Tz6xN.jpg', '(03) 5221 0555', NULL, 'http://www.newtownphysio.com.au', 'info@newtownphysio.com.au', NULL, NULL, NULL, '321 Pakington St, NEWTOWN, VIC, 3220', '-38.1560224', '144.34499440000002', 0, '2015-11-19 12:43:52', '2015-12-06 12:50:52'),
(1305, NULL, 'Neuro-Rehab At Home', 'neuro-rehab-at-home', 'Rehabilitation on the moveNeuroRehab Allied Health Network is a dedicated rehabilitation service catering to the unique needs of those with neurological injuries, as well as individuals seeking general rehabilitation.Our innovative Deer Park clinic offers the latest rehabilitation equipment. We also provide an extensive home visiting service throughout metro Melbourne, Geelong and surrounds.Our team of experienced neurological physiotherapists, accredited exercise physiologists, occupational therapists and remedial massage therapists provide comprehensive rehabilitation services to maximise outcomes.We tailor programs to an individual’s unique situation, catering to clients of all ages, from those in a minimally responsive state to those wanting to learn to run or ride a bike again.Services - We provide rehabilitation for a range of conditions including:- Stroke- Acquired brain injury- Spinal cord injury- Multiple sclerosis- Parkinson’s disease- Cerebral palsy- Balance disorders- Vestibular disorders- Neurological disorders- Aged care- Musculoskeletal disorders- Neck and back pain- Sports injuries', 1, 0, 0, 'PI2HPhPMdemY95GN.jpg', '(03) 9361 2234', NULL, 'http://www.nrah.com.au', 'mail@nrah.com.au', NULL, NULL, NULL, '3 Canterbury Street DEER PARK, 3023, VIC  PO Box 5060, CAIRNLEA, VIC, 3023', '-37.77145901230535', '144.77375500000005', 0, '2015-11-19 12:43:53', '2015-12-06 12:50:53'),
