(1307, 437, 'Neami National', 'neami-national', 'Community outreach support\r\nWe offer home and community outreach support to improve health, independence and wellbeing\r\n\r\nCommunity programs\r\nWe provide a variety of group programs in all states that bring together people receiving support from us around areas of common interest or need.\r\n\r\nPrevention and early intervention\r\nWe provide short-term live-in or outreach support to prevent hospitalisation and after discharge\r\n\r\nService coordination\r\nWe are experts in managing different services and making sure you get all the support you need\r\n\r\nHousing and Homelessness support\r\nIn Sydney and Melbourne we support people to find secure, affordable and safe housing', 1, 1, 0, '51ZRPCxxrHfiUAoY.jpg', '(03) 9481 3277', '', 'http://www.neaminational.org.au', 'reception@neaminational.org.au', '', '', '', '247/249 Rosanna Rd, Rosanna VIC 3084, Australia', '-37.737901', '145.07468300000005', 0, '2015-11-19 12:43:53', '2015-12-15 04:10:39'),
(1308, 438, 'Health and Aged Assist Pty Ltd', 'health-and-aged-assist-pty-ltd', 'Obtaining the Best Aged Care Outcomes!At Health and Aged Assist, we are the largest aged care placement agency in Australia with offices in Melbourne, Queensland, Sydney and Adelaide. Working closely with social workers,Aged Care Assessment Teams, Doctors, hospitals, facility managers, government agencies and other health professionals, we pride ourselves on our knowledge and experience in servicing the aged care industry. We assist families with the entire process of placing a relative or friend into residential care. This service forms the core foundation of our expertise. However, through this we have further developed other services which complement our core business. Our sole purpose is to provide the best possible service to the Health and Aged Care industry, all tailored to an individual''s needs.Can you afford not to know all your options when placing someone into care? Our experienced aged care placement consultants will help you obtain the best aged care outcomes!', 1, 1, 0, 'RPcoOM1RcriNffpk.jpg', '1300 784 781    (03) 8545 9999', NULL, 'http://www.haaa.com.au', 'enquiry@haaa.com.au', NULL, NULL, NULL, '533 Blackburn Road Mt Waverley VIC 3149   PO Box 1405, GLEN WAVERLEY, VIC, 3150', '-37.89845201236179', '145.14298599999995', 0, '2015-11-19 12:43:53', '2015-12-06 12:50:54'),
