(1310, 439, 'Nappyland/Australian Continence', 'nappylandaustralian-continence', '&nbsp;At Nappyland we also supply continence aids to private homes and Nursing homes.  From Light to Heavy Continence.&nbsp;', 1, 1, 0, 'bvAKOXQu6ExFf0kM.jpg', '1800-220-222  (03) 9795-7888', NULL, 'http://www.australiancontinence.com.au', 'info@australiancontinence.com.au', NULL, NULL, NULL, '11-13 Overseas Drive, NOBLE PARK NORTH, VIC, 3174', '-37.952222', '145.186864', 0, '2015-11-19 12:43:54', '2015-12-06 12:50:54'),
(1311, 440, 'Nacre Consulting Pty Ltd', 'nacre-consulting-pty-ltd', 'For Children - Cathy Love has decades of Occupational Therapy experience, her services are contemporary, evidence driven, individualised and effective. Nacre Consulting provides Occupational Therapy screening, assessment and intervention services to children of all ages and stages. Our therapy aims to maximise your child’s performance and participation in all aspects of life, learning and play. To be their very best selves.For Families -  Cathy Love provides a new and unique service to families. She works with parents to dream big, set individualised goals and get their child’s entire working collaboratively and energetically. Together the paper trail is tamed, strategies for effective team wide communication actioned and service outcomes reported on. Coaching is provided on all aspects of confident leadership and assertive team management. Meetings are efficient with reporting centered around progress towards set goals, adjustments and future directions.  Practical, targeted positive assistance to empower families to better plan their child’s services. This is a service that well serves those families who will be preparing to apply for NDIS.&nbsp;', 1, 1, 0, 'zFlfDlG10xV1mVoV.jpg', '0448 316 319 ', NULL, 'http://www.nacre.com.au', 'cathy@nacre.com.au', NULL, NULL, NULL, '8 Steele St, SOUTH CAULFIELD, VIC, 3162', '-37.89680001236107', '145.02581999999995', 0, '2015-11-19 12:43:54', '2015-12-06 12:50:55'),
