(1313, 441, 'Muscular Dystrophy Association Inc', 'muscular-dystrophy-association-inc', 'The MDA has had several “homes” since its inception, each had provided the opportunity to develop programs and services in what was then a suitable environment.Little did we know that our growth was intrinsically linked to the services we provided. And the more we did, the more appropriate accommodation was required for the MDAOur first home was in Ascot Vale, in a strip shopping centre with sufficient room to be “just adequate.”A move to a high rise office complex in downtown Moonee Ponds provided significantly more space and modern facilities with spectacular views of Melbourne. However these views were seldom appreciated there was just too much to do to appreciate what Melbourne had to offer.Now paying rent to a landlord was not ideal and when the opportunity arose, we secured, through purchase, our current building. Comprising two levels with conference facilities, indoor and outdoor parking and modern amenities MDA @ 111 became the new Home of MDA.The terminology of "Home of MDA" was coined way back in 1995 when we became the first MDA to stake our plot in cyberspace and till this day, “The Home of MDA” located at www.mda.org.au has also developed as the thirst for information grew.The MDA’s very successful Futures Force program now had a dedicated area within “111” that meets the needs of providing a day program to members of our younger community.We encourage members of the MD Community to drop in and pay a visit, to access our Information Library or to have a coffee at Café MDA.The MD Centre is fully accessible with a lift bypassing the need to use the stairs to the upper level conference facility. All amenities are also fully accessible', 1, 1, 0, 't3P6wuB65znKRpJ8.jpg', '(03) 9320 9555 ', NULL, 'http://mda.org.au', 'info@mda.org.au', NULL, NULL, NULL, '111 Boundary Road North Melbourne VIC 3051   PO Box 2200, NORTH MELBOURNE, VIC, 3051', '-37.791085012314056', '144.939656', 0, '2015-11-19 12:43:55', '2015-12-06 12:50:55'),
