(1316, 443, 'Multiple Sclerosis Limited', 'multiple-sclerosis-limited', 'Our ServicesEvery person''s experience of living with MS is different. At MS, we take your individual circumstances into account – from the time of diagnosis and across the continuum of living with MS. Our services aim to help you understand a recent diagnosis, learn practical ways to manage your treatment and MS symptoms, and make healthy choices for living well with MS. Our services are for people with MS, family members, friends and carers. We also work closely with neurologists, health professionals and service providers in your local community.Who can access our servicesPeople with multiple sclerosis are eligible to register with MS. People with other progressive neurological disorders are also eligible to register where no other more appropriate services are available to meet their needs. Fees will not be charged for registration. Registration is needed to access MS’s services and programs. While family, friends, Carers and Health Professionals cannot register with multiple sclerosis; they can seek assistance via our MS Connect intake line.', 1, 1, 0, 'JLu2yWkUIjdnjHpN.jpg', '1800 042 138  (03) 9845 2700 	', NULL, 'http://www.mssociety.org.au/', 'msconnect@ms.org.au', NULL, NULL, NULL, 'The Nerve Centre, 54 Railway Road, BLACKBURN, VIC, 3130', '-37.8194262', '145.15374169999996', 0, '2015-11-19 12:43:55', '2015-12-06 12:50:55'),
