(1318, 445, 'Mpower Inc', 'mpower-inc', 'Mpower provides a range of community support services to families in theSouth West of Victoria. In this section you can read about the services we provide. Each section provides an overview of the program along with a copy of our brochure which is available for download and printing.Disability Respite ProgramsRespite program for families of people with disabilitiesProvides a range of respite programs for families of children, youngpeople and adults with disabilities.Programs include;School Holiday ProgramsWeekend GetawaysRespite PackagesFlexible RespiteActive Oceans&nbsp;Enhancing abilities, supporting families, strengthening communities.Mpower is an accredited, community-based agency that has been servicing the South Western Region of Victoria for more than 35 years. With funding from the Victorian government, Mpower employs 64 highly qualified and experienced staff to provide a wide range of support services to a client-base in excess of 800.', 1, 1, 0, 'VJwWBGAjgR644LEq.jpg', '(03) 5561 8111', NULL, 'http://www.mpower.org.au', 'admin@mpower.org.au', NULL, NULL, NULL, '71 Koroit Street WARRNAMBOOL, 3280, VIC', '-38.38566401258007', '142.48665900000003', 0, '2015-11-19 12:43:55', '2015-12-06 12:50:56'),
(1319, 446, 'Motion Wheelchairs', 'motion-wheelchairs', 'Founded in 2003, Motion Wheelchairs focuses on enhancing mobility for adults and children, by providing customised and flexible solutions for both Power and Manual Wheelchairs as well as Commodes.The dedicated team at Motion Wheelchairs have over 80 years of combined experience in the seating and wheelchair industry both locally and internationally.All of our products, including wheelchairs and commodes, can be customised to suit each individual’s needs.We have many off the shelf components to choose from or have custom designed and manufactured components that can enhance our moulded seating solutions.', 1, 1, 0, 'z90yzWyCHGFVoj9Z.jpg', '(03) 9584 9777 ', NULL, 'http://www.motionwheelchairs.com', 'contact@motionwheelchairs.com', NULL, NULL, NULL, '34 Shearson Crescent, Mentone VIC 3195  PO Box 1177, BRAESIDE, VIC, 3195', '-37.97833401239739', '145.08457600000008', 0, '2015-11-19 12:43:55', '2015-12-06 12:50:56'),
(1320, 447, 'MOIRA Inc', 'moira-inc', 'MOIRA provides a range of support services for people with disabilities and homeless youth in Melbourne. Our core values are and always have been centred around our diverse service users.', 1, 1, 0, 'CjaRrQ1Z8vC2amGn.jpg', '(03) 8552 2222', NULL, 'http://www.moira.org.au', 'moira@moira.org.au', NULL, NULL, NULL, '928 Nepean Hwy, HAMPTON EAST, VIC, 3188', '-37.935613', '145.03592500000002', 0, '2015-11-19 12:43:56', '2015-12-06 12:50:56'),
(1321, 448, 'Mobility Care', 'mobility-care', 'High quality unique mobility products from the world''s leading manufacturers.', 1, 1, 0, 'WmOFSrQAPdECsBfT.jpg', '(03) 9568 8383', NULL, 'http://www.mobilitycare.net.au', 'info@mobilitycare.net.au', NULL, NULL, NULL, '1/12 Marriott Street, OAKLEIGH, VIC, 3166', '-37.894452', '145.09770200000003', 0, '2015-11-19 12:43:56', '2015-12-06 12:50:57'),
(1322, 449, 'Mobility Plus', 'mobility-plus', 'Welcome to the world of Mobility Plus Wheelchairs - Australia''s leading manufacture of custom-built, ultra lightweight wheelchairs, established in 1983.Whether you are looking for a wheelchair for sports or everyday use, we have styles to suit all ages and disabilities. Have a look at the Equaliser folding wheelchair, Elite and Wedge rigid frame wheelchairs, as well as our sports models. We''re confident you will find a design to suit your individual needs.', 1, 1, 0, '0eeMzkDiicHIwQOi.jpg', '03 9495 1955', NULL, 'http://www.mobilityplus.com.au', 'info@mobilityplus.com.au', NULL, NULL, NULL, ' 40-42 Montefiore Street FAIRFIELD, 3078, VIC ', '-37.78434918532922', '145.0232469', 0, '2015-11-19 12:43:56', '2015-12-06 12:50:57'),
(1323, 450, 'MND Victoria', 'mnd-victoria', 'Welcome to the MND Victoria website. MND is an abbreviation for motor neurone disease.MND Victoria provides and promotes the best possible care and support for people living with MND.&nbsp;MND Support ServicesMND Victoria provides a range of services across the state to support people with MND, their carers, family, friends and health professionals.  These services are provided at no cost to the person with MND through Family Support Services (FSS).  Apply for MND Victoria''s services or contact the Association on (03) 9830 2122 or 1800 806 632.Care and support is provided through the provision of information, advice, practical assistance and personal support to people with the diagnosis, their families, carers, former carers, health professionals and service providers -  view the MND Victoria brochure (PDF) .People with MND can decide their own preferred level of involvement, for example, initially they may wish only to receive the MNDNews.  Alternatively, they might find it useful to meet with a local Regional Advisor, who can visit at home, provide information about support services in the area, and assist in linking into those services if required.Regional AdvisorsThe Regional Advisor Service is delivered by qualified health professionals, known as Regional Advisors, who have knowledge of MND and extensive experience in the community services sector.', 1, 1, 0, 'zqVZhN5tDsdjsX5S.jpg', '1800 806 632   (03) 9830 2122', NULL, 'http://www.mnd.asn.au', 'jmcconnell@mnd.asn.au', NULL, NULL, NULL, ' 	265-267 Canterbury Road CANTERBURY, 3126, VIC  PO Box 23, CANTERBURY, VIC, 3126', '-37.822650712328056', '145.07090649999998', 0, '2015-11-19 12:43:57', '2015-12-06 12:50:58'),
(1324, 451, 'Mind Health Care Pty Ltd', 'mind-health-care-pty-ltd', 'Mind Health Care provides quality affordable psychology services. All of our psychologists are members or associate members of the Australian Psychological Society and registered providers of psychological services with Medicare Australia.Our psychologists can assist you with a wide range of concerns including;DepressionTraumaBipolar DisordersPain ManagementAnxietyPanicPhobiaRelationship ProblemsSelf EsteemGrief &amp; LossDrug &amp; AlcoholAdjustmentBackground - Mind Health Care was founded in January 2009 to meet the overwhelming need for quality affordable evidence based psychology services in the Geelong region. The practice has grown rapidly as a result of the dedicated and experienced clinical and registered psychologists who have chosen to work at Mind Health Care. All our psychologists share a passion for affordable mental health care which is encapsulated in our core ideology:1. Our business is to reduce distress2. Affordable quality for all3. Evidence based', 1, 1, 0, 'r3F5LNGAdwTYeKer.jpg', '(03) 5242 8981', NULL, 'http://www.mindhealthcare.com.au', 'enquiries@mindhealthcare.com.au ', NULL, NULL, NULL, '64 Bellarine Highway, NEWCOMB, VIC, 3219', '-38.170809012483474', '144.39117299999998', 0, '2015-11-19 12:43:58', '2015-12-06 12:50:58'),
(1325, NULL, 'Michelle French &#038; Associates', 'michelle-french-038-associates', 'Michelle French &amp; Associates (MFA) is a leader in occupational therapy treatment and medicolegal assessment of people with catastrophic injuries and impairments. MFA provides occupational therapy and case management services throughout Melbourne and Victoria, with a keen interest in improving rural and remote services for families across Australia.MFA is expert in bringing quality of life to adults and children with severe and catastrophic injuries. We work with people who have spinal cord injuries, acquired brain injuries, cerebral palsy and other multiple injuries.MFA’s clinical service provides home based occupational therapy assessment and treatment. Our drive for practical, successful functional outcomes are delivered in a caring, professional and responsive manner.In the medicolegal field, MFA is considered the gold standard. Principal director Michelle French is a pioneer in the field, appearing as an expert witness in some of Australia’s biggest personal injury cases.our policiesMFA strives for integrity in the services we provide, and we are proud to abide by the National Privacy Principles contained within the Commonwealth Privacy Act.', 1, 0, 0, '38gTdZGg5LU9DEVq.jpg', '03 9489 5381', NULL, 'http://www.michellefrench.com.au', 'admin@michellefrench.com.au', NULL, NULL, NULL, 'PO Box 1341, FITZROY NORTH, VIC, 3068', '-37.783749', '144.98353599999996', 0, '2015-11-19 12:43:58', '2015-12-06 12:50:59'),
