(1327, 452, 'Mercy Home &#038; Community Care', 'mercy-home-038-community-care', 'Mercy Health is a Catholic organisation grounded in a 2,000-year tradition of caring for others. Founded by the Sisters of Mercy, Mercy Health employs over 6,000 people who provide acute and subacute hospital care, aged care, mental health programs, maternity and specialist women''s health services, early parenting services, home care services and health worker training and development. Mercy Health employs people from many cultures and backgrounds who, irrespective of their beliefs, share a common bond to care for those in need.', 1, 1, 0, 'yypYsbJJLMQe5Bff.jpg', '(03) 8416 7777', NULL, 'http://www.mercy.com.au', 'information@mercy.com.au', NULL, NULL, NULL, 'Level 2, 12 Shelley St, RICHMOND, VIC, 3121', '-37.810373', '144.99353300000007', 0, '2015-11-19 12:43:58', '2015-12-06 12:50:59'),
(1328, NULL, 'Mepacs', 'mepacs', 'Why use an emergency response personal alarm service?Feeling safe and secure at home is an important part of living independently, particularly as we get older. Mepacs provides real person monitoring with an experienced support team.We care for our clients 24 hours a day, every day of the year.Using a light-weight, waterproof pendant, clients connect from home to our emergency response centre, ensuring dependable assistance in the case of a fall, illness or risk to safety.Mepacs is Australian managed and part of a major hospital and health service. We are trusted by government to provide a quality assured service.With Mepacs, clients and their families have security, confidence and peace of mind, knowing support is always available.Our people know exactly what to do in an emergency, providing a rapid response, and the right response.', 1, 0, 0, 'tucL6ahsU0um9wuw.jpg', ' 1800 451 300 (03) 9788 1300', NULL, 'http://mepacs.com.au', ' mepacs@phcn.vic.gov.au ', NULL, NULL, NULL, '33 Jacksons Road MOUNT ELIZA, 3930, VIC  PO Box 192, MOUNT ELIZA, VIC, 3930', '-38.16917101248274', '145.08734700000002', 0, '2015-11-19 12:43:58', '2015-12-06 12:51:00'),
(1329, 453, 'Mental Illness Fellowship Victoria', 'mental-illness-fellowship-victoria', 'MI Fellowship offers a wide range of services and programs to people with mental illness, and the families, friends and carers of people with mental illness.Last year we worked with close to 5,000 people through our programs, and our Helpline responded to more than 3,300 calls.Community-basedOur services are community-based, meaning that they are social, not medical. Acute psychiatric services are crucial, but we know that quality support services in the community keep people well for longer, more connected with their family, friends and community, and with a better quality of life at less cost than psychiatric hospital beds.Home, work, relationshipsOur programs are designed to support people in the fundamental areas of their lives: home, work, relationships.We create pathways for people to connect with education and employment opportunities, to find and create homes for themselves, to build links within their communities, and to develop supportive relationships with families and friends.Focussed on recoveryOur programs are informed by the evidence on mental illness and recovery. Recovery from mental illness is best described as a process, defined and led by the person with a mental illness, through which they achieve independence, self-esteem and a meaningful life in the community.We work with people to assist them to find or develop the internal resources they need in their recovery (such as hope, resilience, coping skills, self-acceptance and physical health) and the external services and supports that will enable their recovery and independence (such as stable accommodation, education, employment support).LocationsOur services are located across Victoria, the Australian Capital Territory and Tasmania. Use the left-hand navigation menu to find out more about our services.', 1, 1, 0, 's49PveNy7FhURQqh.jpg', '03 8486 4200  (helpline) 03 8486 4222', NULL, 'http://www.mifellowship.org', 'enquiries@mifellowship.org ', NULL, NULL, NULL, 'Fairfield Place 276 Heidelberg Road Fairfield, Victoria 3078 PO Box 359, CLIFTON HILL, VIC, 3068', '-37.784277916095604', '144.99213639999994', 0, '2015-11-19 12:43:59', '2015-12-06 12:51:00'),
(1330, NULL, 'Melting Moments Cafe &#038; Catering', 'melting-moments-cafe-038-catering', 'With Melting Moments you receive genuine home style meals, cooked     to order especially for you, ready to be collected at your convenience   or delivered to your door.', 1, 0, 0, 'R3kHvRa464IPOx0M.jpg', '5241 6223', NULL, 'http://www.meltingmomentscafe.com.au', 'contact@meltingmomentscafe.com.au', NULL, NULL, NULL, 'Shop 1, 17-19 Stephen Street, BELMONT, VIC, 3216', '-38.181344', '144.32772', 0, '2015-11-19 12:43:59', '2015-12-06 12:51:00'),
(1331, NULL, 'The Melbourne Psychology Clinic &#038; Assessment Services', 'the-melbourne-psychology-clinic-038-assessment-services', 'Dr Jarred Pennington is a clinical psychologist and a member of the Australian Psychological Society (APS), the College of Clinical Psychologists (CCLIN) and the manager of The Melbourne Psychology Clinic. He has been helping people improve their lives for the past 10 years and has developed a wide range of clinical skills.&nbsp;Jarred also works within a network of GPs and registered psychologists all of whom are highly skilled in treating a range of psychological problems. If he cannot assist you for any reason, a referral will be made to a suitable psychologist.&nbsp;Referrals can also be made to GPs and psychiatrists from within the network.&nbsp;Although therapy can seem like a daunting process at first, it need not be. Therapy will allow you to make important changes and help you to live a happier and more fulfilled life.', 1, 0, 0, 'Mxmrbid93199CJRp.jpg', '0403 761 115', NULL, 'http://www.melbournepsychologyclinic.com', 'jarredpennington@hotmail.com', NULL, NULL, NULL, 'PO BOX 1 1 0 1, HAWKSBURN, VIC, 3142', '-37.843985', '145.00113699999997', 0, '2015-11-19 12:43:59', '2015-12-06 12:51:01'),
