(1340, NULL, 'Management Maintenance &#038; Development Pty Ltd- MMD Trust', 'management-maintenance-038-development-pty-ltd-mmd-trust', 'Managment Maintenance and Development (MMD) specialise in the maintenance of homes. Based in Geelong,MMD was formed in 1995 to act as Head Contractor to the Department of Human Services – Office of Housing.&nbsp;MMD were awarded the contract to complete housing maintenance on approximately 4,500 tenanted and vacant properties in the Geelong/Colac region and offer the same services to the private and commercial sectors.&nbsp;MMD employ 50 local people including multidiscipline experienced tradespeople and administration staff. In addition to its permanent workforce MMD coordinates approximately 40 sub-contractors. As their infrastructure has become more established and grown, we have been able to attend to addtional work within the private sector.&nbsp;MMD can be contacted 24 hours a day, 7 days a week, 365 days a year and their services are available as needed or ongoing and include:&nbsp;	Urgent – attended within 24 hours	Routine Maintenance – attended within 7 – 14 days (depending on the priority of the work)	After Hours Emergencies (electrical, pluming &amp; gas plumbing) - attended within the hour: phone 03-5222 6572.', 1, 0, 0, 'DuhnAkC73qaRtx0U.jpg', '5222 6022', NULL, 'http://www.mmdmaintenance.com.au', 'enquiries@mmdmaintenance.com.au', NULL, NULL, NULL, '7 Dowsett St, SOUTH GEELONG, VIC, 3220', '-38.167348', '144.36809900000003', 0, '2015-11-19 12:44:00', '2015-12-06 12:51:02'),
(1341, 455, 'Mambourin Enterprises', 'mambourin-enterprises', 'Mambourin is all about promoting independent living by offering employment, education and training services to adults with a disability. Mambourin’s slogan is “Empowering People”® which drives all that we do.', 1, 1, 0, 'bZYOorX09Jbt8VhJ.jpg', ' 9731 9200', NULL, 'http://www.mambourin.org', 'contact@mambourin.org', NULL, NULL, NULL, '11-19 Walls Road, WERRIBEE, VIC, 3030', '-37.8980497', '144.63794110000003', 0, '2015-11-19 12:44:01', '2015-12-06 12:51:03'),
(1342, NULL, 'Magic Mobility', 'magic-mobility', 'From the start we endeavoured to build the best wheelchairs possible. Even as we have grown, this remains one of our core values. Our success has led us to export our wheelchairs to all corners of the globe.&nbsp;We want our electric wheelchairs and manual wheelchairs to service our clients for as long as possible, with minimum repair or service.&nbsp;Further, we aim to make rugged wheelchairs that will exceed your expectations, give you added independence and expand your possibilities.&nbsp;We’re proud of our wheelchairs and we’re proud of our after sales service. We service our products that have been out of production for many years.&nbsp;‘One size fits all’ is not an approach we subscribe to. Our wheelchairs, seating options and associated wheelchair optionsare custom and unique, just like our customers.', 1, 0, 0, 'HmiQdSremopNQK6A.jpg', '8791 5600', NULL, 'http://www.magicmobility.com.au', NULL, NULL, NULL, NULL, 'Unit 2, 112 Browns Road, NOBLE PARK, VIC, 3174', '-37.947479', '145.18707100000006', 0, '2015-11-19 12:44:01', '2015-12-06 12:51:03'),
