(1347, 457, 'Lorne Community Hospital', 'lorne-community-hospital', 'The Lorne Community Hospital was officially opened in 2006 and has been completely re-developed on its original site. It provides a modern work environment which is well equipped with current technology and equipment. A broad range of services include: Aged Residential, Acute Hospital, Emergency, Community Health, Home Nursing, Medical, Rehabilitation and Palliative Care.&nbsp;Lorne Community Hospital (LCH) is located in the township of Lorne on the Great Ocean Road, within one hour travel from the major centres of Geelong and Colac and 2 hours from Melbourne. Lorne is an idyllic location on the Surf Coast which boasts spectacular coastal scenery, renowned surfing spots and beautiful white sandy beaches. Lorne also boasts a spirited arts community, boutique shopping strip filled with cafes, gift stores and eateries or discover the area’s stunning surrounds in the Great Otway National Park.', 1, 1, 0, 'nZKqdy6glkAKtcRe.jpg', '5289 4300', NULL, 'http://www.lornecommunityhospital.com.au', 'enquiries@lch.org.au', NULL, NULL, NULL, 'Lorne Community Hospital, Albert St, LORNE, VIC, 3232', '-38.5453019', '143.98059579999995', 0, '2015-11-19 12:44:01', '2015-12-06 12:51:04'),
