(1351, NULL, 'Listen And Learn Centre', 'listen-and-learn-centre', 'The LISTEN AND LEARN CENTRE® provides psychological, educational and speech pathology services to children from age three years, adolescents and adults.The Centre supports individuals with a wide range of needs, from those facing emotional, behavioural, speech, cognitive and learning difficulties or disorders, through to those who wish to enhance their performance or wellbeing.Listen And Learn specialises in the assessment of educational and developmental disorders; including disorders of learning, dyslexia, auditory processing, autism, speech and language, developmental delay, attention deficit, working memory, behaviours of concern, anxiety and depression.', 1, 0, 0, NULL, '9816 8811', NULL, 'http://www.listenandlearn.com.au', NULL, NULL, NULL, NULL, 'Level 1, 62-66 Whitehorse Rd, BALWYN, VIC, 3103', '-37.811222', '145.06511509999996', 0, '2015-11-19 12:44:02', '2015-12-06 12:51:04'),
(1352, NULL, 'Lift Me', 'lift-me', 'Welcome to Lift Me, a Stairlift company committed to making access to every level of your home or workplace easier.Lift Me supplies and installs Stairlifts and Low riseplatform lifts. That’s all we do, so we are experts in these lifts.', 1, 0, 0, '2oRtcg7eTYhME5PQ.jpg', '1300 543 863', NULL, 'http://www.liftme.com.au', 'info@liftme.com.au', NULL, NULL, NULL, 'PO Box 305, WARRANDYTE, VIC, 3113', '-37.738014', '145.218887', 0, '2015-11-19 12:44:02', '2015-12-06 12:51:04'),
(1353, 459, 'Lifestyle Solutions (Aust) Ltd &#8211; Victoria', 'lifestyle-solutions-aust-ltd-8211-victoria', 'Lifestyle Solutions is a national provider of disability supports, as well as services and supports for children and young people in Out of Home Care and Foster Care. ​&nbsp;Founded in Newcastle in 2001 with a group home to support five incredible individuals, our not-for-profit organisati​on has since touched the lives of so many more Australians, and grown to become a key innovator in the community services sector.&nbsp;We were established by a group of inspired people who were passionate about delivering a new way of support for people living with disability. This led Lifestyle Solutions to pioneer individualised and self-managed supports, with a focus on person-centred solutions, equality, social justice and meaningful outcomes for all. A long-time advocator of choice and voice™ for people living with disability, we have also been involved with the National Disability Insurance Scheme roll-out from its earliest stages.&nbsp;Today, we provide a diverse range of supports to more than 1,000 people living with disability throughout Australia, as well as 250 children and young people in Out of Home Care and Foster Care.', 1, 1, 0, 'xkz5VSm2Mt4XhZuu.jpg', '9338 1867', NULL, 'http://www.lifestylesolutions.org.au', 'info@lifestylesolutions.org.au', NULL, NULL, NULL, 'Suite 1, 7-9 Mallett Rd Tullamarine VIC 3043', '-37.7062608', '144.85025139999993', 0, '2015-11-19 12:44:02', '2015-12-06 12:51:05'),
(1354, 460, 'Lifestyle Centred Services Pty Ltd', 'lifestyle-centred-services-pty-ltd', 'Lifestyle Centred Services provides flexible, personalised, self-directed support services for people of all ages:  babies, teenagers and adults, who require assistance in their day-to-day lives.', 1, 1, 0, '5n5J9lQfYj1WgB3K.jpg', '9483 4755', NULL, 'http://www.lifestylecentred.com.au', 'karl@lifestylecentred.com.au', NULL, NULL, NULL, 'PO Box 2127, MORNINGTON, VIC, 3931', '-38.2199828', '145.03894609999998', 0, '2015-11-19 12:44:02', '2015-11-19 17:51:10'),
(1355, 461, 'Life Without Barriers Eltham', 'life-without-barriers-eltham', 'Life Without Barriers began in the early 1990''s and has grown from humble beginnings into one of the most significant not-for-profit organisations in Australia.  Our Purpose is to partner with people and change lives for the better and Our vision is a fair and inclusive community for everyone.&nbsp;We were established through the shared determination of local community members in Newcastle who wanted to improve the lives of people with a disability.  Motivated by their own experiences and in response to demand for local disability support services, they decided to act. Generating interest in the community, proposing to create a new non-government organisation for supporting people living with disability, a Board was formed and Life Without Barriers was established.', 1, 1, 0, '1e0p5tL9AoopI0Ti.jpg', '(02) 4033 4500', NULL, 'http://www.lwb.org.au', 'info@lwb.org.au', NULL, NULL, NULL, NULL, '-32.9281864', '151.76920510000002', 0, '2015-11-19 12:44:02', '2015-12-06 12:51:05'),
