(1367, NULL, 'Karli Deaf Health Centre', 'karli-deaf-health-centre', '&nbsp;	Do you feel tired all the time?	Do you feel your mind is not clear?	Do you feel stressed all the time with too many things on your mind?	Finally, do you want to get fitter and feel good most of the time?Yoga is an empowering way to feel more sattvic (balanced) in body, mind and spirit. Counselling is also another empowering way to find out who you are and what you want from life.Karli Dettman, Deaf Registered Yoga Teacher and Counsellor, provides unique wellness services in Auslan (Australian Sign Language).Karli has an Advanced Diploma in Yogic Teaching and is a member (Level 2) of Yoga Australia (formerly the Yoga Teachers Association of Australia). Karli also has degrees in psychology and mental health counselling.She finds that practising yoga regularly helps still her mind, reduces physical pain and enhances her spiritual health.&nbsp;', 1, 0, 0, NULL, NULL, NULL, 'http://karlideafhealth.com.au/index.html', 'karli@karlideafhealth.com.au', NULL, NULL, NULL, 'Suite 3,, 9B Salisbury Avenue, BLACKBURN, VIC, 3130', '-37.821058', '145.14203199999997', 0, '2015-11-19 12:44:05', '2015-12-06 12:51:06'),
