(1369, NULL, 'Jurmaine Health', 'jurmaine-health', 'Our Mission:- To offer a health service that is friendly, professional and supportive to the needs of the individual and their well-being– To encourage brain and body health that is accessible– To establish close ties with health and other support services and communities for the benefit of our clients– To encourage continuous learning for the community and professional development for fellow health professionals– To create a conducive and an upbeat environment for progress for our staff and clients alike– To integrate cutting edge technologies for the benefit of our staff and clients knowledge and progress.', 1, 0, 0, '71VeGC1d3SJYwOzX.jpg', '9478 1810', NULL, 'http://www.jurmainehealth.com.au', 'info@jurmainehealth.com.au', NULL, NULL, NULL, '538A Murray Road, PRESTON, VIC, 3072', '-37.7368424', '144.99197060000006', 0, '2015-11-19 12:44:05', '2015-12-06 12:51:06'),
