(1383, 463, 'Irabina Autism Services', 'irabina-autism-services', 'Irabina is a not-for-profit organisation that specialises in Early Intervention programs and services for toddlers and pre-school children with Autism Spectrum Disorder. Additionally, we now offer therapy for primary school-aged children and adolescents affected by autism. Irabina is a family-centred practice. There is no one who understands the needs of a child more than his/her family. While we recommend a mix of services, this will be based on conversations with the family and will take into consideration their unique knowledge of their child. Families are supported in identifying their strengths and needs, and all programs and services are delivered in a way that supports the family as a whole.&nbsp;The term ‘family’ includes immediate and extended family members and caregivers, whether or not they live with the child.&nbsp;While children who attend our programs receive the support they need to develop and grow, we also assist families by offering them education opportunities so that they can help facilitate their child’s learning.', 1, 1, 0, 'ZV4Y1n4VxQ1YEVAM.jpg', '9720 1118', NULL, 'http://www.irabina.com', 'autism@irabina.com', NULL, NULL, NULL, '193 Bayswater Road, BAYSWATER, VIC, 3136', '-37.819428', '145.269953', 0, '2015-11-19 12:44:05', '2015-12-06 12:51:07'),
(1384, 464, 'CH2 Aged and Community Care &#8211; Intouch', 'ch2-aged-and-community-care-8211-intouch', 'For over 75 years, CH2 has been dedicated to our fundamental purpose - Enabling Australian Healthcare.The name CH2 comes from our strong Australian heritage and the collaboration of two uniquely Australian companies – the Victorian Hospitals Association (later Hospital Supplier of Australia or HSA), and Clifford Hallam Pharmaceuticals.Clifford Hallam Pharmaceuticals was formed in 1978 by Chevel Coonan and Clifford Skinner.  Clifford’s brother owned the Hallam Chemist in York St Sydney.With a joint vision of providing excellence in the Australian healthcare supply industry, tapping into expert local knowledge, HSA and Clifford Hallam Healthcare merged in 2006 to become the CH2  we know today.', 1, 1, 0, 'b6DFqA9VsYo7Wk8e.jpg', '1300 134 260', NULL, 'http://www.ch2.net.au', 'healthcare@intouchdirect.com', NULL, NULL, NULL, '60 South Park Drive, DANDENONG SOUTH, VIC, 3175', '-38.016656', '145.20011499999998', 0, '2015-11-19 12:44:05', '2015-12-06 12:51:07'),
(1385, 465, 'Interchange Loddon-Mallee Region Inc', 'interchange-loddon-mallee-region-inc', 'Interchange Loddon-Mallee supports people with disabilities, their families and the community by facilitating with choice, respect and dignity their chosen support options to reach their full potential.Interchange Loddon-Mallee is a not for profit, non-government incorporated association with Tax Deductible status.Interchange LMR is a member of Interchange Victoria and National Disability Services', 1, 1, 0, 'yYk8qNxBZjbwZdj6.jpg', '5022 9341', NULL, 'http://www.interchangelm.org.au', NULL, NULL, NULL, NULL, NULL, '-36.7452975', '144.28507390000004', 0, '2015-11-19 12:44:05', '2015-12-06 12:51:08'),
