(1389, NULL, 'Inspired Orthotic Solutions', 'inspired-orthotic-solutions', 'Inspired Orthotic Solutions was established in Brighton in1988 and has since provided custom-made foot orthotics to patients from all over the world. The company is owned and directed by Jason Nichols, who completed his studies at La Trobe University, graduating with a Bachelor of Applied Science (Prosthetics and Orthotics).', 1, 0, 0, 'BbNq902VcuB7GmcM.jpg', '9592 7000', NULL, 'http://www.ios.com.au', 'jason@ios.com.au', NULL, NULL, NULL, '226 Esplanade, BRIGHTON, VIC, 3186', '-37.909889', '144.9863439', 0, '2015-11-19 12:44:06', '2015-12-06 12:51:09'),
