(1391, NULL, 'Independent Options for Mobility', 'independent-options-for-mobility', 'We are a Melbourne-based partnership providing orientation and mobility (O&amp;M) and travel training and education for independent travel.&nbsp;The development of orientation and mobility skills are essential for people who are blind or have low vision, and can also assist individuals with acquired brain injury or other cognitive impairments to maintain their independence.', 1, 0, 0, 'VqHH4NSCFhzKRQBt.jpg', '0426 215 547', NULL, 'http://options4mobility.com.au', NULL, NULL, NULL, NULL, '8/690 Lygon Street, CARLTON NORTH, VIC, 3054', '-37.790326', '144.969291', 0, '2015-11-19 12:44:07', '2015-12-06 12:51:10'),
(1392, NULL, 'Independence Australia', 'independence-australia', 'Who we are:     Independence Australia is a not for profit social enterprise organisation helping people with disabilities or physical need to regain, retain and extend their independence.What we do:     We help people with disabilities by providing a wide range services and products.&nbsp;', 1, 0, 0, 'JuwV9EAURxcMn8RN.jpg', '1300 704 456', NULL, 'http://www.independenceaustralia.com', 'theteam@independenceaustralia.com', NULL, NULL, NULL, '208 Wellington Street, COLLINGWOOD, VIC, 3066', '-37.80233', '144.98709899999994', 0, '2015-11-19 12:44:07', '2015-12-06 12:51:10'),
(1393, NULL, 'Huntingtons Victoria', 'huntingtons-victoria', 'Huntington''s Victoria (HV) is a not for profit organisation funded by the Victorian Government and public sources. We are the only specialist service in Victoria to support and assist people affected by Huntington''s Disease (HD).We aim to improve the quality of life of all people touched by HD in Victoria by connecting families to the vital support and services they need, while supporting people affected by HD to live meaningful and hopeful lives as valued members of the community.We provide access to expert staff that assist in the navigation of the disability service sector, provide relevant information and connect people with respite and support services. We also work with Australian and global healthcare professionals, disability service providers and academics to increase awareness and understanding of HD, as well as the impact it has on individuals, families and communities.', 1, 0, 0, 'CrSscD1zVVl8MKCC.jpg', '9818 6333', NULL, 'http://www.huntingtonsvic.org.au', 'info@huntingtonsvic.org.au', NULL, NULL, NULL, 'PO Box 2112, HAWTHORN, VIC, 3122', '-37.8222114', '145.03280169999994', 0, '2015-11-19 12:44:07', '2015-12-06 12:51:10'),
(1394, NULL, 'Humanware Australia Pty Ltd &#8211; Derrimut', 'humanware-australia-pty-ltd-8211-derrimut', 'Focused on enhancing the lives of people with visual and learning disabilities, HumanWare provides intuitive, intelligent solutions that enable their customers to participate effectively in today''s information intensive and highly mobile society.', 1, 0, 0, 'W5Mf9Nl8X8OiSsuw.jpg', '9686 2600', NULL, 'http://www.humanware.com', 'ca.info@humanware.com', NULL, NULL, NULL, '72 Windsor Boulevard, DERRIMUT, VIC, 3030', '-37.788238', '144.759887', 0, '2015-11-19 12:44:07', '2015-12-06 12:51:10'),
