(1396, 466, 'Homecare Plus', 'homecare-plus', 'Homecare Plus understand that it is difficult to access reliable services, that are available 24 hours a day and this is where we can assist you. Homecare Plus can provide Personal Care Attendants, In Home Respite, Domestic Cleaners and Home and Garden Maintenance staff.Our staff are available at the times that you request and in the event that a service cannot be provided at a specific time, our friendly co-ordinators will discuss this with you and endeavor to make a mutually suitable time.', 1, 1, 0, 'cb3nGBNX4uaRXzxi.jpg', '5332 4558', NULL, 'http://www.homecareplus.com.au', 'support@homecareplus.com.au', NULL, NULL, NULL, 'PO Box 89N, BALLARAT NORTH, VIC, 3350', '-37.5399525', '143.86455690000003', 0, '2015-11-19 12:44:07', '2015-12-06 12:51:11'),
(1397, NULL, 'Hollister', 'hollister', 'Hollister ANZ is based in Melbourne, Australia. We have a team of Territory Managers as well as a customer service team to support the needs of our customers throughout Australia and New Zealand.&nbsp;We specialise in products for ostomy care, continence care, wound care, mother baby care and identification.', 1, 0, 0, '9jceZFT8Zzfz3hWb.jpg', '1800 335 911', NULL, 'http://www.hollister.com', 'sales@hollister.com.au', NULL, NULL, NULL, 'PO Box 599, PORT MELBOURNE, VIC, 3207', '-37.836926', '144.94454999999994', 0, '2015-11-19 12:44:08', '2015-12-06 12:51:11'),
(1398, NULL, 'Highlands Support Services Inc', 'highlands-support-services-inc', '', 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '-37.564359', '143.85498600000005', 0, '2015-11-19 12:44:08', '2015-12-06 12:51:11'),
(1399, NULL, 'Hideaway Beds Pty Ltd', 'hideaway-beds-pty-ltd', 'Since 2006 Hideaway Beds has been the only Specialised Company in Australia for the Space Saver bed segment. We also repair out of warranty space saver beds bought from other companies that don’t support their own beds.Hideaway Beds helps our clients to learn more about the concept of space and the features of a Hideaway Wall Bed. Save 73% of space in any room you install a Hideaway Bed. Hideaway Beds is a Niche marketer of this concept and will continually innovate and add brands that are the best in quality, reliability and supply to fill the growing market needs.', 1, 0, 0, '3rBUPYSMEV6G2Mr4.jpg', '1300 880 857', NULL, 'http://www.hideawaybeds.com.au', 'sales@hideawaybeds.com.au', NULL, NULL, NULL, 'Unit 52, 22-30 Wallace Avenue, POINT COOK, VIC, 3030', '-37.8718045', '144.7467613', 0, '2015-11-19 12:44:08', '2015-12-06 12:51:11'),
(1400, 467, 'Hesse Rural Health Service', 'hesse-rural-health-service', 'Hesse Rural Health Service was formed in 1994 from the amalgamation of Beeac and District Hospital, Leigh Community Care Centre and the Winchelsea and District Hospital.  Since that time Hesse has developed into a key integrated rural health-care service within the three local government areas of Surf Coast, Colac Otway and Golden Plains. A broad range of services include: Aged Residential, Acute Hospital, Emergency, Community Health, Home Nursing, Medical, Rehabilitation and Palliative Care.', 1, 1, 0, 'lkT5A9Ciw6jG15y2.jpg', '5267 1200', NULL, 'http://www.hesseruralhealth.org.au', 'hesse@swarh.vic.gov.au', NULL, NULL, NULL, '8 Gosney Street, WINCHELSEA, VIC, 3241', '-38.24273301251574', '143.986406', 0, '2015-11-19 12:44:08', '2015-12-06 12:51:12'),
(1401, NULL, 'HEARLINK', 'hearlink', 'At HEARLINK we''re here to help you with every aspect of your hearing health, whether it''s loss prevention, testing, finding solutions that will help you hear better. We promise to always provide professional services with integrity, competence, objectivity and independence.', 1, 0, 0, 'KT0MyozlPu7WVJA3.jpg', '9326 2231', NULL, 'http://www.hearlink.com.au', 'hearlink@hear.com.au', NULL, NULL, NULL, 'unit 3, 19 Norwood Crescent, MOONEE PONDS, VIC, 3039', '-37.765589', '144.91860700000007', 0, '2015-11-19 12:44:09', '2015-12-06 12:51:13'),
(1402, 468, 'Health Care at Home Pty Ltd', 'health-care-at-home-pty-ltd', 'Health Care At Home was established in 1994 to assist people with health care products such as wound care, ulcer treatment, continence, food thickening agents and protein drinks.We offer a home delivery service from Werribee to Portsea.We have a wide range of the best products available at competitive pricing.We offer a range of samples of disposable continence products.', 1, 1, 0, 'jlKSQ6f7Xx1sPo4F.jpg', '9540 0199', NULL, 'http://www.healthcarehome.com.au', NULL, NULL, NULL, NULL, '1 Carinish Road, OAKLEIGH SOUTH, VIC, 3167', '-37.914489', '145.10777200000007', 0, '2015-11-19 12:44:09', '2015-12-06 12:51:13'),
(1403, NULL, 'Health and Mobility Pty Ltd', 'health-and-mobility-pty-ltd', 'At Health &amp; Mobility our aim is to “Keep You Moving”.Health &amp; Mobility is an Australian family owned business which has been operating for more than 10 years. Our friendly and experienced staff will be delighted to assist you to help meet your mobility needs.Until something happens, we all take being able to freely move around for granted. As you will soon discover there are a wide selection of mobility aids that can help to improve your daily living.', 1, 0, 0, 'Fd9c0joSrAholrZH.jpg', '8368 2266', NULL, 'http://www.healthandmobility.com.au', 'info@healthandmobility.com.au', NULL, NULL, NULL, 'Werribee Plaza Shopping Centre, Shop T191 Werribee Plaza S/C Cnr Heaths', '-37.8743358', '144.68106920000002', 0, '2015-11-19 12:44:09', '2015-12-06 12:51:14'),
(1404, 469, 'Haven', 'haven', 'We are Australia’s only fully integrated affordable rental housing and homelessness service provider. There is no organisation like us with the depth and breadth of experience and expertise able to help and house those people most in need in our community.We are accredited and registered and regarded as a key service provider.We own and manage more than 1600 properties across Victoria, from Melbourne’s northern suburbs to Mildura, including emergency accommodation through to transitional and long-term affordable rental housing and we deliver more than 20 funded specialist support programs.', 1, 1, 0, 'xaC0uTd8K5QfdC9x.jpg', '5444 9000', NULL, 'http://www.lmhs.com.au', 'info@hhs.org.au', NULL, NULL, NULL, NULL, '-36.7587109', '144.28374659999997', 0, '2015-11-19 12:44:10', '2015-12-06 12:51:14'),
(1405, NULL, 'Gwyneth Wendlock Speech Pathologist', 'gwyneth-wendlock-speech-pathologist', '', 1, 0, 0, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 'PO Box 689, WERRIBEE, VIC, 3030', '-37.9029061', '144.6584747', 0, '2015-11-19 12:44:10', '2015-12-06 12:51:14'),
(1406, 470, 'Guide Dogs Association Victoria', 'guide-dogs-association-victoria', 'Guide Dogs Victoria are ready for the National Disability Insurance Scheme (NDIS), delivered through Disability Care Australia (DCA).  This scheme gives clients the right to choose what services they receive and the agency they utilise for those services.  It is called a “self directed approach to funding”. Guide Dogs Victoria have always had a policy of providing services based on a client directed  partnership so we welcome new reforms from both levels of government.Unfortunately the scheme does not cover everyone and we will still rely on the generosity of the public through gifts in wills and donations to continue to provide the services for which we are so well regarded.Did you know that the NDIS does not apply to people who experience vision loss over the age of 65?  Guide Dogs Victoria are  collaborating with Vision 2020, the Australian Blindness Forum and its affiliates to ensure our  blind and vision impaired community get a better deal from government policies and programs.The NDIS will be launched in the Barwon region on the 1st of July 2013.  This includes the local government areas of greater Geelong, Queenscliff, Surf Coast Shire and Otway Shire.  In the first 3 years, 5000 people will be accepted on the scheme.  The scheme will cover Guide Dogs Victoria products and services, such as orientation and mobility training, provision of guide dogs and technical aids as well as other programs for people who are blind or have a vision impairment.If you are already a client, or require further information about the NDIS and entitlements on the scheme, please speak to your Guide Dogs Victoria instructor or see the links below for further information.', 1, 1, 0, 'xLH5vxPggDyGVSKh.jpg', '1800 804 805', NULL, 'http://www.guidedogsvictoria.com.au', NULL, NULL, NULL, NULL, 'Private Bag 13, KEW, VIC, 3101', '-37.8068202', '145.03100670000003', 0, '2015-11-19 12:44:10', '2015-12-06 12:51:14'),
(1407, NULL, 'Growth Psychology Practice.', 'growth-psychology-practice', 'Growth Psychology Practice was established in Geelong in 2008 to provide high quality psychological care from a team of psychologists that have expertise and practicing experience.What We Value	Trust	Experience	Professionalism	Commitment	IntegrityOur Approach Is	Respectful and caring	Non-judgemental, helping you grow through your experiences	Focussed on enhancing the skills of our clients’ and identifying their strengths	Directed toward meaningful change', 1, 0, 0, 'HLF8k1gYKWDmGSi7.jpg', '5242 8637', NULL, 'http://www.growthpsychologypractice.com.au', 'info@growthpsychologypractice.com.au', NULL, NULL, NULL, '127 Mckillop Street, GEELONG, VIC, 3220', '-38.155464', '144.36618899999996', 0, '2015-11-19 12:44:10', '2015-12-06 12:51:15'),
(1408, 471, 'Green Pie Plan Management', 'green-pie-plan-management', 'Our services are:	Advocacy and Information in City of Greater Geelong, Borough of Queenscliffe, Surf Coast Shire, Golden Plains Shire and Moorabool Shire (Bacchus Marsh).	Disability Support Fund (DSF) in Barwon South West region including Geelong, Bellarine, Peninsula, Queenscliff, Lara, Torquay, Anglesea, Colac Otway, Terang, Warrnambool, Hamilton and Portland.	Access Maps - Alcoa Access Map Geelong CBD. We can provide this service to other areas on request.	Disability Standards surveys – Barwon South West region and on request.	Alcoa Access Awards – Geelong and Surf Coast.	Access audits and consultancy (A 4 ALL).	Community projects - Barwon region and on request.', 1, 1, 0, 'p8MNGIbEe8httZZi.jpg', '03 5221 8852', NULL, 'http://www.greenpie.org.au', 'admin@greenpie.org.au', NULL, NULL, NULL, '48 Mckillop Street, GEELONG, VIC, 3220', '-38.153267', '144.35649', 0, '2015-11-19 12:44:10', '2015-12-06 12:51:15'),
(1409, NULL, 'GLBT Disability Support Services', 'glbt-disability-support-services', 'GLBTDSS run a number of highly effective social and individual support programs where the focus is not solely placed upon a person’s physical and/or mental health or age, but works toward the acceptance of an individual’s right to be involvedwithin a community.GLBTDSS assists individuals in creating more fulfilling lifestyles from within our services by providing Person Centred Approaches and Person Centred Planning that promotes wellbeing for people with disabilities and the aged, allowing individuals to feel empowered, being who they wish to be on a daily basis.In adherence to our social enterprise philosophy, GLBTDSS is a community basedproject run by members of the community for members of the community, in turn allowing individuals to be part of the decision making process in regards to supports, services and community groups they would like to be a part of.', 1, 0, 0, NULL, '9391 6797', NULL, 'http://www.glbtdss.com.au', 'intouch@glbtdss.com.au', NULL, NULL, NULL, '79 Schutt St Newport VIC 3015', '-37.836257', '144.88106900000002', 0, '2015-11-19 12:44:11', '2015-12-06 12:51:16'),
(1410, 472, 'Barwon Child,  Youth &#038; Family', 'barwon-child-youth-038-family', 'Barwon Child, Youth & Family is an independent, not-for-profit community service organisation, governed by a Board of Directors and managed by a skilled and experienced executive team. The entity was launched on the 1 July 2015 as a result of the merger of Glastonbury Community Services, Barwon Youth and Time for Youth.Barwon Child, Youth & Family currently employs nearly 300 staff and operates in the Barwon Area of the West Division of Victoria, responding to the needs of vulnerable communities and towns in six municipalities:    City of Greater Geelong    Surf Coast Shire    Golden Plains Shire    Colac Otway Shire    Borough of Queenscliffe    Corangamite Shire.Barwon Child, Youth & Family also delivers services in co-located and community-based environments across the catchment areas and via home outreach.Barwon Child, Youth & Family is a recognised provider of quality service delivery to vulnerable and less advantaged youth and families with high and complex needs. Particular emphasis is placed on prevention and early intervention programs, complemented by a range of justice and counselling and support services.Five service platforms address these needs:    Early Years Program (including Kindergarten Cluster Management)    Family and Community services    Out-of-Home Care & Placement Prevention    Youth Services    Special Intervention Services.', 1, 1, 0, '5T9hHrRccA7IfE9P.jpg', '03 5221 4466', NULL, 'http://www.bcyf.org.au', 'info@bcyf.org.au', NULL, NULL, NULL, '222 Malop Street, GEELONG, VIC, 3220', '-38.149261', '144.36679400000003', 0, '2015-11-19 12:44:11', '2015-12-06 12:51:16'),
