(1412, NULL, 'Gforce Employment Solutions', 'gforce-employment-solutions', 'Gforce can help you find not just a job, but a career! Whether it be an apprenticeship, traineeship, full-time, part-time or temporary employment, we have the solution for you.Looking for an apprenticeship or traineeship?Gforce are a leading employer of apprentices and trainees, currently employing and managing over 450 apprentices and trainees.Find out what’s involved, search for the latest vacancies and register your interest with Gforce.Looking for full-time or part-time employment?Gforce Staffing Solutions have been helping people find jobs for over 30 years. We can offer you help to find a job or help you gain the skills and confidence needed to change your life and get the right job. If you are deemed eligible by Centrelink, we can help with the costs of training, licences and employment-related costs. We can also help individuals who have been made redundant.', 1, 0, 0, 'xh0BkPq8Ya7UEReU.jpg', '5229 9144', NULL, 'http://www.gforce.org.au', 'info@gforce.org.au', NULL, NULL, NULL, 'PO Box 1987, GEELONG, VIC, 3220', '-38.1485437', '144.36134790000006', 0, '2015-11-19 12:44:11', '2015-12-06 12:51:16'),
