(1416, NULL, 'Geelong Psychology Services', 'geelong-psychology-services', 'We provide clinical, trauma and forensic psychological services including assessment, diagnosis and treatment using evidence based therapies in a range of psychological issues including:&nbsp;	Anxiety	Depression	Stress	Trauma of work injury, motor vehicle injury and victims of crime	Life, work and family crises including lifestyle issues, work performance, change, crises, catastrophe, communication, confidence building and assertiveness, conflict resolution, conciliation and mediation.	Bullying, intimidation, victimization and sexual harassment etc', 1, 0, 0, NULL, '5223 2532', NULL, 'http://www.geelongpsychologist.com.au', NULL, NULL, NULL, NULL, 'PO Box 1157, GEELONG, VIC, 3220', '-38.1485437', '144.36134790000006', 0, '2015-11-19 12:44:12', '2015-12-06 12:51:17'),
