(1421, NULL, 'Geelong Hand Therapy', 'geelong-hand-therapy', 'Therapists at Geelong Hand Therapy provide comprehesive rehabilitation of hand, wrist, elbow and shoulder conditions and injuries, resulting from work place accidents, cumulative trauma / repetitive strain, sports related injuries, congenital conditions, motor vehicle accidents, following surgical procedures, and also conditions associated with the aging process.&nbsp;Treatment is provided by occupational therapists and physiotherapists who have had extra training in the area of hand and upper limb rehabilitation  and who have a strong commitment to ongoing education and training.&nbsp;Therapists at Geelong Hand Therapy work closely with referring surgeons to ensure every patient achieves the best outcome possible, following surgery.', 1, 0, 0, 'TpxE5MtqWSJ5gkRT.jpg', '5221 7171', NULL, 'http://www.geelonghandtherapy.com.au', 'info@geelonghandtherapy.com.au', NULL, NULL, NULL, '3 Sydney Avenue, GEELONG, VIC, 3220', '-38.15305', '144.36719900000003', 0, '2015-11-19 12:44:13', '2015-12-06 12:51:18'),
