(1424, NULL, 'Functional Access Solutions Pty Ltd', 'functional-access-solutions-pty-ltd', 'Functional Access Solutions Pty Ltd was established as an alternative in the market place to just compliance based Access Consultancy. With an extensive range of services and long held commitment to improving every user’s experiences within the built environment, Functional Access Solutions Pty Ltd aim to progress access consulting into an era where function and evidence provide the pillars for sound practice.', 1, 0, 0, '3RZ3VvPJvYWvYRUw.jpg', '0403 173 063', NULL, 'http://www.functionalaccess.com.au', 'info@functionalaccess.com.au', NULL, NULL, NULL, 'Suite 4 / 981 North Road Murrumbeena VIC 3163', '-37.90709701236563', '145.06809199999998', 0, '2015-11-19 12:44:13', '2015-12-06 12:51:18'),
