(1426, NULL, 'Full Circle Health and Exercise', 'full-circle-health-and-exercise', 'Full Circle prides itself focusing on your health &amp; fitness goals, your wellbeing and safety. We provide you with professional service and advice from our extensive range of fully qualified and accredited exercise professionals.&nbsp;We set our attention on total wellness from the inside out, improving and adding value to your physical, mental and emotional wellbeing.&nbsp;We recognise that not everybody is the same body and therefore we work with a holistic approach to your health enabling you to develop a greater awareness and deeper connection to yourself and to life.', 1, 0, 0, 'Tg9OcfV2T83jqd4a.jpg', '5224 1442', NULL, 'http://www.fche.com.au', 'info@fche.com.au', NULL, NULL, NULL, '10 Balleroy Rd, HIGHTON, VIC, 3216', '-38.1566537', '144.30512720000002', 0, '2015-11-19 12:44:13', '2015-12-06 12:51:19'),
