(1430, 475, 'Flexi Support', 'flexi-support', 'At Flexi Support we know from experience that needs for care vary, which is why we offer flexible services to suit our clients’ individual requirements.&nbsp;All our services are available 24 hours a day, 7 days a week, with short term and long term shift options available to cater for different situational needs. We welcome all types of shift variations including emergency, one-off fill-in shifts and 24 hour services.&nbsp;For Work Cover and TAC clients, we provide a package service with personal injury lawyers, Henry Carus &amp; Associates, where they get your claim approved and we provide the personal care service.”', 1, 1, 0, 'I9XKXBmMcVgib24m.jpg', '9560 3333', NULL, 'http://www.flexi-support.com.au', 'info@flexi-support.com.au', NULL, NULL, NULL, '5a Hartnett Close Mulgrave. VIC', '-37.9245350123734', '145.14903400000003', 0, '2015-11-19 12:44:13', '2015-12-06 12:51:19'),
