(1432, 476, 'Fisher Lane Mobility', 'fisher-lane-mobility', 'Since 1980 Fisher Lane Pty. Ltd. (Trading as: Fisher Lane Mobility) has offered a professional, reliable and caring service to the mobility and rehabilitation industry by supplying a wide range of products and equipment, either for sale, hire or through the Department of Veterans Affairs (D.V.A.).', 1, 1, 0, 'GyhWGefZlnIRlwgE.jpg', '1800702026', NULL, 'http://www.fisherlane.com.au', 'enquiries@fisherlane.com.au', NULL, NULL, NULL, '26 Victoria Crescent, ABBOTSFORD, VIC, 3067', '-37.8062187', '144.9979983', 0, '2015-11-19 12:44:14', '2015-12-06 12:51:19'),
(1433, NULL, 'First Choice Garden Care', 'first-choice-garden-care', 'First Choice Garden Care offer a complete residential and commercial garden care service. We are passionate about all things gardening &amp; landscaping, and Garden Maintenance. We offer this Garden Maintenance &amp; Lawn Mowing Geelong service as we understand that:	Sometimes you just don’t have the TIME to keep your garden/lawn maintained to the standard you wish for.	You may not physically be able to manage anymore	The garden has got so out of control that you need some professional help	You actually want to spend your weekends doing other things, like socialising or playing with the kids	Or… let’s face it, you just can’t be bothered… that’s ok too!Whatever the reason is, First Choice Garden Care was set up to assist you with your Garden &amp; lawn mowing Geelong requirements. When you are looking at our Lawn Mowing Geelong Services if you have a requirement that is not listed, please feel free to ring us and we can tailor something to suit your needs.We service the Geelong, Bellerine Peninsula, Surf Coast and Surrounding Suburbs including:East Geelong, Geelong West, Geelong, Bell Park, Corio, Drumcondra, Belmont, Grovedale, Hamlyn Heights, Highton, Bell Post Hill, Lara, Lovely Banks, Manifold Heights, Leopold, Herne Hill, Newtown, Norlane, North Geelong, Rippleside, South Geelong, and Armstrong Creek, Torquay, Jan Juc, Anglesea, Queenscliff, Drysdale, Ocean Grove, Clifton Springs, St Leonards, Indented Head, Barwon Heads, Portarlington, Moriac, Newcombe, St Albans and more!!', 1, 0, 0, NULL, '0412336093', NULL, 'http://www.firstchoicegardencare.com.au', NULL, NULL, NULL, NULL, '26 Adriatic Court, NORLANE WEST, VIC, 3214', '-38.087572', '144.34261500000002', 0, '2015-11-19 12:44:14', '2015-12-06 12:51:20'),
