(1437, 478, 'Everyday Independence Pty Ltd', 'everyday-independence-pty-ltd', 'Live an everyday life, every day.Since 1997 Everyday Independence has been providing people of all ages and level of need with flexible access to the professional services they need to achieve their goals and maximise independence in their daily life.We offer specialist Occupational Therapy, Physiotherapy, Speech Pathology and Case Management, providing our clients with the personalised solutions which support participation in everyday activities.Everyday Independence’s flexible approach to therapy and rehabilitation ensures that our clients can access the support they need in the environment where they need it most, including their home, school, work or community.  We also offer in-house services in our specially designed and equipped treatment centres.Our multi-disciplinary therapists strive to work with clients, their family, friends and carers to establish what is important to them, developing individualised therapy programs to achieve outcomes that have value, meaning, and enable them to live an everyday life, every day.', 1, 1, 0, '39eych3zKAOaCPPN.jpg', ' 1300 179 131   03 9348 0192', NULL, 'http://www.everydayind.com.au', 'mail@everydayind.com.au ', NULL, NULL, NULL, ' PO Box 274, CARLTON Sth, VIC, 3053 19-21 Argyle Place, South Carlton', '-37.803688012319654', '144.96560999999997', 0, '2015-11-19 12:44:14', '2015-12-06 12:51:20'),
(1438, 479, 'Ermha Incorporated', 'ermha-incorporated', 'Ermha is a community based organisation that supports recovery and instils hope for people who are experiencing the effects of a mental illness. Ermha clients may also request support to address a disability, substance use or housing instability. We recognise that each client has their own strengths, needs, desires and aspirations, and our support is designed accordingly.&nbsp;One of the first things people become aware of is that at Ermha we keep mental illness in perspective. It is just one part of our clients’ lives, even though at times it may be experienced as overwhelming.&nbsp;At the heart of everything Ermha does is a deep respect for the people who use our services. It takes hope, courage and commitment to seek a brighter future.', 1, 1, 0, 'x1V9KYoiCcG5zJ2a.jpg', '1300 376 421', NULL, 'http://www.ermha.org', 'reception@ermha.org', NULL, NULL, NULL, '67 Robinson Street, DANDENONG, VIC, 3175', '-37.983652', '145.21124599999996', 0, '2015-11-19 12:44:14', '2015-12-06 12:51:21'),
(1439, 480, 'Equal Access Pty Ltd T/- Equal Access Pty Ltd &#038; Evacuation Chairs', 'equal-access-pty-ltd-t-equal-access-pty-ltd-038-evacuation-chairs', 'Equal Access Pty Ltd is one of Australia’s leading Universal Design and Accredited  Disability Access Consultants. Our key personnel are accredited with the Association of Consultants in Access Australia Inc (ACAA) and provide a specialist consulting service throughout Australia and internationally to enhance the built environment and to provide “Equal Access” for members of the community with a disability.', 1, 1, 0, 'oFRrALkqy4z8c4Rk.jpg', '9001 5805', NULL, 'http://www.disabilityaccessconsultants.com.au', 'office@equalaccess.com.au', NULL, NULL, NULL, 'Suite 15, 17-19 Miles St, MULGRAVE, VIC, 3170', '-37.921999', '145.15284199999996', 0, '2015-11-19 12:44:14', '2015-12-06 12:51:21'),
(1440, 330, 'Epilepsy Foundation of Victoria Inc SURREY HILLS', 'epilepsy-foundation-of-victoria-inc-surrey-hills', 'We aim to provide relevant, supportive and practical services that make a difference to the lives of people living with epilepsy, in a timely way along each individual’s journey with epilepsy.&nbsp;People may seek our services for a wide variety of reasons and their needs will vary depending on many factors: age and stage of life, individual needs (for example, needs regarding schooling, employment, driving or pregnancy), the unique problems or issues a person may be facing arising from the type of epilepsy they have (for example, if they are considering undergoing surgery), and their personal goals and aspirations for the future.', 1, 1, 0, 'B0An6itPG8ZMF1e0.jpg', '8809 0600', NULL, 'http://www.epinet.org.au', 'epilepsy@epilepsyfoundation.org.au', NULL, NULL, NULL, 'Suite 3, 587 Canterbury Road, SURREY HILLS, VIC, 3127', '-37.825466', '145.09497499999998', 0, '2015-11-19 12:44:15', '2015-12-06 12:51:22'),
(1441, 481, 'Endeavour Life Care Pty Ltd', 'endeavour-life-care-pty-ltd', 'For over 25 years Endeavour Life Care has upheld a mantra of care and compassion for our clients as a leading provider of home health care equipment. Working closely with hospitals, rehabilitation centres and their physio and occupational therapists we have honed our range of products and services to best cater to those in need. As one of the few remaining manufacturers in Australia of such products, we are in a unique position to adapt and customise many our products to suit the diverse range of needs that our customers are faced with.&nbsp;Endeavour Life Care listens and responds to the needs of our customers. Our Home Modifications department, with over 25 years of experience in this specific field is fully equipped to install customised fit-outs to client’s homes to assist with mobility and independence in the home.', 1, 1, 0, 'PqAvsx4bX6rzUP3F.jpg', '9703 2900', NULL, 'http://www.endeavourlifecare.com.au', 'info@endlc.com.au', NULL, NULL, NULL, '2/37-41 Hallam South Road, HALLAM, VIC, 3803', '-38.011557', '145.27060499999993', 0, '2015-11-19 12:44:15', '2015-12-06 12:51:22'),
(1442, NULL, 'Enabled Quality Living', 'enabled-quality-living', 'Enabled Quality Living (EQL) is a Melbourne-based consultancy committed to assisting people who require enabled housing constructed to their requirements. This may be an entirely new home or modification of an existing residence.&nbsp;EQL is dedicated to providing cost effective housing solutions that are personalised for every client’s needs and aspirations.&nbsp;To achieve this we combine our in-house resources in enabled housing design and project management with the construction skills, reliability and competitive pricing of our preferred building partner.&nbsp;With numerous ready-made designs from which to choose, EQL offers housing solutions which are both affordable and able to be customised to individual requirements.', 1, 0, 0, '63fFaIc6nPpnxPwD.jpg', '96933490', NULL, 'http://www.enabledql.com.au', 'admin@enabledql.com.au', NULL, NULL, NULL, '81 City Rd., SOUTHBANK, VIC, 3006', '-37.8223173', '144.96530819999998', 0, '2015-11-19 12:44:15', '2015-12-06 12:51:22'),
