(1444, NULL, 'Echo Interpreting', 'echo-interpreting', 'Echo interpreting was established in February 2006 by Danielle and Jeff Don with the aim of providing a more personalised interpreter booking agency to service the needs of the Deaf and wider community.&nbsp;Danielle is accredited at the professional interpreter level through NAATI (National Accreditation Authority for Translators and Interpreters) and has been working as an interpreter since 2000. Danielle worked as the in house interpreter at Deaf Children Australia from 2001 - 2006 as well as freelance interpreting in a variety of situations. Danielle resigned from her full time position in July 2006 to continue freelance interpreting and to pursue her passion of running her own interpreter booking agency.', 1, 0, 0, 'YWO9TPj1vszTTl52.jpg', '9761 2208', NULL, 'http://www.echointerpreting.com.au', 'notes@echointerpreting.com.au', NULL, NULL, NULL, 'PO Box 403, BORONIA, VIC, 3155', '-37.8625504', '145.28688850000003', 0, '2015-11-19 12:44:15', '2015-12-06 12:51:23'),
(1445, 482, 'EACH', 'each', 'EACH Social and Community Health provides an integrated range of health, disability, counselling and community mental health services across Australia.Our vision is for a healthy and inclusive community.', 1, 1, 0, 'sFxOd8VG4whcHt91.jpg', '1300 00 3224', NULL, 'http://www.each.com.au', 'info@each.com.au', NULL, NULL, NULL, '46 Warrandyte Road, RINGWOOD, VIC, 3134', '-37.809065', '145.23174700000004', 0, '2015-11-19 12:44:16', '2015-12-06 12:51:23'),
(1446, 483, 'e.motion21', 'emotion21', 'e.motion21 is a non-profit organisation that provides an Australian-first, innovative dance and fitness programs for children and young adults with Down syndrome.&nbsp;Through performance-based activities and community engagement, e.motion21 aims to enhance lives for people with Down syndrome and change perceptions of Down syndrome within society.', 1, 1, 0, 'TK1FhJrGPoYPfR7P.jpg', '9854 7100', NULL, 'http://www.emotion21.org.au', 'info@emotion21.org.au', NULL, NULL, NULL, 'Kew Court House, 188 High Street, KEW, VIC, 3101', '-37.80671', '145.03175899999997', 0, '2015-11-19 12:44:16', '2015-12-06 12:51:23'),
