(1448, NULL, 'Dynamic Motion Health Group Pty Ltd', 'dynamic-motion-health-group-pty-ltd', 'Here at Dynamic Motion Health Group we are committed to providing quality healthcare services.We work with you to set your rehabilitation goals and strive to achieve them.&nbsp;We pride ourselves on patient focus. When you book an appointment you will receive quality time with your therapist.&nbsp;Our initial consultation time is 45 minutes, with 30 minute follow up appointments. This allows the therapist adequate time to establish a thorough diagnosis, and prepare and initiate an evidence based treatment plan.&nbsp;We have an on site rehabilitation gym that allows us to demonstrate your exercise programs- and for you to practice correct technique.&nbsp;We provide services to private, workcover, TAC, DVA and EPC patients. No referral is needed for private patients. Discounts apply to those with Healthcare/Pension cards and for University Students.', 1, 0, 0, 'tNoGxHQy9FO38vJj.jpg', '5243 6777', NULL, 'http://www.dynamicmotionphysio.com.au', NULL, NULL, NULL, NULL, 'Medical One, 160 Colac Rd, WAURN PONDS, VIC, 3216', '-38.198918', '144.31408299999998', 0, '2015-11-19 12:44:16', '2015-12-06 12:51:24'),
