(1454, 484, 'Down Syndrome Victoria', 'down-syndrome-victoria', 'Down Syndrome Victoria is a membership organisation. We provide parents, families, professionals and friends of people with Down syndrome with support, encouragement, information and resources.New parents are invited to contact us.  We offer:	Personal support for parents, especially when a new baby is born, through a Family Support Coordinator	A state wide network of Family Support groups including a Peer Support group (Club21) for Adults with Down syndrome	Information for parents, professionals, students, and other interested people	A regular journal, ''Voice'', information packs, booklets etc	Training provision and Information workshops covering a wide range of topics	Speakers to groups wanting to know more about Down syndrome	Encouragement of, and keeping up-to-date with, current research, both medical and educational	Down Syndrome Inclusion Support Service (formerly the Education Support Service) and information for teachers in mainstream schools who have a child with Down syndrome enrolled	Representation of the needs of people with Down syndrome to Government and community areas	A staffed office offering personal assistance and information	An Adult Support Coordinator working to empower adults with Down syndrome	Library facilities for members including books, DVD''s, kits and journals	Systemic advocacy; working towards the full participation of people with Down syndrome in the economic and social life of the community.	Access to world-wide information through international journals and the Internet	Website www.downsyndromevictoria.org.au	Interpreter service available on request', 1, 1, 0, '1UUYr30hcK84Njbz.jpg', '1300 658 873', NULL, 'http://www.downsyndromevictoria.org.au', 'info@dsav.asn.au', NULL, NULL, NULL, '18/71 Victoria Crescent, Abbotsford. Victoria 3067', '-37.8017221', '144.98015469999996', 0, '2015-11-19 12:44:17', '2015-12-06 12:51:24'),
(1455, 485, 'DoAbility', 'doability', 'DoAbility is a leading provider of healthcare equipment specialising in aged care and paediatric products. We are a renowned Australian owned business offering a range of quality services and products to meet your client’s home and health care needs.&nbsp;DoAbility is committed to providing high quality, innovative products to assist in your clients’ needs.&nbsp;DoAbility has over 5000 products including aids for mobility, bathroom, bedroom, seating, pressure care, daily living, laundry, cleaning, bariatric and manual handling and many, many  more.&nbsp;Our catalogue and website outline all the products we offer - but if you can''t find what you are after, just call and we will be happy to help you find what you need.', 1, 1, 0, '1Yu68zUgcqnwUR9o.jpg', '1300 122 355', NULL, 'http://www.doability.com.au', 'info@doability.com.au', NULL, NULL, NULL, '53 Stubbs Street, KENSINGTON, VIC, 3031', '-37.7916573', '144.93611940000005', 0, '2015-11-19 12:44:17', '2015-12-06 12:51:25'),
(1456, NULL, 'Diversitat', 'diversitat', 'Diversitat (trading name), also known as Geelong Ethnic Communities Council, is a registered charity whose history reaches back more than thirty years. It is a not-for-profit community service group with a core set of services and business operations that support the multicultural communities and the disadvantaged in the region.  Diversitat commenced operation in Geelong in 1976 and was known as the Geelong Migrant Resource Centre, which later changed its name to Geelong Ethnic Communities Council and now trades as Diversitat.The change in name to Diversitat in 2005 reflected the broader diversity of services across a wider geographic area. Today Diversitat offers services in Immigration &amp; Welfare, Youth Services, Aged Support, Training, Employment and Arts &amp; Events. It also manages 94.7 The Pulse community radio station and Wholefoods Café/Shop &amp; Catering.&nbsp;Diversitat represents over 70,000 people of all ethnic and cultural heritages throughout the Geelong region and has 45 affiliated communities. From a single office of five staff in 1976, Diversitat has grown to operate over 10 sites in Geelong and one in Colac.  Since its inception, the core mission of the GECC hasbeen to ensure that ethnic groups, organisations and individuals are given the opportunity to develop their potential and fulfil their aspirations as equal members of the community. Today Diversitat operatesas a registered charity delivering a wide range of programs and services throughout Geelong, the Barwon Region, Victoria and Nationally.', 1, 0, 0, 'fgnW1XqzPoTmQXQ9.jpg', NULL, NULL, 'http://www.diversitat.org.au', NULL, NULL, NULL, NULL, '153 Pakington Street, GEELONG WEST, VIC, 3218', '-38.141088', '144.34788500000002', 0, '2015-11-19 12:44:17', '2015-12-06 12:51:25'),
(1457, NULL, 'Diverge Consulting', 'diverge-consulting', 'Diverge is a not-for-profit organisation established in 2009. All staff are experienced senior neuropsychologists and behavioural psychologists with specialist skills working with problematic behaviours associated with acquired brain injury (ABI) and co-occurring conditions such as drug and alcohol misuse and mental health issues, and situations often labelled "complex".&nbsp;We work with children and adults, family members, therapists, and other people in the person’s support network to establish consistent, collaborative approaches to challenging situations.&nbsp;We offer comprehensive range of psychological services including assessment, intervention, counselling, training and research.&nbsp;We work primarily in Victoria (Metropolitan and Rural regions), but also work in other states where specialist psychology services are required.', 1, 0, 0, 'jFkW2DkuGBtwW73w.jpg', '9329 4330', NULL, 'http://www.diverge.org.au', NULL, NULL, NULL, NULL, '60 Lothian St, NORTH MELBOURNE, VIC, 3051', '-37.80169501231876', '144.94496900000001', 0, '2015-11-19 12:44:17', '2015-12-06 12:51:25'),
(1458, NULL, 'Diane Fox Occupational Therapist', 'diane-fox-occupational-therapist', '', 1, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'PO Box 140 Brunswick West VIC 3055', '-37.761', '144.94191219999993', 0, '2015-11-19 12:44:18', '2015-12-06 12:51:25'),
(1459, 486, 'Dial-An-Angel (Melbourne)', 'dial-an-angel-melbourne', 'DIAL-AN-ANGEL® is Australia’s only national group specialising in Home, Aged, Child and Family care.The Agency has been assisting Australian families, businesses and overseas visitors since 1967.&nbsp;Live-in as well as Visiting Angels® are able to provide all home-based services:domestic housekeeping, child care, care by nannies, in-home nursing, aged care, garden and home maintenance and assistance with home and corporate functions. Medico-legal reports may be requested and a wide range of services are available through our corporate services department, including Employee Assistance Programs.&nbsp;Looking for a gift idea? How about a gift voucher from us, give them some me-time, while we do the garden, cleaning or take care of the little ones!&nbsp;We have offices around Australia offering cleaning, childcare, aged care and nursing in Sydney, Central Coast,Newcastle, Canberra, Melbourne, Brisbane, Adelaide and Perth.', 1, 1, 0, 'Tu53P9LssSLZVLww.jpg', '1300 721 111', NULL, 'http://www.dialanangel.com', NULL, NULL, NULL, NULL, 'PO Box 52, ST.KILDA, VIC, 3182', '-37.8675123', '144.97898069999997', 0, '2015-11-19 12:44:18', '2015-12-06 12:51:25'),
(1460, NULL, 'DGL Services', 'dgl-services', 'DGL services is a small family owned company that began in 1993 with a diverse background in science and technology mixed with practical minded application, especially in the thoughtfulness and awareness of the surroundings that encompass your properties.', 1, 0, 0, NULL, '0451 682 782', NULL, 'http://www.dglservices.net', 'dglservices@ymail.com', NULL, NULL, NULL, '26 Gwyther Road, HIGHTON, VIC, 3216', '-38.182423', '144.31304999999998', 0, '2015-11-19 12:44:18', '2015-12-06 12:51:26'),
(1461, NULL, 'DE Atelier Architects Pty Ltd', 'de-atelier-architects-pty-ltd', 'DE atelier Architects are a multi-skilled practice influencing Melbourne and regional Victoria. Founded in 2003 by Briony Darcy and Leon Eyck they are dedicated to providing innovative, pragmatic and sustainable design solutions to urban and local environs. They produce outcomes that respond to the client''s desires, resources and expectations. Delivering design responses that considers the building habitation, the environmental footprint and the influence on the neighbourhood character.  DE atelier Architects are a premier, awarding winning, practice within Victoria.', 1, 0, 0, 'IJzOjPJizmdszH6t.jpg', '5255 3378', NULL, 'http://www.deatelier.com.au', ' info@deatelier.com.au', NULL, NULL, NULL, 'PO Box 817, OCEAN GROVE, VIC, 3226', '-38.2627873', '144.52728509999997', 0, '2015-11-19 12:44:18', '2015-12-06 12:51:26');
