(1462, NULL, 'dal Gourmet Cafe &#038; Catering', 'dal-gourmet-cafe-038-catering', 'Corio Bay Innovators Inc. is a not-for-profit organisation, trading as dal Gourmet Café and Catering, is an innovative supported employment and training organisation, operating a gourmet catering service and two retail cafes in Geelong. It is a professional, competitive, and successful organisation. Participants receive individual advice and support on options within and outside the service, including further education, open employment opportunities, independent travel, budgeting, accommodation and leisure options. Participants are also actively involved in the planning, management and operations of the business/service.', 1, 0, 0, 'X4vQDqJeZNuoWB0d.jpg', '5223 1288', NULL, 'http://www.dal.org.au', NULL, NULL, NULL, NULL, '4 Little Ryrie Street, Geelong VIC 3220', '-38.149117012473724', '144.354467', 0, '2015-11-19 12:44:18', '2015-12-06 12:51:26'),
