(1467, 487, 'CPEC', 'cpec', 'CPEC supports children (0-18 years) with Cerebral Palsy and similar conditions. We are a unique and specialised service based in Glen Waverley, Melbourne.&nbsp;We provide physiotherapy, occupational therapy and speech pathology (individually or in multidisciplinary groups), and we enable families to access essential equipment they need in their daily lives.&nbsp;We offer:	Early Intervention education services (children 12 months to 6 years of age)	Extended Education services for children in mainstream schools (children 6 to 18 years of age)	We support children at CPEC, at their homes, and at their schools and kindergartens. Our services are designed to be integrated into all their everyday life activities.', 1, 1, 0, 'PIATI5MBbJ3pKBmy.jpg', '(03) 9560 0700', NULL, 'http://www.cpec.com.au', 'info@cpec.org.au', NULL, NULL, NULL, 'PO Box 211, GLEN WAVERLEY, VIC, 3150', '-37.8785429', '145.16481199999998', 0, '2015-11-19 12:44:19', '2015-12-06 12:51:28'),
