(1473, NULL, 'Complete Feet', 'complete-feet', 'Complete Feet is unique unlike other Podiatry and Orthotics clinics. Our locations save you money and time by providing the full range of foot services such as:	Our own in-house Orthotics laboratory providing you the most accurate and price competitive custom Orthotics in Australia.	Unique One stop Footcare location with all foot &amp; ankle treatments at one location saving you time &amp; money.	Complete Feet''s difference is we have a unique system of Orthotic fabrication within our own Orthotic laboratory to give our patients the most comfortable, accurate and pain reducing Orthotics available. PLUS, our Orthotic treatments are backed up by our famous Comfort &amp; Care – 200% Guarantee.', 1, 0, 0, 'DDBFeCeWJ9o4lYqh.jpg', '1300 668 117', NULL, 'http://www.completefeet.com.au', NULL, NULL, NULL, NULL, '535 Boronia Road, WANTIRNA, VIC, 3152', '-37.851251', '145.24041899999997', 0, '2015-11-19 12:44:19', '2015-12-06 12:51:30'),
(1474, NULL, 'Compassionate Care 4 Kids', 'compassionate-care-4-kids', 'Rebecca is a fully qualified social worker having completed her degree at Deakin University Geelong.&nbsp;Rebecca has extensive experience working with children and young people who are diagnosed with a disability, have challenging behaviour or have experienced trauma in their lives. Rebecca has been working within the disability field for approximately 13 years (8 of which have been in special education) providing support and respite care to individuals and families. It was during this time that Rebecca recognised the need for quality respite care and support with a difference. In 2012 her private business ‘Compassionate Care 4 Kids’ was developed and began operating.', 1, 0, 0, 'KRG0HgtcGD7mf4VH.jpg', '0418 699 314 ', NULL, 'http://www.cc4k.com.au', NULL, NULL, NULL, NULL, 'McKenna Street, BANNOCKBURN, VIC, 3331', '-38.0472094', '144.16186449999998', 0, '2015-11-19 12:44:20', '2015-12-06 12:51:30'),
(1475, 488, 'Community Housing Ltd', 'community-housing-ltd', 'Community Housing Limited (CHL) is a national and international not-for-profit company delivering affordable housing in four regions of the world. Originating in Australia in 1993, CHL has spread its operations to South Asia, South-East Asia and South America. CHL currently has a portfolio of more than 5,600 properties under management in Australia across five States including Victoria, New South Wales, Western Australia, South Australia, Queensland and Tasmania.', 1, 1, 0, '9te13IeG5UIb53RK.jpg', '1300 245 468', NULL, 'http://www.chl.org.au', 'info@chl.org.au', NULL, NULL, NULL, '9 Prospect Street, BOX HILL, VIC, 3128', '-37.818522', '145.11889199999996', 0, '2015-11-19 12:44:20', '2015-12-06 12:51:30'),
