(1480, 489, 'Colac Area Health', 'colac-area-health', 'Colac Area Health meets the needs of more than 30,000 people in the Corangamite, Colac Otway, and Surf Coast Shires. It is a unique, integrated health service, situated in the foothills of the scenic Otway Ranges and close to the Surf Coast.\n\nWe achieve consistently high results in a number of externally driven accreditation systems across the organisation. We also enjoy strong community engagement which assists in guiding and shaping service developments.', 1, 1, 0, '5lcmJSwSrbsOfgel.jpg', '5232 5100', NULL, 'http://www.cah.vic.gov.au', 'Youth Health Hub: yhh@cah.vic.gov.au ; Neighbourhood House: nhouse@cah.vic.gov.au; Birregurra Community Health Centre: birregurrareception@cah.vic.gov.au', NULL, NULL, NULL, '2-28 Connor St, COLAC, VIC, 3250', '-38.3403964', '143.58111600000007', 0, '2015-11-19 12:44:20', '2015-12-06 12:51:31'),
(1481, 490, 'CODA Inc.', 'coda-inc', 'CODA Inc. has been providing support services to people with a disability in the Colac Otway region for more than 30 years. Over time the organisation has grown and adapted to the new paradigm of individualised supports to people with a disability.  Our focus is on the person, striving to ensure our quality services are flexible and tailored to the individual needs of each person.&nbsp;Our core business is to provide accommodation, respite  and individualised support services to people with a disability and their families who reside in the Colac Otway Shire.', 1, 1, 0, 'vhWGM0zKfiGST2Kb.jpg', '5231 1573', NULL, 'http://www.coda.org.au', 'coda@coda.org.au', NULL, NULL, NULL, 'PO Box 370, COLAC, VIC, 3250', '-38.3400445', '143.58443820000002', 0, '2015-11-19 12:44:21', '2015-12-06 12:51:31'),
