(1490, NULL, 'Chemtronics Biomedical Engineering', 'chemtronics-biomedical-engineering', 'Chemtronics Biomedical Engineering offers a range of technical solutions for the repair, maintenance and calibration of medical equipment. This is provided in line with Australian Standards, in particular AS/NZS 3551:2012.&nbsp;Chemtronics focus is on the life cycle management of medical technology. This considers all stages of equipment life from procurement, through commissioning and operational life to cost effective disposal.', 1, 0, 0, 'XRewlhW7Nb3Fokhg.jpg', '9824 4100', NULL, 'http://www.chemtronics.com.au', 'service@chemtronics.com.au', NULL, NULL, NULL, 'LEVEL 1, 453 AUBURN ROAD, HAWTHORN, VIC, 3122', '-37.8436916', '145.0411123', 0, '2015-11-19 12:44:22', '2015-12-06 12:51:34'),
