(1492, 325, 'Cerebral Palsy Support Network', 'cerebral-palsy-support-network', 'Who we areThe Cerebral Palsy Support Network (CPSN) is a not-for-profit organisation providing information and support services to people living with cerebral palsy and their families. We help empower individuals to lead more independent lives and provide support in a variety of ways to their families.The CPSN office is based in Melbourne, Australia and offers people a number of programs and services throughout Victoria.At the Cerebral Palsy Support Network, the focus is on our members and in providing the best possible service for every person. Each person is unique and our members are no different. We assess and address the needs of all of our members individually.Our vision is that we are known leaders empowering people with cerebral palsy and their networks to flourish through the provision of support, resources and services. We are highly adaptable and responsive to changing needs.Our mission is to empower and enable people with cerebral palsy and their networks to maximise their choices and opportunities.&nbsp;What we doThe Cerebral Palsy Support Network provides a vital link to information and support for people living with cerebral palsy and their families across Melbourne and Victoria.Our membership services extend across 17 local government areas throughout Victoria, rural and metropolitan regions.At the Cerebral Palsy Support Network, we don’t just provide essential support services. We help to empower people with cerebral palsy to make their own choices and live the life they want to.Our ongoing objective is to promote acceptance and equality for all people living with cerebral palsy, leading to enriched lives for all. The CPSN is continually striving to change attitudes towards cerebral palsy through awareness campaigns within the wider community. We do this by promoting events such as CP Awareness Week and World CP Day.', 1, 1, 0, 'pzh4k1D8d86mfON0.jpg', '(03) 9478 1001 or 1300 277 600', NULL, 'http://www.cpsn.org.au', 'cpsn@cpsn.org.au', NULL, NULL, NULL, '525 High St, PRESTON, VIC, 3072', '-37.73640001228978', '145.003917', 0, '2015-11-19 12:44:22', '2015-12-06 12:51:34'),
(1493, 492, 'Ceiling Hoist Solutions', 'ceiling-hoist-solutions', 'Ceiling Hoist Solutions is the industry leader in patient lifting rail systems and portable &amp; fixed hoists for the Australian healthcare industry. We supply Hospitals, Aged Care, Educational and Residential facilities and offer experienced solutions from design stage through to supply and installation. We support, educate and adhere to vital Australian Standards for safety and offer exclusive CHS Care Plans for preventative maintenance. CHS is the most innovative provider of rail systems and ceiling hoists in Australia, and designed, patented and supply the acclaimed Flexi-Link Connection System - used with mobile hoists by thousands of carers and facilities Australia-wide to ensure safety and efficiency for carers and patients. Talk to us today, and we will ensure our products and services competitively meets your patient lifting needs, and exceeds your expectations.', 1, 1, 0, 'ZgW9Fx7WK4Ux3Gen.jpg', '1300 789 420', NULL, 'http://www.ceilinghoistsolutions.com.au', NULL, NULL, NULL, NULL, '58-62 Star Crescent, HALLAM, VIC, 3803', '-38.016151', '145.26845200000002', 0, '2015-11-19 12:44:23', '2015-12-06 12:51:35'),
