(1496, 493, 'Carer Solutions Australia Pty Ltd', 'carer-solutions-australia-pty-ltd', 'Our service is available to anyone in the community who requires care and, would like to employ the support worker/s of their choice.We refer to our clients as our partners as, once you engage our service we view it as a partnership.Our service is delivered literally to your door with those interested in using our service, able to make an appointment time with us to come and visit with you, at home, work, a coffee shop wherever is convenient really!During this time we discuss your requirements and tailor the service to your individual needs.We allow you to be the employer without the hassle of being be an employer.', 1, 1, 0, 'q4MgimlloOEjFzJd.jpg', '1300 729 839', NULL, 'http://carersolutions.com.au', 'care@carersolutions.com.au', NULL, NULL, NULL, 'Level 2, 340 Bell Street, PRESTON, VIC, 3072', '-37.744738', '145.00181099999998', 0, '2015-11-19 12:44:23', '2015-12-06 12:51:35'),
(1497, 494, 'CareChoice', 'carechoice', 'CareChoice provides the best disability support &amp; attendant care for people of all ages and abilities to live as independently as possible.We do not exclude any client group and provide capable and confident attendant care services for children and adults with intellectual, physical, sensory, acquired and/or multiple disabilities, as well as those with psychiatric conditions.Live your life the way you choose, let us take care of the rest.The CareChoice team are skilled, passionate, reliable and committed professionals providing disability care to people of all abilities.We support children and adults of all ages with any level of physical or other impairment. No group is excluded from our services.We provide support services ranging from social support, community access and help around the home through to personal care, behavioural support, complex care and respite care.', 1, 1, 0, 't1OLQzts37wRyyBU.jpg', '1300 737 942', NULL, 'http://www.carechoice.net.au', 'enquiries@carechoice.net.au', NULL, NULL, NULL, 'E7, 2A Westall Road, CLAYTON, VIC, 3168', '-37.92950801237561', '145.14295579999998', 0, '2015-11-19 12:44:23', '2015-12-06 12:51:35'),
(1498, NULL, 'Care For You Pty Ltd', 'care-for-you-pty-ltd', 'Care for You is a small team of care professionals committed to providing quality one-to-one care with heart.Care For You has built its service around the needs of each and every client. We listen to and consult with our clients, their families, Care Teams and the wider care community. Care For You is a privately owned organisation providing in home care for people with disabilities (attendant care) throughout the State of Victoria. We commenced operation on the 1st of July 2004 at our principal office in Moonee Ponds, Victoria.’', 1, 0, 0, '5Hp7EjYpBA3AkR3Y.jpg', '9326 0811', NULL, 'http://www.careforyou.com.au', NULL, NULL, NULL, NULL, '168-170 Pascoe Vale Road, MOONEE PONDS, VIC, 3039', '-37.759623', '144.92640499999993', 0, '2015-11-19 12:44:23', '2015-12-06 12:51:36'),
(1499, 495, 'Care Connect', 'care-connect', 'What we doCare Connect assists you to live independently at home and in the community.Our approach is flexible, collaborative and designed to meet your changing needs. We build on your strengths and provide you with the information you need so that you can make informed choices about the services and support you require.Our staff specialise in coordinating services for people of all ages and abilities including children, young people, adults, older adults and carers.We also provide services:related to aged care, mental health, disability and carer support.to people from the following communities: culturally and linguistically diverse, Aboriginal or Torres Strait Islanders, financially or socially disadvantaged, lesbian, gay, bisexual, transgender or intersex and veterans.Throughout your journey we will be your partner, there to enable you to live the life you want at home and in the community.Our approachWe understand that having the ability to choose what’s important to you is central to living well. That’s why we have developed our person-centred service model called My Life, My Choice, My Way™. This approach puts you at the centre of all decisions.', 1, 1, 0, 'pm7zoxJjWj9xaz1I.jpg', '1800 116 166', NULL, 'http://www.careconnect.org.au', 'info@careconnect.org.au', NULL, NULL, NULL, 'Level 1, 204-206 Gipps Street  Abbotsford VIC 3067  PO Box 1388, COLLINGWOOD, VIC, 3066', '-37.80518001232033', '144.99785529999997', 0, '2015-11-19 12:44:24', '2015-12-06 12:51:36'),
(1500, 496, 'Capital Special Vehicles Pty Ltd', 'capital-special-vehicles-pty-ltd', 'CSV specialises in the provision of wheelchair accessible vehicles and adaptations that make the transportation of disabled passengers easier than ever.', 1, 1, 0, 'N84Qvto4PdBASbgZ.jpg', '(03 )9794 8888', NULL, 'http://www.csv.com.au', 'csv@csv.com.au', NULL, NULL, NULL, '12 Capital Drive, DANDENONG, VIC, 3175', '-38.01793301241504', '145.223655', 0, '2015-11-19 12:44:24', '2015-12-06 12:51:36'),
(1501, 497, 'Canterbury Concepts', 'canterbury-concepts', 'The original Canterbury Concepts grabrail system was created to assist people to return to or stay in their homes, safe and independent.Our grabrails suit most situations in the home, hospitals, retirement villages, resorts - anywhere safety and stability is needed - and can be purchased in any quantity, from the simple grabrail to the complex modular system.', 1, 1, 0, 'XSVv8ENFsXIAlBBM.jpg', '9580 1744', NULL, 'http://www.canterburyconcepts.com.au', 'info@canterburyconcepts.com.au', NULL, NULL, NULL, 'PO Box 320 BC, BRAESIDE, VIC, 3195', '-38.0003115', '145.11618050000004', 0, '2015-11-19 12:44:24', '2015-12-06 12:51:37'),
(1502, 498, 'Calvary Community Care', 'calvary-community-care', 'Calvary Community Care is a not-for-profit organisation and a service of Calvary, Little Company of Mary Health Care, providing a range of services to assist people to live independently in their own home and community. Services such as personal care (showering, mobility), travel (to appointments or shops), social support (companionship), domestic assistance (cleaning, laundry), home maintenance, respite (support for carers) and 24 hour live-in care are delivered by a team of dedicated and trained Support Workers and tailored to suit the individual needs of each client. Calvary Community Care also offers a range of tele-care products and monitoring services to support safe and secure independent living.', 1, 1, 0, 'pdKa4S7ASFwvu6jK.jpg', '1300 660 022', NULL, 'http://www.calvarysilvercircle.org.au', NULL, NULL, NULL, NULL, '551 Blackburn Road Mount Waverley VIC 3149', '-37.90034266236262', '145.14286664999997', 0, '2015-11-19 12:44:25', '2015-12-06 12:51:37'),
(1503, 499, 'Calvary Health Care Bethlehem Limited', 'calvary-health-care-bethlehem-limited', 'Calvary Health Care Bethlehem is a leading Victorian specialist palliative care service with a state-wide role in caring for those with a progressive neurological disease. Our service enables people to live well knowing that they have a progressive incurable illness and supports individuals and their families through the dying process.Our specialist model of care provides high quality, compassionate care in inpatient and community settings.  Our interdisciplinary approach to care provides patients and their families with specialist medical, nursing, allied health, pastoral care and bereavement support.', 1, 1, 0, '4UqiihJWOXcZkR9i.jpg', '03 9596 2853', NULL, 'http://bethlehem.org.au', NULL, NULL, NULL, NULL, '476 Kooyong Rd, CAULFIELD SOUTH, VIC, 3162', '-37.89718', '145.01342999999997', 0, '2015-11-19 12:44:25', '2015-12-06 12:51:38'),
