(1505, 546, 'Buildings, Audits and Inspections Pty Ltd', 'buildings-audits-and-inspections-pty-ltd', 'Buildings, Audits &amp; Inspections Pty Ltd is a company dedicated to undertake Quality pre purchase inspections, progress building inspections and provide reports and advice to clients regarding all types of buildings. This includes both domestic building inspections and commercial building inspections.I can, if requested, provide a full audit of the building permit file held at the Local Council to ensure peace of mind that what is being sold complies with that permit. I find many structures do not. This has implications purchasers may not aware of.I offer progress inspections on your current build project at any stage to ensure your builder is meeting their obligations regarding the Building Codes and StandardsI also offer visual walk-throughs, as well as consulting on enforcement matters and construction projects.I offer inspections anywhere between Geelong, Surf Coast and Colac.', 1, 1, 0, NULL, '0459 228 434', NULL, 'http://www.buildingsauditsinspections.com.au', 'mick@buildingsauditsinspections.com.au', NULL, NULL, NULL, '825 Colac-Lavers Hill Rd, BARONGAROOK, VIC, 3249', '-38.435284', '143.57036700000003', 0, '2015-11-19 12:44:25', '2015-12-06 12:51:38'),
