(1514, 500, 'Better Hearing Australia (Victoria) Inc', 'better-hearing-australia-victoria-inc', 'Better Hearing Australia (Victoria) Inc. provides free hearing services across Victoria to people with hearing loss and their families. Our services are provided by qualified, professional staff and include helping people manage their hearing loss, information on all aspects of hearing loss, advice on hearing devices and living independently with hearing loss, and help with managing tinnitus.', 1, 1, 0, 'SmuUdwK4rhKKSSOx.jpg', '1300 242 842', NULL, 'http://www.betterhearing.org.au', 'victoria@betterhearing.org.au', NULL, NULL, NULL, '5 High St, PRAHAN, VIC, 3181', '-37.850504', '144.98508600000002', 0, '2015-11-19 12:44:26', '2015-12-06 12:51:39'),
(1515, 501, 'Bethany Community Support Incorporated', 'bethany-community-support-incorporated', 'Bethany Community Support opened its doors in May 1868 as the Geelong Female Refuge. It was established to provide refuge and rehabilitation to the poor women of Geelong.As political, social and economic trends changed over the past 140 years, so did the needs of the community. Over the years, we have responded to those changes and have provided services that have included: babies’ home, adoption agency, mothercraft training, centre kindergarten, and day care service.Today we are a dynamic and diverse human services organisation servicing the Geelong and Barwon South West Region.We are an independent voluntary organisation with no political or religious affiliations.', 1, 1, 0, 'oomWVX0oLDwFykyx.jpg', '03 5278 8122', NULL, 'http://www.bethany.org.au', 'info@bethany.org.au', NULL, NULL, NULL, '16 Ballarat Road, HAMLYN HEIGHTS, VIC, 3215', '-38.128670012464575', '144.34036200000003', 0, '2015-11-19 12:44:26', '2015-12-06 12:51:39'),
(1516, NULL, 'Bespoke Architects Pty Ltd', 'bespoke-architects-pty-ltd', 'Established in 2010, Bespoke Architects is the collaborative union of Daniel Calder and Nicole Walters.  Both are Architecture Graduates from Deakin University School of Architecture and Building.   Both Daniel and Nicole have earlier qualifications in Building Design and Drafting from The Gordon.\nBased in Newtown Victoria and servicing Geelong, The Bellarine Peninsula and Surf Coast areas.  Bespoke Architects specialise in custom residential design of new homes and renovations to existing homes.  Both Daniel and Nicole have a strong background in commercial architecture having worked on numerous large scale commercial projects prior to establishing Bespoke Architects.\n', 1, 0, 0, 'kAInCfXYA8jboUmw.jpg', 'Daniel: 0439 386 945 Nicole: 0433 653 536', NULL, 'http://www.bespokearchitects.com.au', 'dan@bespokearchitects.com.au; nic@bespokearchitects.com.au', NULL, NULL, NULL, '38 Roebuck St, NEWTOWN, VIC, 3220', '-38.148791', '144.34839399999998', 0, '2015-11-19 12:44:26', '2015-12-06 12:51:40'),
(1517, 549, 'Bendigo Speech Works', 'bendigo-speech-works', 'Bendigo Speech Works is a leading speech pathology practice in Bendigo.  We have developed a reputation for delivering a comprehensive and high quality speech pathology service to paediatric and adult clients in Bendigo and across Central Victoria.', 1, 1, 0, 'sxKKfB9KGZc0UGQj.jpg', '(03) 5443 9912', NULL, 'http://www.bendigospeechworks.com.au', 'admin@bendigospeechworks.com.au', NULL, NULL, NULL, '12 Beischer Street Strathdale VIC 3550', '-36.7636415', '144.31721500000003', 0, '2015-11-19 12:44:26', '2015-12-06 12:51:40'),
