(1520, NULL, 'Bellarine Peninsula Taxis Pty Ltd', 'bellarine-peninsula-taxis-pty-ltd', 'Booking a cab is easy with Bellarine Peninsula Taxis.All Bellarine Peninsula Taxis are fitted with GPS navigation systems and mobile data terminals to:• assist in the accuracy of customer booking details• ensure safety for both customers and drivers• send the taxis that are closer to youNext time you want a cab - think Bellarine Peninsula Taxis!', 1, 0, 0, NULL, '132211', NULL, 'http://bellarinepeninsulataxis.com.au/', NULL, NULL, NULL, NULL, 'PO Box 719, DRYSDALE, VIC, 3222', '-38.1735477', '144.56995129999996', 0, '2015-11-19 12:44:27', '2015-12-06 12:51:41'),
