(1522, 503, 'Bellarine Community Health Ltd &#8211; Point Lonsdale', 'bellarine-community-health-ltd-8211-point-lonsdale', 'Formed in 1992 from the amalgamation of the Drysdale, Portarlington, Ocean Grove and Queenscliff community health services, BCH has continued to expand, as service needs and delivery development opportunities have been identified. BCH is a major provider of community based primary health and aged community care services on the Bellarine Peninsula. The State funded primary care services are provided through four community health centres, a shopfront in one township and in people''s homes. BCH also provides accommodation through 16 independent living units.', 1, 1, 0, '4ZbC7YtuKYmqN1ek.jpg', '5258 0888', NULL, 'http://www.bch.org.au', 'eas@bch.org.au', NULL, NULL, NULL, 'PO Box 26, POINT LONSDALE, VIC, 3225', '-38.2850743', '144.6143366', 0, '2015-11-19 12:44:27', '2015-12-06 12:51:41'),
(1523, 472, 'Barwon Youth Services', 'barwon-youth-services', 'Youth ServicesAims to provide you with opportunities to be seen, listened to and heard. A platform that provides you with a voice and an opportunity to be empowered. Youth Services also aims to minimise youth homelessness by providing innovative youth and family friendly responses to young people who are experiencing difficulties living at home.Barwon Youth is founded on a social justice, strengths-based model.Since 1981, we’ve been working with individuals, families and communities in the context of their lived experience. Today, we are the largest youth agency in the Barwon region.Our innovative services and programs enable and celebrate the achievements of the amazing young people we work with.', 1, 1, 0, 'T3TIcMaFHx8ntvX3.jpg', '03 52214466', NULL, 'http://www.bcyf.org.au/what-we-do/youth-services', 'info@bcyf.org.au', NULL, NULL, NULL, '12-14 Halstead St, GEELONG WEST, VIC, 3218', '-38.1459233', '144.34856030000003', 0, '2015-11-19 12:44:27', '2015-12-06 12:51:41'),
(1524, NULL, 'Bayley House', 'bayley-house', 'Bayley House has been a part of the Bayside community for over 60 years. We offer a range of services and programs to support adults with an intellectual disability. These include:	An extensive Day Program for over 175 people which operates from 8.30am -3.00pm Mon-Fri	An Accommodation Service which offers ongoing residential accommodation to over 40 people	A Respite Service which provides short term accommodation', 1, 0, 0, 'EVDjRLz9puZMu4jX.jpg', '03 9982 1500', NULL, 'http://www.bayleyhouse.org.au', 'contactus@bayleyhouse.org.au', NULL, NULL, NULL, 'PO Box 113, BRIGHTON, VIC, 3186', '-37.9056598', '145.00431170000002', 0, '2015-11-19 12:44:27', '2015-12-06 12:51:41'),
