(1530, 506, 'Back To Back Theatre', 'back-to-back-theatre', 'Over the last 28 years Back to Back Theatre has made a body of work that questions the assumptions of what is possible in theatre, but also the assumptions we hold about ourselves and others.As an ongoing dialogue with our audience, each new project is an investigation seeking answers to questions raised in previous works. Our attention lies with design, light, and sound. The stories we pursue weave the personal, the political and the cosmic. We work to curiosity and interest in the live moment, to what sits within and between.Back to Back Theatre is based in Geelong, Australia.', 1, 1, 0, 'KNfQaus3GyLozY2h.jpg', ' (03) 5221 2029 ', NULL, 'http://www.backtobacktheatre.com', 'info@backtobacktheatre.com', NULL, NULL, NULL, 'PO Box 1257, Geelong, 3220   60 Little Malop St Geelong Victoria ', '-38.14772201247312', '144.35696399999995', 0, '2015-11-19 12:44:28', '2015-12-06 12:51:43'),
(1531, NULL, 'AVA-Tieman', 'ava-tieman', 'AVA-Tieman was formed in 2012, when All Vehicle Accessories (AVA) purchased Tieman Industries’ Wheelchair Accessibility business. The new venture combines AVA’s long history in the automotive aftermarket accessories industry, with Tieman’s 25 years of experience in providing quality wheelchair access equipment and vehicle modifications.', 1, 0, 0, 'TsmTtQkzhZ9chESM.jpg', '1300133353', NULL, 'http://www.ava-tieman.com', NULL, NULL, NULL, NULL, '49 Fennell St, PORT MELBOURNE, VIC, 3207', '-37.8275088', '144.93890740000006', 0, '2015-11-19 12:44:28', '2015-11-19 17:51:15'),
