(1539, 511, 'Astec Equipment Services', 'astec-equipment-services', 'Astec is a unique organisation with its staff qualifications and backgrounds combining to provide a skill base that can source and custom fit equipment to suit you, the client. We are a group of like minded, highly skilled and qualified individuals that make up an altruistic business that has supported Ballarat and district for more than 21 years. We provide very special solutions for very special people and these qualities are available to all customers, no matter what the requirement.Astec has a very broad customer base that includes Ballarat Health Services, PINARC, Ballarat Specialist School, Department of Human Services, Department of Veteran Affairs, TAC, local industry and private scooter and wheelchair users. Astec is in demand by various manufacturers to carry out their warranty and repair work.A long association with Magic Mobility and more recently Ottobock means that Astec Equipment Services can provide specialised custom wheelchairs.Each client is extensively consulted and measured and the chair constructed so that the end result is a chair that will provide years of daily community access with maximum comfort.', 1, 1, 0, 'zu6HEXInkcctdxh7.jpg', NULL, NULL, 'http://www.astecservices.net.au', NULL, NULL, NULL, NULL, 'Shop 2, 109 Hertford St, SEBASTOPOL, VIC, 3356', '-37.587716', '143.826644', 0, '2015-11-19 12:44:29', '2015-12-06 12:51:44'),
