(1541, 513, 'Assessments Australia', 'assessments-australia', 'Assessments Australia offers the right advice, results and information for all of its clients. Government, NGOs and private organisations are all able to make the most accurate and beneficial human services decisions as a result of Assessments Australia’s assured assessments services.', 1, 1, 0, 'fGrn2vfd1XGa03vL.jpg', '(03) 9654 0204', NULL, 'http://www.assessments.com.au', 'info@assessments.com.au', NULL, NULL, NULL, 'Suite 4, Level 4, 12-20 Flinders Lane, MELBOURNE, VIC, 3000', '-37.814253', '144.97357799999997', 0, '2015-11-19 12:44:30', '2015-12-06 12:51:45'),
