(1544, 516, 'Arbias Ltd', 'arbias-ltd', 'arbias Ltd. provides specialist services for people with acquired brain injury. We are staffed by employees in the areas of neuropsychology, case management, accommodation, professional training, community development, and individualised support. Please take some time to browse the following sections, and discover more about this not for profit organisation.', 1, 1, 0, 'oG3OcPXfeJG7aYaY.jpg', NULL, NULL, 'http://www.arbias.org.au', NULL, NULL, NULL, NULL, 'PO Box 5002, BRUNSWICK NORTH, VIC, 3056', '-37.767872', '144.96192900000005', 0, '2015-11-19 12:44:30', '2015-12-06 12:51:45'),
