(1550, 518, 'Amazing Kids OT', 'amazing-kids-ot', 'Occupational Therapy aims to assist children to achieve their goals, improve their self-esteem, engagement &amp; participation in everyday activities!Amazing Kids OT provides Paediatric Occupational Therapy, a Handwriting Clinic, Interactive Metronome, a Social Skills group &amp; a Developmental Play Clinic in Geelong.Amazing Kids Occupational Therapy provides Paediatric Occupational Therapy to Geelong, Surf Coast, Bellarine and the Western Suburbs of Melbourne. ', 1, 1, 0, 'SlDAtJzjrFAwFfdV.jpg', '(03) 5222 2405 Mob: 0408 567 069', NULL, 'http://amazingkidsot.com', 'amazingkids.ot@bigpond.com', NULL, NULL, NULL, '295 Latrobe Terrace, Geelong, VIC 3220', '-38.151498', '144.35224800000003', 0, '2015-11-19 12:44:30', '2015-12-06 12:51:46'),
(1551, 519, 'Alzheimers Australia Vic', 'alzheimers-australia-vic', 'Alzheimers Australia Vic is the peak body and charity in Victoria for people, of all ages, living with all forms of dementia, their families and carers.We provide information, education, advocacy and support', 1, 1, 0, '3TWYRtLmXn4x5PqY.jpg', '1800 100 500', NULL, 'http://www.fightdementia.org.au/victoria.aspx', 'alz@alzheimers.org.au', NULL, NULL, NULL, '98-104 Riversdale Road Hawthorn, Vic, 3122  Locked Bag 3001, HAWTHORN, VIC, 3122', '-37.82921401233099', '145.035303', 0, '2015-11-19 12:44:31', '2015-12-06 12:51:46'),
(1552, NULL, 'Allay Occupational Therapy', 'allay-occupational-therapy', 'Occupational therapy can help you overcome life’s challenges and reach your individual potential.ABOUT US:Allay Occupational Therapy provides evaluation, consultation and treatment for people with psychological, physical and neurological problems.Allay Occupational Therapy helps people by identifying abilities and limitations to thereby develop strategies for improving health and wellbeing. This is achieved by personalized assessment and intervention focusing on increasing function, productivity and capacity in everyday activities.You may like to speak to Allay Occupational Therapy about alleviating the impact of mental illness, disability, injury or ageing on your engagement in life.Allay Occupational Therapy is based in a clinic in central Geelong, near the hospitals. Allay Occupational Therapy can come to your home or community through Geelong, Bellarine Peninsula, Colac and Golden Plains.SPECIALISING IN:Mental health - assessment and therapy for depression, anxiety, stress, grief, psychotic illnesses, personality disorder and other difficulties.Independent living skills - assessment and intervention for activities such as cooking, shopping, cleaning or self care.Behavioural issues - assessment, support and management planning with families, schools or other networks.Sensory integration - understanding and improving over-stimulation, drowsiness, defensiveness to certain stimuli or difficulty relaxing.Relationships - skill building in interpersonal effectiveness, assertiveness and social skills.Cognitive decline - functional assessment and management of transitions.Learning difficulties - improving concentration or memory problems.Improving sleep with specialist strategies.Community access - managing anxiety, public transport training, skills in activities such as shopping and paying bills.', 1, 0, 0, 'NraqmcCYXMGWq8gX.jpg', '(03) 5222 3838', NULL, 'http://www.allayoccupationaltherapy.com.au/', NULL, NULL, NULL, NULL, 'The Medical Health Group,  275 Ryrie Street, Geelong, VIC 3220 PO BOX 45, GEELONG, VIC, 3220', '-38.15070981247442', '144.36524580000003', 0, '2015-11-19 12:44:31', '2015-12-06 12:51:47'),
(1553, 520, 'ALL REQUIRED CARE', 'all-required-care', 'As the smallest of Ballarat''s in-home personal care providers, we offer the very best personal and compassionate care for the elderly and disabled person. It is our goal to improve the physical, emotional and spiritual wellness of our clients, and that is exactly what we do -- every day.With a number of services and experienced in-home care providers, we can tailor a program specifically for the needs of each client.We understand the difficulty of finding the best care for your loved ones. That''s why ALL REQUIRED CARE simplified the process for you. We work with our clients (and case managers) to provide information and support when you need it.Rest assured -- ALL REQUIRED CARE is by your side every step of the way.', 1, 1, 0, 'GBjKocT9GLvRoK68.jpg', ' (03) 5335 7557   Mob 0458 460 940 (24 hours)', NULL, 'http://www.allrequiredcare.com.au', 'support@allrequiredcare.com.au', NULL, NULL, NULL, 'P O BOX 283, SEBASTOPOL, VIC, 3356', '-37.5853192', '143.8395306', 0, '2015-11-19 12:44:31', '2015-12-06 12:51:47'),
