(1562, 525, 'Acorn Stairlifts Pty Ltd &#8211; Springvale', 'acorn-stairlifts-pty-ltd-8211-springvale', 'Over 20 years knowledge and experienceOur Australian office is located in Sydney with a regional network of stairlift surveyors and engineers in Melbourne, Brisbane, Perth and Adelaide.\nJoin the thousands of people who have benefited from our stairlifts worldwide. We are a global, family owned company established in 1992. We have over 1200 employees worldwide.We specialise in making stairlifts, stylish, easy to use and affordable. We assemble and export all our stairlifts from our United Kingdom factories to locations all over the world.One of our stairlifts is installed every 9 mins somewhere in the world.', 1, 1, 0, 'TlKxruJLPhsOwMaS.jpg', '1800-300-812', NULL, 'http://www.acornstairlifts.com.au', 'service@acornstairlifts.com.au', NULL, NULL, NULL, 'Kennards Self Storage, 881 Princess Highway, SPRINGVALE, VIC, 3171', '-37.929904', '145.15023900000006', 0, '2015-11-19 12:44:32', '2015-12-06 12:51:49'),
