(1570, 528, 'Able Living Group', 'able-living-group', 'Welcome to the world of Able Living Group (formerly Able Medical Hire &amp; Sales).  At Able Living we focus our products and services on the needs of people of all ages who are suffering from temporary or long term loss of physical capability.For 30 years, Able has been working closely with hospitals, rehabilitation centres and their physio and occupational therapy staff to deliver home health and mobility appliances to homes and hospitals on request and without delay.', 1, 1, 0, 'mrbWoOw8NH5VrUlR.jpg', '1300 22 53 54 ', NULL, 'http://www.able-living.com', 'info@able-living.com', NULL, NULL, NULL, '1119 Riversdale Road, SURREY HILLS, VIC, 3127', '-37.837433', '145.11074299999996', 0, '2015-11-19 12:44:33', '2015-12-06 12:51:51'),
