(1572, 530, 'Total Care Transport', 'total-care-transport', 'Since 2005 the business has grown from a single-vehicle company to a 32-strong fleet of maxi-taxis providing daily transport needs for people with disabilities across the greater metropolitan area.Its highly-professional team of drivers undergo extensive training in driving, manual handling and communication skills to provide total care to people with severe physical, intellectual and social disabilities.', 1, 1, 0, 'whVX8xpVXXE13b0q.jpg', '9551 9339', NULL, 'http://www.totalcaretransport.com.au', NULL, NULL, NULL, NULL, '65/266 OSBOURNE AVE, CLAYTON SOUTH, VIC, 3169', '-37.945604', '145.118701', 0, '2015-11-19 12:44:34', '2015-12-06 12:51:52'),
(1573, 531, 'Abacus Learning Centre Ltd', 'abacus-learning-centre-ltd', 'Abacus Learning Centre was Australia’s first facility offering centre-based ABA therapy programs.Located in Hastings on the Mornington Peninsula in Victoria, Abacus provides excellence in early intervention programs and school services specifically designed to enable children with Autism Spectrum Disorder (ASD) to reach their fullest potential.Abacus programs are based on the principles of Applied Behaviour Analysis (ABA), an intensive education program developed by Dr O. Ivar Lovaas, Ph.D which is scientifically proven to be effective and is the preferred method of treatment for ASD in the USA, UK, Canada, Europe and increasingly in Australia.', 1, 1, 0, 'U0mNkiaysqqpohN8.jpg', '(03) 5979 8891 ', NULL, 'http://www.abacuslearning.org.au', 'info@abacuslearning.org.au', NULL, NULL, NULL, '74 Victoria Street, HASTINGS, VIC, 3915', '-38.30437', '145.18991000000005', 0, '2015-11-19 12:44:34', '2015-12-06 12:51:52'),
(1574, 532, 'DASSI', 'dassi', 'DASSI is a highly regarded not-for-profit organisation that assistsVictorians in times of need, namely when they are recovering from anailment or illness or a long term medical conditions, or if they areincapacitated, either temporarily or permanently.DASSI provides only the finest quality carers and attendant supportstaff as and when they are required - be it ''round the clock or for afew hours at a time.DASSI assists people of all ages and from all backgrounds andcultures to lead independent lives in their homes, workplaces andcommunities. This may include personal care and mobility support forrehabilitation, education and recreational activities.DASSI is an incorporated association governed by its Board ofGovernance and managed by its CEO and supported by a professional groupof staff.', 1, 1, 0, '71wog5FgRdl7Q0vP.jpg', '1300 362 649', NULL, 'http://www.dassi.com.au', 'aaron.blake@dassi.com.au', NULL, NULL, NULL, 'Unit 2, 142 Little Ryne St GEELONG VIC 3220', '-38.1493996', '144.36399649999998', 0, '2015-11-19 12:44:35', '2015-12-06 12:51:53'),
(1575, 533, 'YMCA Geelong', 'ymca-geelong', 'YMCA Geelong is a charitible, not for profit incorporated association.Through our programs and services to the greater Geelong region weprovide our community with an opportunity to be healthier, happier andconnected.', 1, 1, 0, 'AH1goaauTTgHZw21.jpg', '5223 2714', NULL, 'http://geelong.ymca.org.au', 'newtownstadium@ymca.org.au', NULL, NULL, NULL, '25 Riversdale Road NEWTOWN VIC 3220', '-38.1613359', '144.3394558', 0, '2015-11-19 12:44:35', '2015-12-06 12:51:53'),
(1576, 534, 'Vision Australia Geelong', 'vision-australia-geelong', 'Vision Australia is a leading national provider of blindness and low \nvision services in Australia. We work in partnership with Australians \nwho are blind or have low vision to help them achieve the possibilities \nthey choose in life.\n \n\nVision Australia is a not-for-profit organisation with client numbers of\n 33,000 and we are also a major participant and partner in the \ninternational blindness community.\n \n\nWe provide services and support for clients through 28 Vision Australia \ncentres in NSW, ACT, Queensland and Victoria. Clinics are also held in \n29 other locations and there are outreach services to the Northern \nTerritory and Tasmania.', 1, 1, 0, 'BLUTGLLpbLpJtttg.jpg', '1300 84 74 66', NULL, 'http://www.visionaustralia.org', 'info@visionaustralia.org', NULL, NULL, NULL, '79 High St BELMONT VIC 3216', '-38.171696', '144.346774', 0, '2015-11-19 12:44:36', '2015-12-06 12:51:55'),
(1577, 535, 'SalvoConnect Social Services', 'salvoconnect-social-services', 'including housing, homelessness, women’s, mental health, financial, alcohol and other drug and spiritual services.Overmany decades, The Salvation Army has provided services to the communityin the Barwon Region. Formerly titled ''Kardinia'' (''sunrise'') theservices were rebranded to SalvoConnect:As we look to the futurewe confirm our commitment to connect people with the services they needand connect people to their community.', 1, 1, 0, 'Ib8jizZd0OIcLpDx.jpg', '5223 5400', NULL, 'http://www.salvoconnect.com.au', 'salvoconnect.geelong@aus.salvationarmy.org', NULL, NULL, NULL, '35 Myers St GEELONG VIC 3220', '-38.150119', '144.35576300000002', 0, '2015-11-19 12:44:36', '2015-12-06 12:51:55'),
(1578, 536, 'St Laurence Community Services', 'st-laurence-community-services', 'We ListenMyPLAN is a unique range of customised services that offer choice for independence and growth.We listen to you to understand your goals. We work withyou to put in place an individual plan to achieve the outcomes thatmatter to you.', 1, 1, 0, 'LSY2PLSYIBNCbq5s.jpg', '5282 1405', NULL, 'http://www.stlaurence.org.au', 'sladmin@stlaurence.org.au', NULL, NULL, NULL, 'PO Box 110 LARA VIC 3212', '-38.0235922', '144.4078657', 0, '2015-11-19 12:44:36', '2015-12-06 12:51:55'),
(1579, 537, 'Scope Shannon Park Industries', 'scope-shannon-park-industries', 'Scope is one of the largest providers of services to people with adisability in Victoria, and one of the largest not-for-profitorganisations in Australia. Our mission is to enable each person wesupport to live as an empowered and equal citizen.Starting in 1948 as the Spastic Children''s Society of Victoria, todayScope''s services include areas such as therapy and psychology, home andrespite, day and lifestyles and employment services.We are a sustainable organisation of which receives 81.5% of ourfunding through the State and Federal Government. The remainder of ourfunding is largely through fundraising.Historically, people with a disability have had little say as to theorganisation that services them. This environment is changing.Individualised funding is now empowering clients to make choices andScope seeks to be the preferred provider. To achieve this Scope aimsto deliver quality and responsive services for people with a disability.', 1, 1, 0, 'KM9jKLCAs6Tr6Y1y.jpg', '1300 4 72673', NULL, 'http://www.scopevic.org.au', 'contact@scopevic.org.au', NULL, NULL, NULL, '2-10 Balcombe Rd NEWTOWN VIC 3220', '-38.1607462', '144.3316013', 0, '2015-11-19 12:44:37', '2015-12-06 12:51:56'),
(1580, 538, 'Karingal Inc', 'karingal-inc', 'Karingal is a not-for-profit organisation that commencedservices in Geelong in 1952.It was established to improve the quality of life for peoplewith a disability by providing and promoting valued services, careand supports in:Personal developmentEducation programsVocational placement, training and support servicesAccommodation and associated support services andAged care and related services.', 1, 1, 0, 'uBkQARtiQK2NrcCb.jpg', '5249 8900', NULL, 'http://www.karingal.org.au', 'reception@karingal.org.au', NULL, NULL, NULL, 'Kardinia House, 1 Riverview Terrace, PO Box 558 BELMONT VIC 3216', '-38.1748902', '144.34289749999994', 0, '2015-11-19 12:44:37', '2015-12-06 12:51:56'),
(1581, 539, 'Gateways Support Services Inc', 'gateways-support-services-inc', 'Gateways Support Services is a responsive community organisation that empowers and supports children and adults who have a disability/additional need and their families.Gateways currently assists more than 1300 children and adults, and their families, in the Western division of Victoria operating from several locations including Geelong, Warrnambool, Colac, Camperdown, Hamilton, Western Melbourne and Braybrook. We strive to provide responsive and innovative services that give children and adults with disabilities/additional needs, and their families, the chance to realise their potential and live enjoyable and meaningful lives in their local community.', 1, 1, 0, 'FBemW1N20AHNIrBV.jpg', '5221 2984', NULL, 'http://www.gateways.com.au', 'info@gateways.com.au', NULL, NULL, NULL, '10-12 Albert St  GEELONG WEST VIC 3218', '-38.140254', '144.34729300000004', 0, '2015-11-19 12:44:37', '2015-12-06 12:51:56'),
(1582, 540, 'Encompass Community Services', 'encompass-community-services', 'Encompass Community Services is a not-for-profit organisation committedto promoting equality and opportunity for people. We offer support topeople with physical, intellectual, sensory and psychologicaldisabilities, young people who are disengaged, long-term unemployed andthose facing financial, social or learning barriers. Our Board,Management and Staff are not afraid to push for change,create opportunities and do what it takes to promote equality foreveryone!', 1, 1, 0, 'gUZE0xolV8lvZWfV.jpg', '5222 3377', NULL, 'http://www.encompass-cs.org.au', 'info@encompass-cs.org.au', NULL, NULL, NULL, '400 Pakington Street GEELONG VIC 3220', '-38.161476', '144.34533299999998', 0, '2015-11-19 12:44:37', '2015-12-06 12:51:57'),
(1583, 541, 'CatholicCare', 'catholiccare', 'Since 1935, our professionally delivered programs and services have beensupporting individuals and families to increase their quality of lifeand reduce social isolation and disadvantage.Our work in the community is inspired by our vision of ‘life to thefull’ for families and individuals in all their diversity. While ourcore work will always be disadvantaged families and individualsexperiencing poverty, homelessness, domestic violence or addictionissues, we continue to look for funding opportunities and developprograms that address the current issues faced by specific culturalgroups, families and society in general.The breadth of our servicesextends to communities across Melbourne, Geelong and Gippsland.Our services are funded by government grants and contracts, sponsorshipand contributions from donors and supporters, income earned frominvestments, and fees charged for the services which we deliver.', 1, 1, 0, 'wzXpHG8hPpiOmCQ8.jpg', '5221 7055', NULL, 'http://www.ccam.org.au', 'geelong@ccam.org.au', NULL, NULL, NULL, 'Ground floor, 62 McKillop Street GEELONG VIC 3220', '-38.153593', '144.35746599999993', 0, '2015-11-19 12:44:37', '2015-12-06 12:51:57'),
(1584, 542, 'Barwon Health', 'barwon-health', 'YOUR HEALTH We will work with the community to deliver significantly improved health outcomes.OUR SERVICE Our health care service will be well-connected to ensure a positive experience for those we serve.OUR REGION We will have strong partnerships with all providers who influence health in our region.OUR PEOPLE Our workforce will be thriving, collaborative and highly skilled.', 1, 1, 0, '7LLucDVMIK0XpSbu.jpg', '4215 0000', NULL, 'http://www.barwonhealth.org.au', 'http://www.barwonhealth.org.au/contact', NULL, NULL, NULL, 'C/- Geelong Hospital, RYRIE ST GEELONG VIC 3220', '-38.151877', '144.36551499999996', 0, '2015-11-19 12:44:38', '2015-12-06 12:51:57'),
(1585, NULL, 'Active Care', 'active-care', 'Active Care has provided care services in the Geelong region since1994. Before this, we provided care services for a family member andtrained staff to work with that person. We discovered that care takesmany forms.Today we can deliver Care Programs to suit your needs from Nursing&amp; Palliative Care to Personal to Respite Care , Disability Care orDomestic Home Care to Home and Garden Maintenance.', 1, 0, 0, 'ECin3dI13JJLNbGz.jpg', '5229 8444', NULL, 'http://www.activecare.net.au/', 'enquiries@activecare.net.au', NULL, NULL, NULL, '71 Little Malop St GEELONG VIC 3220', '-38.147468', '144.358792', 0, '2015-11-19 12:44:38', '2015-12-06 12:51:58'),
(1586, 335, 'National Interpreting &amp; Communication Services', 'national-interpreting-amp-communication-services', 'NICSS provides sign language interpreters to Deaf people and professional and government organisations Australia-wide.A NICSS Interpreter can be booked for a range of settings including public hospital appointments, legal and mediation, conferences and meetings, financial advice or educational settings, and many more. Public hospital appointments are FREE for Aboriginal and Torres Strait Islander sign language users.As an activity of Wesley Mission Brisbane, NICSS is a registered National Disability Insurance Scheme (NDIS) provider.', 1, 1, 0, 'rLuE7oh8cfH4OfdR.jpg', '1800 246 945', NULL, 'http://www.nicss.org.au/', 'bookings@nicss.org.au', 'https://www.facebook.com/pages/National-Interpreting-Communication-Services/614697688551513?skip_nax_wizard=true', NULL, NULL, '930 Gympie Road, Chermside', '-27.38330125822566', '153.03021315', 0, '2015-12-06 11:43:38', '2015-12-06 12:49:43'),
(1587, NULL, 'Chelsea Morley', 'chelsea-morley', 'Helping you get BACK TO LIFE with individualised programs based on your health conditions and goals.ExHealth is a specialised clinic that provides Exercise Physiology, Injury Rehabilitation and Remedial Therapy (including cupping, dry needling and lymhoedemea massage) services in Wyndham - Werribee &amp; Hoppers Crossing and Hobsons Bay - Altona. For more information check the relevant tab above.Exercise Physiology revolves around the development of best exercise and rehabilitation programs to assist people in the management of illness, lifestyle and disability. Scienitific research indicates that if exercise is prescribed correctly it will greater enhance our health.', 1, 0, 0, '8HQ8a8jNneqvrfFz.jpg', '0412 472 959', NULL, 'http://www.exhealthrehab.com.au', 'chelsea.morley@exhealthrehab.com.au', NULL, NULL, NULL, '38 Willowtree Drive, WERRIBEE, VIC, 3030', '-37.901057', '144.676653', 0, '2015-12-06 11:43:49', '2015-12-06 12:51:34'),
