(1590, NULL, 'Kingsway Councelling', 'kingsway-councelling', 'Kingsway Counselling is a counselling service established in 1994 operating in central Geelong. We are staffed by a dedicated team of experienced psychologists, counsellors, social workers and family therapists, who provide a professional, client-centred approach within a warm, welcoming environment. Psychological/Counselling services are available for individuals, couples, children, adolescents, adults and families. We work compassionately and inclusively with you on your designated therapeutic goal to ensure optimal well-being as an individual, couple or family unit.', 1, 0, 0, NULL, '5221 8907', NULL, 'http://www.kingswaycounselling.com.au', NULL, NULL, NULL, NULL, 'Aberdeen House, 2A Aberdeen Street, GEELONG WEST, VIC, 3218', '-38.1471814', '144.34942320000005', 0, '2015-12-06 11:43:50', '2015-12-06 12:51:43'),
(1591, NULL, 'Atlas Mobility', 'atlas-mobility', 'Lifts, Chair Lifts &amp; Home ElevatorsWe provide Stair Lifts, Chair Lifts, Platform Lifts, Home Elevators and other Mobility Products. We are located in Melbourne, Australia. Contact us for a wide range of Mobility Solutions.', 1, 0, 0, NULL, '1800 207 685', NULL, 'http://atlasmobility.com.au', 'sales@atlasmobility.com.au', NULL, NULL, NULL, '14/150 Albert Rd, South Melbourne VIC 3205', '-37.83634961233414', '144.96921740000005', 0, '2015-12-06 11:43:50', '2015-12-06 12:51:44'),
(1592, NULL, 'Peninsula Family Therapy &#038; Counselling', 'peninsula-family-therapy-038-counselling', 'Ann Garden Family Therapist, Child Therapist and Mental Health Practitioner with endorsement to provide Nurse Practitioner services under Medicare. Assessment and therapy services for all ages:	Comprehensive Mental Health Assessment	Individual Psychological Therapy	Child and Adolescent Therapy	Family and Couples Therapy	Mother and Baby Therapy	Nurse Practitioner Interventions	Victims of Crime Interventions	Autism and Disability Counselling	Caring for Family - Elderly or Disability	Consultation to Community Agencies and Clinical Supervision.', 1, 0, 0, NULL, ' 03 9770 5307', NULL, 'http://www.peninsulaftc.com.au', 'peninsulafamilytherapy@westnet.com.au', NULL, NULL, NULL, '57 Bondi Avenue FRANKSTON, 3199, VIC', '-38.1637310124803', '145.13866800000005', 0, '2015-12-06 11:43:50', '2015-12-06 12:51:46'),
(1593, 0, 'Rainbow Network', 'rainbow-network', 'YAK is the SSAITGD youth group based in the City of Melbourne. We meet on the first and third Friday of every month at the FPV Action Centre.\r\n\r\nWho is the group for: SSAITGD young people and their allies between the ages of 12 and 25. \r\n\r\nWe''re based in the City of Melbourne, but open to young people from across the state of Victoria.', 1, 0, 0, 'yWO4vpBIUGM4eYDY.png', '9660 4700', '', 'http://www.fpv.org.au/portals/youngpeople/', 'yak@fpv.org.au', 'https://www.facebook.com/ZoeBelleGenderCentre', 'http://www.twitter.com/zoebellegc', '', '1/92-94 Elizabeth St, Melbourne VIC 3000, Australia', '-37.815731', '144.96416999999997', 0, '2015-12-10 03:38:45', '2015-12-10 03:38:45'),
(1594, 0, 'GLHV Gay Lesbian Health Victoria', 'glhv-gay-lesbian-health-victoria', 'What is Gay and Lesbian Health Victoria?\r\nGay and Lesbian Health Victoria (GLHV) is a lesbian, gay, bisexual, transgender and intersex(LGBTI) health and wellbeing policy and resource unit. \r\n\r\nGLHV is funded by the Victorian Government and sits within the Australian Research Centre in Sex, Health and Society (ARCSHS), La Trobe University.\r\n\r\nGLHV is committed to improving the health and wellbeing of LGBTI Victorians and the quality of care they receive.', 1, 0, 0, 'imVzxfEABkzsr0b7.png', '(03) 9479 8724', '', 'http://www.glhv.org.au/', 'info@glhv.org.au', '', '', '', '215 Franklin St, Melbourne VIC 3000, Australia', '-37.8095542', '144.95761519999996', 0, '2015-12-10 03:41:35', '2015-12-10 03:41:35'),
(1595, 0, 'Zoe Belle Gender Centre', 'zoe-belle-gender-centre', 'Do you have a question about gender issues? Why not ask us… and other knowledgeable people from the sex and gender diverse community across Australia. Simply visit the ZBGC Questions and Answers site and post your question there. It’s quick and easy, and you can ask anonymously if you wish.\r\n', 1, 0, 0, 'HfzjvcCDQSYOOeu3.PNG', '', '', 'http://www.zbgc.com.au/', 'contact@gendercentre.com', 'https://www.facebook.com/ZoeBelleGenderCentre', 'http://www.twitter.com/zoebellegc', '', '72 Paisley St, Footscray VIC 3011, Australia', '-37.8000501', '144.8948077', 0, '2015-12-10 03:45:09', '2015-12-10 03:45:09'),
(1596, 0, 'QLife', 'qlife', 'QLife is Australia’s first nationally-oriented counselling and referral service for Lesbian, Gay, Bisexual, Transgender and Intersex (LGBTI) people. The project provides nation-wide, early intervention, peer supported telephone and web based services to diverse people of all ages experiencing poor mental health, psychological distress, social isolation, discrimination, experiences of being misgendered and/or other social determinants that impact on their health and wellbeing.', 1, 0, 0, '4mSCPDoc19ib9WzS.gif', '1800 184 527', '', 'https://qlife.org.au', 'ask@qlife.org.au', 'https://www.facebook.com/qlifeaus', 'https://twitter.com/QLifeAustralia', '', '', '', '', 0, '2015-12-10 03:49:57', '2015-12-10 03:51:40'),
(1597, 0, 'Gay / Lesbian - Australian Health Directory', 'gay-lesbian-australian-health-directory', 'Support organisations, support groups and health services for the gay and lesbian communities ', 1, 0, 0, NULL, '', '', 'http://ow.ly/VH6hF', 'service@healthdirectory.com.au', '', '', '', '', '', '', 0, '2015-12-10 03:53:49', '2015-12-10 04:02:10'),
(1598, 0, 'Touching Base Inc', 'touching-base-inc', 'Touching Base Inc is a charitable organisation, based in Sydney NSW Australia, that has been active since October 2000. Touching Base developed out of the need to assist people with disability and sex workers to connect with each other, focusing on access, discrimination, human rights and legal issues and the attitudinal barriers that these two marginalised communities can face. Information for people with disability or their carers on how to access the sex industry and the Touching Base Referral List is contained in the Clients section of this website. Information for sex workers including training workshops, resources and information about disability is contained in the Sex Workers section of this website. We also regulary offer training workshops tailored to Disability Service Providers. Please click here for more information. This website contains some material of a sexual nature suitable for adults only. Currently, Touching Base does not receive any government funding.', 1, 0, 0, 'SgFOzTeul71wPUIZ.jpg', '0424 591 409', '', 'http://www.touchingbase.org/', 'info@touchingbase.org', 'https://www.facebook.com/TouchingBaseInc', '', '', 'Newtown NSW, Australia', '-33.8965493', '151.17996319999997', 0, '2015-12-10 03:57:08', '2015-12-10 03:58:43'),
