INSERT INTO `posts` (`id`, `type`, `title`, `slug`, `content`, `created_at`, `updated_at`) VALUES
(6, 'news', 'Is Australia ready for real choice?', 'is-australia-ready-for-real-choice', '<p><span id="docs-internal-guid-c84b1abd-c2b5-1a9d-2592-2180036f565e"><span style="font-size: 12px; font-family: Arial; color: rgb(60, 60, 60); vertical-align: baseline; white-space: pre-wrap;">Overseas holidays, sex workers, internet dating subscriptions, tickets to sporting events...The NDIS has been designed to give people with disability greater choice and control. This may include supporting individuals to access services that haven’t been funded traditionally. Helen Dickinson, Associate Professor, Public Governance at the University of Melbourne, addresses the burning question: Is Australia ready to give people real choice and control? </span></span></p><p><span id="docs-internal-guid-c84b1abd-c2b5-1a9d-2592-2180036f565e"><a href="https://theconversation.com/is-australia-ready-to-give-people-with-disability-real-choice-and-control-over-services-50312"><span style="font-size: 12px; font-family: Arial; color: rgb(17, 85, 204); font-weight: 700; text-decoration: underline; vertical-align: baseline; white-space: pre-wrap;">Read it in the Conversation.</span></a></span><br></p>', '2015-12-21 04:19:47', '2015-12-21 04:19:47'),
(7, 'news', 'People power on the rise', 'people-power-on-the-rise', 'A pronounced increase in the number of people using SupportDirectory.com.au in NDIS trial sites indicates that people power is already transforming the disability services sector.\r\n\r\n<p>‘‘We are seeing increasing traffic across most support categories in the NDIS sites,’ said SupportDirectory’s John Roberts. ‘Based on feedback we’ve received, several hundred people in the greater Barwon area changed their providers or accessed new services in the past year. ‘People are using SupportDirectory to identify local services that they could not access under previous funding arrangements or did not know existed.</p>\r\n\r\n<p>‘People are telling us their lives have been markedly improved - in some cases simply by changing the way services are delivered; and in other cases by finding services that are a better fit for individuals’ goals.’</p>\r\n\r\n<p>Providers are also responding to the public’s changing expectations by adding new services or partnering with providers of complementary services. </p>\r\n\r\n<p>‘We’ve been pleased by the enthusiasm shown by most providers to be part of the solution, by verifying their listings and keeping them up to date,’ Mr Roberts said. ‘It’s the support we need to ensure that as the NDIS rolls out across the country SupportDirectory can provide people with disabilities and their families with real choice and control over the decisions that can change lives.’</p>\r\n', '2015-12-21 04:21:46', '2015-12-21 04:21:46'),
(8, 'news', 'Feeling better in isolation', 'feeling-better-in-isolation', '<p>NDIS participants feel that the scheme has helped them gain more control over their lives, their wellbeing and daily living, but has not helped in other areas such as relationships, lifelong learning, work and community participation, according to a recent survey by the NDIA (National Disability Insurance Agency).</p>\r\n\r\n<p>The NDIA’s pilot study of the NDIS Outcomes Framework involved interviews with almost 400 NDIS participants, their families and carers.  The graph below shows results from participants aged 25 to 55. </p>\r\n\r\n<p>The NDIA is responsible for measuring and reporting on the Scheme''s aim to assist people with disability to live ‘an ordinary life’ -  that is, to fully realise their potential, to participate in and contribute to society, and to have a say in their own future. Feedback from families and carers of participants was less positive than from participants. More than half said the NDIS supported them to provide care, but fewer than half thought the scheme had helped with health and wellbeing.</p>\r\n\r\n<p><a href="http://www.ndis.gov.au/document/outcomes-framework-pilot#_ftnref1">Read the Summary report here</a></p>\r\n', '2015-12-21 04:23:39', '2015-12-21 04:23:53');
